INSERT INTO `data_ori` (`id_data_ori`, `pertanyaan`, `jawaban`) VALUES
(1, 'Saya mau tanya resepsi penyakit asma, engap apa? Saya sudah lama penyakit asma suka olahraga jantungku seolah degdegan dan teman aku sudah lama penyakit engap diberi jalan jalan seolah engap setiap jalan', 'Asma adalah suatu bentuk penyakit kronis atau penyakit yang berlangsung lama, dimana penderitanya akan mengalami penyempitan saluran napas akibat pemicu tertentu. Pemicunya ini bisa berupa stress, udara dingin, polusi dan asap rokok, kelelahan, serta alergi. Akibatnya, napas bisa jadi terasa sesak, dan bahkan mengeluarkan bunyi. Penyebab dari kondisi ini belum diketahui hingga sekarang, namun memang risikonya meningkat pada mereka dengan riwayat alergi dan keluhan serupa pada keluarga.\r\nMengenai pertanyaan Anda, obat asma sayangnya tidak dapat dibeli begitu saja tanpa resep dokter dan itu berarti Anda harus memeriksakan diri Anda ke dokter paru terlebih dahulu untuk memudahkan pengobatannya. Dokter nanti akan memberikan Anda dua jenis obat, pelega dan pengontrol, yang masing-masing berfungsi untuk mengurangi gejala ketika kambuh, dan untuk mencegah kekambuhannya itu sendiri. Kondisi Anda nanti akan dikontrol tiap beberapa waktu sekali dan dilakukan evaluasi untuk menentukan apakah obatnya sudah tepat dosisnya atau belum. Bila belum, yang ditandai dengan Anda masih sering kambuh, dosisnya akan ditambah secara bertahap hingga terkontrol.\r\nIntinya, Anda perlu untuk segera memeriksakan diri Anda ke dokter paru agar bisa segera diberikan penilaian dan penanganan yang tepat bagi Anda. Sementara itu, kenali apa saja yang menjadi pemicu rasa sesak pada diri Anda dan hindari sebisa mungkin. Sekian, semoga menjawab pertanyaan Anda. '),
(2, 'Boleh tidak saya makan obat asma (salbutamol) setelah saya makan martabak? Tetapi sebelumnya juga tidak makan nasi. Berbahaya atau tidak', 'Dalam menjawab pertanyaan Anda, ada dua hal yang harus Anda sepakati. Yang pertama adalah bahwa rokok itu mengandung ribuan zat berbahaya, dan yang kedua adalah Anda tidak harus menjadi perokok aktif untuk bisa terkena dampak buruk dari rokok. Hanya dengan menjadi perokok pasif saja, atau menghirup asap dari perokok lain, Anda sudah bisa terkena dampak buruknya.\r\nApa yang Anda alami sekarang, kemungkinan memang adalah dampak dari menghirup asap tersebut. Asap yang masuk ke dalam saluran pernapasan Anda bisa menyebabkan iritasi dan peradangan, yang diwujudkan dengan munculnya gejala tersebut. Hal ini akan semakin parah jika Anda memang memiliki penyakit pernapasan tertentu, seperti asma atau PPOK.\r\nYang jelas untuk sekarang, hindari asap rokok sebisa mungkin, karena itu tidak baik untuk Anda. Bahkan yang tidak sampai merasa tercekik seperti Anda saja bisa tiba-tiba mengalami kanker paru meski ia tidak merokok, apalagi jika Anda sudah terlikupi dengan asap rokok sedemikian rupa hingga merasa tercekik. Gunakanlah cara lain untuk berdiskusi dengan mereka, minta mereka untuk matikan rokoknya ketika sedang berdiskusi, atau jangan bertemu langsung. Anda harus anggap ini kondisi yang serius karena bila nanti Anda sudah terlanjur terkena dampak buruknya yang paling parah, mereka tidak bisa menolong Anda.\r\nJika setelah menghindari asap rokok pun Anda masih merasa demikian, periksakan diri Anda ke dokter paru untuk dilakukan penggalian riwayat dan pemeriksaan lebih lanjut. Sekian, semoga menjawab pertanyaan Anda.'),
(3, 'Apa benar ketika seseorang sudah mengkonsumsi obat hipertensi maka harus selalu minum obat seumur hidupnya, meskipun tekanan darahnya sudah normal? ', 'Hipertensi atau tekaenan darah tinggi adalah salah satu jenis penyakit kronis, atau penyakit yang berlangsung lama. Contoh penyakit kronis lain adalah asma, diabetes, kanker, dan skizofrenia. Pada penyakit-penyakit ini, memang kita harus mengonsumsi obat dalam waktu lama karena penyakitnya tidak segera sembuh.\r\nSehingga mengenai pertanyaan Anda, yang perlu dipahami adalah bukan berarti setelah mengonsumsi obat hipertensi sekali lantas kita harus minum terus seumur hidup seolah ketergantungan, tapi dengan terdiagnosis hipertensi itu saja pun, Anda sudah harus mengonsumsi obat dalam waktu lama. Sebab hipertensi itu tidak dapat membaik bila tidak diberi obat. Untuk obatnya sendiri, Anda bisa hentikan kapanpun Anda mau, tapi karena penyakitnya sendiri belum sembuh, maka bila Anda hentikan obatnya, penyakitnya akan kembali mempengaruhi hidup Anda.\r\nKemudian mengenai kondisi ketika orang yang mengonsumsi obat tersebut tekanan darahnya normal, perlu dipastikan terlebih dahulu, apakah normalnya itu karena obat atau tidak. Jangan-jangan tekanan darahnya normal karena ia memang rutin minum obat. Bila demikian, sebenarnya ia belum \'normal\', sebab bila obatnya diambil, tekanan darahnya akan tinggi lagi. Justru obat itu disebut tidak berhasil bila tekanan darahnya masih tinggi. Sebab untuk apa obat, bila ia tidak berhasil menurunkan tekanan darah. Sehingga jika Anda mengalami tekanan darah tinggi, diberikan obat tapi tekanan darahnya masih tinggi, Anda harus segera melaporkan ke dokter yang merawat Anda, untuk ditambah dosis atau ditambah jenis obatnya. Jadi sekali lagi, tekanan darah yang normal adalah target yang harus dipertahankan, dan bukannya pertanda bahwa obat tidak perlu lagi diberikan.\r\n\r\nSekali waktu, secara berkala dokter biasanya mencoba untuk mengurangi dosis obat untuk mengetahui apakah memang tubuh sudah membaik dalam meregulasi tekanan darah, dan bila tekanan darahnya tidak naik meski dosisnya sudah diturunkan, ini akan dipertahankan selama beberapa waktu dan akan diulangi evaluasinya. Jika memang sudah rendah terus, mungkin obat bisa dihentikan penggunaannya, namun kenyataannya, ini hampir tidak pernah terjadi. Jika seseorang memang mengalami hipertensi biasanya dia akan tetap butuh bantuan obat.\r\nYang jelas, pengaruh pola hidup akan sangat membantu. Maka dari hindari rokok, olahraga teratur, jaga berat badan ideal, dan atur pola makan. Ini akan membantu Anda untuk menghindari perburukan kondisi dan menjaga tekanan darah sedekat mungkin dengan nilai normal. Sekian, semoga menjawab pertanyaan Anda.'),
(4, 'Asma saya kambuh dan harus diuap. Begitu selesai saya dikasih resep. Obat saya minum, kok badan saya berasa lemas. Mual dan badan pegal semua. Padahal biasanya saya tidak pernah begitu. Nama obatnya Asetilsistein dan Alegi.', 'Asma dapat kambuh akibat terjadi pajanan terhadap pencetusnya dimana kondisi serangan ini dapat timbul ringan sampai berat. Jika kekambuhan cukup sering maka perlu untuk dilakukan evaluasi baik pengobatan yang diberikan maupun faktor apa yang memicunya agar dapat dihindari dan asma tidak kembali kambuh.\r\n\r\nObat yang digunakan untuk mengelola asma sendiri ada beberapa macam, baik obat yang untuk meredakan ketika serangan sedang timbul maupun obat yang digunakan untuk mengelola agar tidak kembali terjadi serangan. Obat yang diberikan sendiri juga biasanya digunakan untuk mengatasi gejala lain atau gejala yang menjadi pemicu seperti misalnya ketika sedang batuk dan pilek.\r\n\r\nObat yang diberikan untuk Anda adalah acetylcysteine yang merupakan obat antimukolitik yang berfungsi untuk mengencerkan dahak yang mengganggu saluran pernapasan, obat ini memiliki efek samping seperti mual, muntah, sariawan, mengantuk, pilek ataupun demam. Sedangkan obat kedua yaitu obat yang berisi antihistamin dan kotrikosteroid yang berfungsi untuk mengatasi alergi dan juga peradangan dimana pada asma dapat terjadi peradangan dan penyempitan pada saluran pernapasan. Jika timbul gejala seperti yang dirasakan kondisi tersebut dapat mungkin terjadi akibat efek samping obat ataupun kondisi lain yang menjadi penyebabnya seperti misalnya jika terjadi gangguan pencernaan ataupun demam dan infeksi saluran pernapasan.\r\n\r\nUntuk itu perlu diperhatikan jika mengonsumsi obat serupa dan kembali mengalami hal yang sama maka perlu untuk dihindari karena dapat mungkin merupakan efek samping obat. Periksakan kembali kondisi Anda dan terangkan pada dokter mengenai kondisi yang dialami dan obat apa yang dikonsumsi sehingga dapat dipertimbangkan untuk mengganti dengan obat lain yang sesuai dengan kondisi Anda. Jika timbul reaksi alergi yang lebih berat, sesak napas kembali menyerang, dan timbul keluhan lain seperti ruam kulit, bibir, kelopak mata terasa kebas atau membengkak maka segera datang ke fasilitas kesehatan untuk mendapatkan penanganan.  '),
(5, 'Napas terengah dada sakit jari kaki dan tangan sulit digerakkan, dan mata juga sulit terbuka. Napas tidak teratur, saya tidak sadar. Apa itu berbahaya untuk saya?', 'Asma adalah reaksi alergi yang terjadi pada saluran napas. Ditandai dengan sesak napas disertai suara \"ngi\". Terjadi akibat alergen (seperti debu, serbuk bunga, makanan bahan udang dan telur, udara dingin dan lain-lain) menyebabkan saluran napas mengalami konstriksi sehingga menyempit, ditambah lapisan mukosa saluran napas menghasilkan lendir dalam jumlah banyak sehingga menutupi saluran napas yang menyempit. Maka muncullah sesak napas. Pada saat menghembuskan napas, udara keluar diantara saluran napas yang menyempit dan ditutupi lendir, sehingga muncul suara \"ngik\". Hal ini hanya terjadi pada seseorang yang hipersensitif. Terdapat kaitan yang erat dengan faktor keturunan.\r\nSeseorang yang mengalami asma, dapat memiliki reaksi alergi dalam bentuk yang lain, dari yang ringan (seperti bintik kemerahan yang gatal pada kulit akibat berkontak dengan logam jam tangan penyebab reaksi alergi, bersin-bersin pagi hari akibat debu) hingga kondisi yang berat (reaksi anafilaksis dan angioudema) yang ditandai peningkatan denyut nadi, penurunan kesadaran, muka bengkak dan bibir bengkak). Untuk itu, sebaiknya hindarilah kondisi yang dapat memicu reaksi, seperti udara dingin malam hari. Apabila harus mengikuti kegiatan camping, siapkanlah pakaian penghangat lengkap dari kaus kaki hingga topi dan obat-obatan anti alergi. Karena pada penyakit asma pun dapat terjadi serangan asma yang berat, disebut Serangan asmatikus. Dimana dapat hingga menyebabkan penurunan kesadaran dan henti napas sehingga membutuhkan perawatan intensif.\r\nUntuk apa yang telah anda alami. Sebaiknya berkonsultasi dengan dokter paru anda. Agar dokter dapat melakukan pemeriksaan pada paru-paru anda. Agar dokter dapat menilai derajat berat ringannya penyakit asma pada anda. Dan dapat memberikan pengobatan yang sesuai berdasarkan kondisi berat ringannya penyakit anda.\r\nDemikian semoga bermanfaat.    '),
(6, 'Sesak saat saya tarik napas batuk kering dan susah menarik napas, kenapa? Bangun pagi sering bersin tapi sampai telinga saya kadang kayak terasa tertutup seperti kemasukan air, itu kenanapa?', 'Batuk adalah salah satu cara tubuh dalam mencegah atau mengeluarkan “benda asing” atau zat/partikel tertentu ke saluran pernafasan. Batuk yang hanya sekali-sekali masih bisa disebut wajar, namun jika sudah berulang kali, berhari-hari, hingga berdahak, berdarah, sesak nafas, demam, maka batuk tersebut merupakan salah satu tanda dari adanya penyakit tertentu.Batuk dapat disebabkan oleh infeksi (misalnya: infeksi saluran pernafasan atas, pneumonia, TB, dl), asma, bronchitis, konsumsi obat darah tinggi tertentu, dll.\r\n\r\nAsma sendiri merupakan penyakit kronis (jangka panjang) dimana terjadi penyempitan bronchus (saluran/pipa2 pernafasan di paru-paru) karena seseorang tersebut memiliki sistem saluran pernafasan yang lebih “sensitive” terhadap sesuatu. Gejala asma misalnya sesak nafas, nafas berbunyi mengi saat mengeluarkan nafas, dan batuk-batuk. Gejala tersebut muncul secara hilang-timbul, misalnya ketika terpapar hal yang membuat alergi, stress, zat-zat yang membuat iritasi saluran nafas, maka gejala-gejala tersebut dapat muncul. Memiliki keluarga yang memiliki riwayat asma dapat meningkatkan kemungkinan seseorang untuk menderita asma juga.\r\n\r\nBatuk-batuk merupakan salah 1 gejala asma, namun bisa juga karena kondisi penyakit lain seperti yang sudah saya sebutkan di atas. Untuk menentukan penyebabnya, sebaiknya Anda pergi ke dokter untuk dilakukan pemeriksaan fisik dan penunjang yang diperlukan, misalnya tes darah lengkap, foto ronsen, spirometry, dll. Pengobatannya tergantung dari penyebabnya.\r\n\r\nBersin-bersin bisa disebabkan karena rhinitis (radang pada hidung), bisa karena alergi, infeksi, gangguan hormonal, stress, atau vasomotor. Telinga yang terasa penuh bisa disebabkan karena adanya gangguan pada fungsi tuba eustachius (saluran yang menghubungkan antara tenggorokan dengan telinga) karena ada rhinitis, tonsilitis, radang di telinga, dll; atau karena ada penyumbatan di telinga, misalnya karena penumpukan cerumen (kotoran telinga) atau peradangan di telinga luar atau telinga tengah. Untuk menentukan penyebabnya, harus dilakukan pemeriksaan langsung oleh dokter atau dokter spesialis THT.\r\n\r\nJangan tunda untuk ke dokter jika batuk tidak kunjung reda lebih dari 7 hari, batuk terus berulang, batuk disertai dahak, demam, sesak nafas, batuk disertai darah. Jika memiliki alergi, hindari paparan terhadap hal-hal yang dapat mencetuskan alergi tersebut.  '),
(7, 'Anak saya asma, turunan dari ayahnya, ayahnya sembuh sejak kelas 7 SMP, yang mau saya tanyakan apakah anak saya kuga bisa sembuh? dan mengapa tadi ketika selesai di nebu, anak saya mengeluh rahang kanannya terasa pegal ', 'Kami mengerti kekhawatiran yang anda rasakan. Asma merupakan salah satu manifestasi penyakit alergi di saluran pernapasan. Asma umumnya diwariskan dari orangtua maupun keluarga yang memiliki atopi (kecenderungan ke penyakit alergi).\r\nTerkait dengan pertanyaan anda, seringkali manifestasi/gejala asma pada anak akan mengalami penurunan kekambuhan saat memasuki usia remaja atau dewasa. Beberapa kasus dapat bersifat menetap hingga dewasa. Penyakit asma dapat membaik dengan sendirinya atau melalui pemberian obat untuk mengontrol gejala pada kasus asma persisten sedang hingga berat. Meskipun asma dapat sembuh/menghilang, namun sifat atopi (kecenderungan alergi) akan menetap seumur hidup.\r\nSehingga anda tidak perlu khawatir dengan kondisi anak anda. Sebagian besar kasus asma pada anak akan membaik seiring peningkatan usia mereka.\r\nNamun anda tetap harus melakukan kontrol dan pemeriksaan ke dokter untuk anak anda agar mendapatkan evaluasi dan pengobatan lebih lanjut bila gejala asma kembali kambuh. Obat obatan untuk pengontrol asma ( digunakan jangka panjang) dan pelega ( digunakan saat gejala akut dirasakan) dapat membantu mengurangi gejala asma yang dirasakan.\r\nMengenai rahang yang pegal, kemungkinan dapat disebabkan oleh penggunaan nebu yang terlalu lama atau posisi tubuh atau nebu yang salah. Pegal seringkali disebabkan karena masalah pada otot. Selama tidak dirasakan nyeri, ada pembengkakan maupun kemerahan pada rahang, anda tidak perlu khawatir. Berikanlah waktu istirahat untuk anak dan berikanlah kompres dengan air dingin bila perlu.\r\nDemikian informasi yang dapat kami sampaikan, semoga membantu'),
(8, 'Hasil pemeriksaan radiologi cor: CTI < 50 %. Aorta normal. Mediastinum tidak melebar Pulmo: corakan brankovaskular kedua paru tampak normal infiltrat (-), hilus normalSinus, diafragma dan costae normal. Kesan: cor dan pulmo dalam batas normal artinya dari hasil ini apa ya?', 'X-Ray, merupakan salah satu pemeriksaan penunjang medis radiologis untuk mendapatkan gambaran atau pencitraan organ dalam tubuh yang dalam hal ini dilakukan pada bagian dada. Pemeriksaan xray merupakan pemeriksaan penunjang medis yang tentunya di gunakan sebagai pemeriksaan tamvahan untuk menunjang diagnosis atau kecurigaan ke arah masalah medis tertentu yang perlu dilakukan kesesuaian dengan hasil penelian klinis secara langsung melalui wawancara medis dan pemeriksaan fisik secara langsung.\r\nBerdasarkan informasi yang anda sampaikan, menunjukan tidak ada pembesaran jantung, rongga jantung dan janyung berada dalam batas normal. Gambaran paru dalam batas normal, tidak tampak adanya penanda infeksi maupun cairan pada paru. Sehingga secara keseluruhan didapatlan kesan jantung dan paru dalam batas normal.\r\nSesak saat tidur, tenggorokan berlendir bisa di sebabkan oleh beberapa faktor, seperti:\r\nGERD\r\nFaringitis\r\nTonsilitis\r\nAsma\r\nAkan lebih baik bila anda dapat memeriksakan diri ke dokter umum terdekat untuk evaluasi lebih lanjut'),
(9, 'Saya punya penyakit asma, kalau saya stres, atau habis marah, biasanya langsung kambuh. Apakah penyakit asma itu bisa merambat ke jantung?', 'Asma dibedakan menjadi dua yaitu Asma kardial dan Asma bronkial. Asma bronkial merupakan penyakit yang dikarenakan adanya peradangan dan penyempitan saluran pernapasan yang sehingga dapat membuat sesak napas. Selain sesak, asma dapat disertai dengan gejala lain seperti batuk, nyeri dada dan mengi. Sedangkan asma kardial timbul karena adanya kelainan pada jantung (gagal jantung). Jadi gagal jantung yang dapat menimbulkan gejala asma.\r\n\r\nKomplikasi yang dapat timbul karena asma adalah tubuh sering merasa lelah, menurunnya aktifitas, gangguan pertumbuhan pada anak-anak, status asmatikus (kondisi asma parah yang tidak respon dengan terapi pada umumnya), pneumonia, gangguan pernapasan, kerusakan pada sebagian atau seluruh paru-paru dan hingga kematian. '),
(10, 'Saya sering tiba-tiba sesak napas, Kaki dingin, Pusing, Gelisah, Tapi tidak ada batuk. tapi waktu saya diperiksa ke dokter, Paru-paru saya baik. Gejala penyakit apa ini?', 'Melihat keluhan dan riwayat pemeriksaan anda, keluhan tersebut dapat saja disebabkan oleh beberapa kondisi seperti:\r\nAsma\r\nKekurangan gula darah\r\nGangguan irama jantung (aritmia)\r\nKurang darah (anemia)\r\nGangguan cemas\r\nSerangan panik\r\nGangguan psikosomatis\r\nApabila keluhan ini memang cukup sering dirasakan dan menggangu aktivitas anda, sangat disarankan untuk memeriksakan keluhan anda kembali ke dokter. Dokter mungkin akan menyarankan anda untuk melakukan beberapa pemeriksaan tambahan untuk membantu melihat kondisi paru-paru anda seperti foo rontgen paru, rekam jantung, pemeriksaan gula darah atau pemeriksaan lainnya sesuai dengan pertimbangan dokter. Setelah itu, baru dapat ditentukan apa terapi yang sebaiknya diberikan, bahkan bila diperlukan, dokter anda mungkin saja akan menyarankan anda untuk berkonsultasi lebih lanjut dengan dokter spesialis tertentu sesuai dengan penyebab keluhan anda.\r\nSaat ini, perhatikanlah apakah ada waktu-waktu tertentu atau hal-hal tertentu yang memicu anda mengalami keluhan tersebut (misanya saat sedih, saat emosi, menghirup debu, dan lain-lain). Bila ada, usahakan untuk menghindari hal-hal tersebut. Disaranakn pula untuk anda meminimalisir mengalami stres, melakukan olahraga secara teratur dan berisitiahat dengan cukup setiap harinya. Tidak disarankan menggunakkan oat-obatan apaun tanpa adanya anjuran yang jelas dari dokter.'),
(11, 'Sering bernapas manual dan dangkal terus kepikiran kalau tidur suka susah karena harus ngatur napas dulu, keesokan harinya seperti itu lagi terus berulang dan bikin mood saya jelek terus kejadiannya sehabis demam, kira-kira apakah saya harus cek kesehatan atau tidak?', 'Sistem pernapasan pada manusia terdiri dari banyak organ mulai dari organ pernapasan serta persarafan yang mengatur pola napas dimana tubuh akan mengirimkan sinyal pada otak untuk menggerakkan sistem pernapasan. Sistem pernapasan sendiri diatur oleh pusat pernapasan yang bertanggung jawab untuk mengontrol pernapasan secara otomatis sehingga kita tidak akan lupa bernapas baik saat beraktivitas ataupun saat tidur. Baik secara sadar atau tidak tetapi kita juga dapat mengatur untuk mengendalikan napas terlebih pada kondisi tertentu seperti misalnya saat berenang, saat berlari dan lainnya.\r\n\r\nJika terdapat gangguan pada saluran pernapasan hal ini yang dapat membuat timbulnya gangguan seperti saluran napas yang tersumbat, hidung mampet, pilek, batuk dan lainnya sehingga merasakan adanya gangguan pada jalan napas. Dalam hal ini banyak yang menjadi penyebabnya mulai dari infeksi saluran napas, flu, batuk pilek ataupun terjadi sesak napas karena kondisi lain seperti misalnya gangguan pada fungsi paru atau penyakit menahun seperti asma.\r\n\r\nUntuk membantu agar dapat lebih nyaman saat tidur dan mengatasi hidung tersumbat dapat dilakukan beberapa upaya diantaranya dengan membuat suhu ruangan tidak terlalu dingin, banyak mengonsumsi cairan terlebih air hangat, mandi air hangat, menghirup uap air hangat, menggunakan bantal yang lebih tinggi saat tidur, menggunakan obat pelega saluran napas baik obat minum, obat hirup ataupun obat tetes jika diperlukan dan periksakan diri pada dokter jika keluhan demam berlanjut ataupun timbul disertai gejala lain seperti sesak napas, bibir kuku tampak kebiruan, demam tinggi, mual dan muntah serta sakit kepala hebat.\r\nSemoga bermanfaat.   '),
(12, 'Saya ada alergi terhadap obat yang mengandung gin dan saya juga punya riwayat penyakit asma, apakah saya boleh konsumsi viagra? Dan dosisnya harus seberapa?', 'Viagra merupakan obat yang mengandung sildenafil. Obat ini berfungsi untuk mengatasi disfungsi ereksi / impotensi pada pria dengan jalan meningkatkan aliran darah pada jaringan penis. Secara umum obat ini tidak boleh digunakan pada orang dengan riwayat alergi sildenafil, gagal jantung, gangguan hati berat, kelainan fungsi retina bawaan, dan harus berhati-hati pada orang dengan gangguan jantung, tekanan darah tinggi, tekanan darah rendah, gangguan ginjal, dan stroke.\r\nObat ini merupakan obat resep yang pemakaiannya sebaiknya atas anjuran dokter dan dibawah pengawasan dokter. Oleh sebab itu, saya sarankan agar Anda berkonsultasi dulu dengan dokter sebelum menggunakan obat ini ya. Dosis akan ditentukan oleh dokter setelah melakukan pemeriksaan pada Anda.'),
(13, 'Saya punya asma kemarin waktu kambuh dikasih resep obat macamnya 4 Tapi yang saya minum 2 macam saja yaitu ambroxol dan teosal apakah bahaya? ', 'Teosal mengandung zat aktif teofilin dan salbutamol. Keduanya merupakan jenis obat bronkodilator, yaitu bekerja untuk melebarkan saluran napas dengan cara melemaskan otot pernapasan sehingga diharapkan keluhan sesak berkurang. Sedangkan ambroxol merupakan jenis mukolitik, yaitu berfungsi untuk mengencerkan lendir di saluran napas sehingga lebih mudah dikeluarkan melalui mekanisme batuk. Keduanya memiliki cara kerja yang berbeda dan seringkali dikombinasikan pada beberapa kondisi misalnya pada kasus asma. Anda dapat mengonsumsi keduanya dalam waktu yang bersamaan jika memang sebelumnya telah diresepkan, namun sebaiknya dalam jangka waktu tertentu yang telah direkomendasikan oleh dokter yang menangani sesuai dengan kondisi medis anda agar tidak terjadi efek samping yang tidak diinginkan. Jika sudah diresepkan beberapa jenis obat, sebaiknya baca kembali petunjuk pemakaiannya di label obat. Beberapa jenis obat memang tidak untuk dikonsumsi sampai habis, yakni hanya jika ada gejala saja, sementara yang lainnya perlu dikonsumsi hingga jangka waktu tertentu.\r\nSekian, semoga dapat membantu'),
(14, 'Saya mau nanya kenapa ya setiap saya lari atau jalan kaki terlalu jauh paru paru saya terasa sakit banget dulu saya pernah terkena penyakit paru paru kering apa ada hubungannya sama itu ya?', 'Paru-paru pada dasarnya tidak dapat merasakan/menimbulkan rasa nyeri sehingga tidak terdapat istilah medis berupa nyeri pada paru-paru, keluhan nyeri yang anda rasakan tersebut mungkin merupakan rasa tidak nyaman pada dada, nyeri pada dada atau sesak napas. Penggambaran keluhan yang anda rasakan tersebut sangat diperlukan untuk menentukan dari mana kemungkinan keluhan anda berasal dan apa saja kemungkinan kelainan pada organ tersebut. Kemungkinan yang cukup sering menimbulkan keluhan seperti anda adalah asma, penyakit paru obstruktif kronis (PPOK), bronkitis, gagal jantung, penyakit jantung koroner, atau penyakit asam lambung (GERD).\r\nBegitu pula dengan penyakit paru-paru kering, tidak ada istilah tersebut secara medis sehingga sangat disarankan untuk menanyakan kembali nama penyakit tersebut kepada dokter yang mendiagnosa anda sehingga dapat ditentukan apakah memang benar riwayat penyakit paru-paru anda tersebut berpengaruh pada keluhan anda saat ini atau tidak.\r\nUntuk saat ini sendiri, sangat disarankan untuk kembali memeriksakan keluhan anda ke dokter meskipun sedang tidak muncul. Anda mungkin disarankan untuk menjalani beberapa pemeriksaan untuk memastikan penyebabnya seperti foto rontgen dada, pemeriksaan fungsi paru, rekam jantung, treadmill test, atau pemeriksaan lainnya sesuai pertimbangan dokter. Setelah itu, baru dapat ditentukan apa diagnosa kondisi anda, apakah kondisi ini berhubungan dengan riwayat penyakit anda sebelumnya dan bagaimana terapi selanjutnya. Bila diperlukan, anda dapat saja dirujuk kepada dokter spesialis bidang tertentu untuk memastikan anda mendapatkan terapi yang optimal.\r\nSementara ini, perhatikkan seberapa jauh anda berjalan untuk menimbulkan keluhan tersebut dan apakah jaraknya semakin memendek atau tidak, dan apakah semakin sering. Bila memungkinkan, hindari pencetusnya. Tidak disarankan untuk melakukan olahraga berat terlebih dahulu hingga ada anjuran lain dari dokter anda. Tidak disarankan untuk mengonsumsi obat-obatan pelega napas atau obat nyeri apapun tanpa anjuran yang jelas dari dokter.\r\nApabila keluhan sedang kambuh dan dirasakan sangat berat atau tidak mengalami perbaikan dengan istirahat, sangat disarankan untuk segera ke IGD rumah sakit untuk mendapatkan penanganan lebih lanjut.\r\nSemoga membantu.'),
(15, 'Saya mau bertanya, ibu saya usia 46 tahun mempunyai riwayat darah tinggi, beliau belakangan mengeluhkan napas sesak disertai bunyi ngik, kemudian kaki dan punggung dingin sekali, sering kali keluar dahak, punggung juga terasa sakit, ibu saya kira-kira mengalami penyakit apa ya? ', 'Sesak napas disertai bunyi ngik ngik dan batuk berdahak dapat disebabkan oleh beberapa kemungkinan penyebab:\r\n1. Asma: penyempitan saluran pernapasan yang dapat menimbulkan gejala sesak napas, sampai terdengar suara ngik ngik, biasanya disebabkan oleh debu, asap atau alergi terhadap suatu makanan\r\n2. PPOK: penyakit paru obstruktif kronik artinya terjadinya kelainan pada paru akibat adanya sumbatan, biasanya dihubungkan dengan kebiasan merokok aktif atau perokok pasif yang sering terpapar asap rokok\r\n3. Infeksi saluran pernapasan: infeksi saluran pernapasan dapat menimbulkan keluhan batuk dahak kuning kehijauan, sesak dan demam\r\nuntuk mengetahui lebih lanjut mengenai penyebab, diagnosis dan pengobatan dari keluhan yang anda alami, sebaiknya segera berkonsultasi dengan dokter spesialis paru.\r\npencegahan yang dapat dilakukan:\r\n1. Menggunakan masker penutup hidung dan mulut\r\n2. Mengkonsumsi air mineral minimal 2L perhari\r\n3. Menjauhkan diri dari asap dan debu serta pemicu kambuhnya asma dan alergi lainnya\r\ndemikian semoga bermanfaat'),
(16, 'Saya berumur 23 tahun saya penderita asma sejak saya smp tapi masih ringan tidak pernah kambuh, sekarang saya sudah berkeluarga memiliki 2 anak di 2 tahun terakhir ini asma saya makin parah dok hampir tiap malam kambuh. Dan saya diberi obat Dr (salbutamol) yang saya minum tiap saya kambuh. Saya mau tanya dok apakah asma bisa sembuh? bagaimana caranya dok?', 'Pada dasarnya, asma adalah suatu penyakit yang tidak bisa sembuh secara total, melakinkan hanya dapat dikontrol agar gejalanya tidak sering timbul dengan menggunakan obat dan menghindari pencetus kambuhnya asma tersebut.\r\n\r\nSementara di rumah, bila timbul gejala sesak dapat dikonsumsi obat salbutamol yang sudah diresepkan sesuai anjuran dokter dan juga dibantu dengan menghindari hal-hal yang dapat menimbulkan gejala (misalnya debu, asap, udara dingin, dan lain-lain tergantung individu). Tetapi, apabila gejala yang anda rasakan timbul semakin sering, semakin berat, dan kurang membaik dengan obat yang sudah diresepkan, sebaiknya anda kembali memeriksakan diri ke dokter untuk dilakukan penilaian ulang mengenai keadaan asma anda, apakah perlu diberikan pengobatan melalui uap, pemberian tambahan obat untuk mengontrol gejala di rumah, atau bahkan perlu perawatan di rumah sakit.\r\n\r\nSemoga membantu. '),
(17, 'Ibu saya mengalami kecelakaan pada tulang siku bergeser (elbow dislocation) sudah 3 bulan yang lalu dan konsultasi pada dokter spesialis tulang disarankan untuk operasi kendalanya ibu saya punya riwayat asma, apakah aman jika melakukan operasi? ', 'Operasi memang merupakan suatu prosedur yang memiliki banyak risiko, karena itu penting untuk mengetahui apakah seseorang itu layak atau tidak dalam menjalani operasi. Sebenarnya, ada berbagai macam jenis operasi dan berbagai macam teknik pembiusan yang secara spesifik memiliki kriteria kelayakan pasien yang berbeda-beda. Namun secara umum, diantaranya yang tidak layak menjalani operasi adalah:\r\nMemiliki gangguan pembekuan darah, atau ketika berdarah sulit berhenti\r\n•	Memiliki diabetes yang tidak terkontrol\r\n•	Memiliki tekanan darah tinggi yang tidak terkontrol\r\n•	Memiliki gangguan jantung tertentu\r\nSehingga asma bukan merupakan salah satu hal yang pada umumnya menghalangi ibu Anda dari menjalani operasi. Namun terlepas daripada itu, bila ibu Anda sudah menyetujui untuk dilakukan operasi, biasanya dokter anestesi atau pembiusan akan mendatangi ibu Anda sehari sebelum dilakukannya operasi untuk melihat kesiapan tubuh ibu Anda. Jika saat pemeriksaan tersebut ibu Anda dinilai tidak siap, baik itu karena asma atau karena sebab lainnya, operasi akan ditunda. Dokter tulang Anda juga tidak akan mau menjalani operasi yang penuh risiko, terutama bila kondisinya tidak gawat darurat. Selain itu, jika memang asma ibu Anda tidak terkontrol dan Anda mengkhawatirkan itu menjadi masalah, Anda bisa dari awal mendiskusikannya dengan dokter tulang Anda. Dengan begitu, bisa ditentukan dari sekarang, apa pilihan penanganan terbaik bagi ibu Anda. Sekian, semoga menjawab pertanyaan Anda.'),
(18, 'Saya merasakan dada saya sakit, sehingga saya kesulitan untuk bernapas. Lalu saya mudah sekali merasakan lelah. sebelumnya, saya mengalami gejala batuk-batuk sampai suara hilang, saya sering demam tinggi. itu semua saya alami dalam sebulan terakhir. barulah beberapa hari lalu saya kesulitan bernapas, sampai hari ini rasanya semakin sakit. pertanyaannya, apakah saya terkena ISPA atau ASMA?', 'Kami mengerti ketidaknyamanan yang anda rasakan.\r\nAsma dan ISPA merupakan dua jenis penyakit yang berbeda. Asma merupakan salah satu penyakit karena alergi, timbul gejala sejak usia anak anak dan umumnya gejala akan mulai mereda saat memasuki usia dewasa. Asma akan timbul pada seseorang yang memiliki atopi (kecenderungan memiliki alergi), bersifat diturunkan dari orang tua maupun keluarga sehingga gejala akan sering muncul atau hilang dan timbul ketika dipicu oleh alergen dari luar seperti debu, polusi, tungau, serbuk, makanan, perubahan suhu dan lingkungan.\r\nBerbeda dengan ISPA (infeksi saluran pernapasan atas) yang dapat terjadi akibat infeksi virus maupun bakteri. Selain itu, penyakit ini juga dapat dipengaruhi oleh faktor lain seperti perubahan suhu dan paparan udara akibat polusi.\r\nPaparan asap secara langsung dapat menimbulkan peradangan pada saluran pernapasan tersebut. Udara yang kotor juga bisa membawa beragam kuman yang masuk ke saluran pernafasan dan menimbulkan peradangan.\r\nSehingga, apabila sebelumnya anda tidak pernah mengalami gejala alergi, maupun gejala asma yang kambuh, maka kemungkinan gejala yang anda alami saat ini merupakan ISPA.\r\nNamun dibutuhkan serangkaian pemeriksaan untuk menilai penyakit tersebut secara pasti dengan pemeriksaan fisik secara langsung dan pemeriksaan penunjang seperti laboratorium darah, rontgen, tes alergi dan beberapa tes lainnya untuk mencari diagnosis yang pasti.\r\nDemikian informasi yang dapat kami sampaikan, semoga membantu'),
(19, 'Saya ingin bertanya, saya akhir-akhir ini mengalami sesak napas, bahkan dada saya saat saya baring terasa sangat berat untuk bernapas, kira-kira itu disebabkan apa, di tempat saya sekarang lagi terkena asap kabut yang begitu parah, kadang saya keluar tidak memakaai masker, tapi sebelumnya saya punya riwayat sakit tbc, sudah sembuh sekitar 10 bulan yang lalu, apa upaya yang bisa saya lakukan supaya bisa sembuh, dan tidak sesak lagi', 'Asap kebakaran hutan dapat menyebabkan gangguan kesehatan mulai ringan hingga berat bahkan mengancam nyawa. Pada individu yang memiliki riwayat penyakit asma atau penyakit paru obstruksi kronik (PPOK) akan lebih berisiko karena potensi gejala yang timbul akan semakin berat. Gejala yang timbul di saluran napas akibat paparan asap misalnya sesak, batuk, nyeri dada, suara mengi. Namun tidak halnya dengan riwayat penyakit TB paru karena tidak berhubungan dengan paparan asap lingkungan.\r\nJika memiliki riwayat kedua penyakit tersebut dan mengalami sesak yang semakin memberat maka harus segera mendapatkan pertolongan medis. Begitu pula pada kasus anda, jangan ragu untuk berkonsultasi dengan dokter jika belum terdapat perbaikan gejala klinis.\r\nBerikut adalah rekomendasi yang dapat dilakukan disaat bencana asap kebakaran hutan sedang terjadi, antara lain:\r\n1. Sebisa mungkin tetap berada di dalam rumah atau ruang tertutup\r\n2. Hindari berolahraga diluar ruangan\r\n3. Tutup jendela kendaraan disaat sedang mengendarai\r\n4. Pintu dan jendela ruangan selalu tertutup\r\n5. Gunakan pengaturan resirkulasi udara pada pendingin ruangan\r\n6. Gunakan masker terstandar jika harus menjalani aktivitas di luar ruangan\r\nSekian, semoga dapat membantu.'),
(20, 'Berapa kali semprot inhaler bisa dikonsumsi dalam sehari. Bolehkah di semprot berkali-kali ketika asmanya kambuh', 'Inhaler biasanya mengandung obat golongan bronkodilator yang berfungsi melebarkan saluran pernapasan. Inhaler banyak digunakan untuk penatalaksanaan pasien asma. Berbagai jenis inhaler terdapat di pasaran dengan kandungan obat yang berbeda-beda, kebanyakan digunakan sebagai reliever, yakni untuk mengatasi serangan asma akut dan meredakan gejala sesak napas. Inhaler jenis ini dapat digunakan bila pasien merasa sesak napas.\r\nAda juga inhaler dengan kandungan obat yang bersifat sebagai controller, yakni mencegah serangan asma berulang. Umumnya selain mengandung bronkodilator, juga terdapat kandungan obat lain seperti kortikosteroid. Obat ini biasanya dipakai setiap hari, dengan dosis bervariasi bisa 2-3 kali sehari dengan jumlah dosis penyemprotan (puff) yang disesuaikan dengan kondisi pasien.\r\nBentuk inhaler juga bervariasi ada yang berupa tabung kecil dengan gas yang dihirup dan juga ada yang berisikan bubuk yang dihirup. Pasien harus dapat menggunakan inhaler sesuai petunjuk penggunaan yang benar baru kemudian obat bisa berfungsi secara maksimal dan bermanfaat.\r\nBila inhaler yang anda miliki mengandung obat salbutamol, jenis inhaler ini sebaiknya digunakan maksimal 4 kali sehari 1-2 puff setiap kali menyemprot. Beri jeda waktu 15-30 menit sebelum penyemprotan berikutnya. Bila Anda masih sesak setelah penggunaan inhaler tersebut, sebaiknya segera ke instalasi gawat darurat untuk mendapatkan penanganan lain seperti nebulisasi atau pemeriksaan untuk menentukan penyebab sesak yang anda alami.\r\nObat golongan bronkodilator memiliki efek samping jantung berdebar bahkan gangguan ritme jantung pada penggunaan dosis besar atau penggunaan sembarangan. Bila Anda merasa perlu menyemprotkan inhaler berkali-kali dalam sehari, kemungkinan:\r\nAnda membutuhkan obat lain untuk mengontrol asma Anda (obat jenis controller)\r\nCara penggunaan inhaler yang salah\r\nSesak napas buka disebabkan karena kelainan saluran pernapasan\r\nDemikian penjelasan dari saya, semoga bermanfaat.'),
(21, 'Anak saya memakai Seretide untuk pileknya. Anjuran dokter 1 kali semprot, tapi kakaknya lupa dan dia semprot kan sebanyak 3 kali pada adiknya. Kira-kira itu berbahaya tidak dok? Anak saya umur 4 tahun lebih.', 'Seretide adalah obat semprot yang mengandung fluticasone (golongan kortikosteroid, untuk mengatasi peradangan) dan salmeterol (yang berfungsi membuka saluran pernapasan) yang digunakan untuk mengatasi asma dan penyakit paru obstruktif kronik. Pemberian dosis yang berlebihan dapat menyebabkan jantung berdebar, napas yang bertambah cepat, gemetaran, sakit kepala, tekanan darah yang meningkat, dan peningkatan gula darah. Jika Anda melihat tanda-tanda tersebut pada anak Anda (napas menjadi cepat, gemetaran) atau anak menjadi rewel, silakan Anda segera memeriksakan kondisi anak Anda ke dokter. Dokter perlu melakukan pemeriksaan pada anak Anda untuk memastikan efek penggunaan obat ini pada anak Anda. Jika diperlukan penanganan selanjutnya, dokter akan memberikan sesuai dengan kondisi anak Anda. Di kemudian hari, silakan Anda dan keluarga lebih berhati-hati dalam pemberian obat pada anak-anak.\r\n\r\nSemoga membantu. '),
(22, 'Methylprednisolone bisa untuk asma dok? Soalnya selama ini saya tahunya cuma salbutamol. itu pun efeknya detak jantung cepat dan tubuh menggigil.', 'Berdasarkan panduan pengobatan asma, metil predinosolone bisa saja digunakan untuk pengobatan asma, tetapi penggunaannya hanya atas indikasi, yaitu pada keadaan dimana asma sering timbul, tidak terkontrol dan juga atas pertimbangan lain oleh dokter. Sangat tidak disarankan untuk mengonsumsi obat tersebut tanpa anjuran dokter, karena bila penggunaannya tidak tepat dapat menimbulkan efek samping.\r\n\r\nApabila anda merasa tidak nyaman dalam menggunakkan salbutamol karena efek sampingnya, anda bisa langsung mengonsultasikannya kepada dokter, untuk dinilai kembali apakah obatnya perlu diganti, ditambahkan obat lain atau tidak. Kondisi asma anda juga perlu dinilai oleh dokter guna menentukan pengobatan lanjut yang tepat. Konsumsi hanya obat-obatan yang dianjurkan dokter, jangan menambahkan atau mengganti obat apapun tanpa persetujuan dokter, dan bila ada efek samping obat yang anda rasa mengganggu langsung hubungi kembali dokter yang memberikan resep tersebut.\r\n\r\nSemoga membantu. '),
(23, 'bayi saya baru berumur 60 hari tapi pernapasannya kayak tersendat dahak bagaimana mengatasinya', 'Bunyi napas bayi yang seperti berdahak bisa jadi memang menandakan banyaknya lendir di saluran napasnya. Kondisi ini bisa wajar terjadi bila bayi Anda terpajan oleh kondisi lingkungan yang kering, berangin, terlalu dingin, atau habis menangis berlebihan. Jika bayi Anda alergi terhadap substansi tertentu, contohnya tungau debu, serbuk sari, bulu atau kotoran hewan, dan sebagainya, maka kontak dengan substansi ini juga bisa membuat saluran napasnya memproduksi lendir berlebihan. Akan tetapi, pada beberapa kasus, bisa juga bunyi napas grok-grok sebagaimana yang bayi Anda alami menandakan kondisi medis lain yang perlu mendapat penanganan khusus, contohnya infeksi virus atau bakteri, aspirasi (tersedak), asma, refluks (aliran balik) asam lambung, gangguan anatomis pada saluran napas (contohnya septum deviasi, uvula yang besar), gangguan imunitas, dan sebagainya.\r\n\r\nPenanganan atas kondisi bayi Anda bisa dilakukan dengan berbeda tergantung penyebab dan keparahannya. Seringnya, jika bunyi grok-grok ini muncul di awal-awal usianya, tanpa membuat napasnya sesak, cepat, bayi kebiruan, retraksi otot pernapasan tambahan (contohnya pernapasan cupit hidung atau dada dan perut yang tampak kembang kempis), bunyi napas tambahan (misalnya mengi), muntah-muntah, batuk lama, demam, dan gangguan status gizi, kondisi bayi Anda tidaklah berbahaya. Akan tetapi, jika Anda mendapati salah satu atau lebih tanda bahaya di atas, lebih aman Anda periksakan langsung bayi Anda ke dokter atau dokter spesialis anak supaya bisa dievaluasi lebih mendalam kondisinya (contohnya lewat pemeriksaan darah, rontgen, dan sebagainya) lalu diberikan penanganan yang tepat.\r\n\r\nSaat ini, janganlah dulu Anda panik. Coba atasi keluhan bayi Anda dengan langkah berikut:\r\n\r\nBeri ia ASI eksklusif sesuai kebutuhan, agar daya tahan tubuhnya tetap prima\r\nHindari pemberian ASI lewat dot, utamakan menyusu langsung, atau beri lewat media yang tepat (contohnya cup feeder, sendok, atau pipet) bila berhalangan menyusui langsung\r\nSehabis menyusui, sendawakan bayi dengan benar\r\nHindari menyusui bayi sambil berbaring agar tidak mudah tersedak\r\nSetiap pagi dan sore hari, jemur bayi di ruangan yang dimasuki sinar matahari agar lendirnya mencair\r\nJaga selalu kebersihan diri bayi dan lingkungan sekitarnya\r\nTidak sembarangan memberi bayi obat tanpa resep dokter\r\nJauhkan bayi dari asap, debu, dingin, polusi, serta AC dan kipas angin yang berlebihan  '),
(24, 'Anak saya napasnya mengi mungkin akibat batuk yang diderita. pada kondisi malam saat tidur tiba-tiba sering batuk membuat menangis dan muntah?', 'Gejala batuk terutama malam hari dengan napas mengi pada anak-anak memang sangat menyerupai gejala asma, namun tidak menutup juga kondisi lain seperti bronkiolitis.\r\n          Asma itu sendiri merupakan penyakit saluran napas yang ditandai oleh adanya penyempitan saluran napas (bronkus) dan memunculkan gejala mengi atau batuk yang sifatnya kronik, episodik (sering kambuh), nokturnal (muncul terutama malam hari), dan reversibel (penyempitan saluran napas sifatnya tidak menetap atau dapat kembali seperti semula bila terobati baik). Kejadian asma dilaporkan berkaitan dengan faktor genetik, lingkungan (termasuk di dalamnya hal-hal yang mencetuskan asma seperti: cuaca dingin, tungau dalam debu, bulu binatang, aktivitas fisik, infeksi virs, dsb). Gejala umumnya batuk, sesak, dan mengi dan bisa juga ditambah gejala lain bergantung pada berat serangan asma. Pada serangan yang berat, anak akan merasa gelisah, lebih baik bila duduk bertopang lengan dan kalimat yang diucapkan terbata-bata (sebatas kata-kata saja). Pemeriksaan penunjang untuk mendukung diagnosis asma salah satunya spirometri. Pengobatan asma itu sendiri ada 2 macam : mengatasi serangan dan mencegah serangan asma berulang. Pengobatan meliputi obat pelebar saluran napas hingga kortikosteroid.\r\n        Di samping asma, ada pula kondisi yang serupa yakni bronkiolitis. Bronkiolitis merupakan peradangan pada bronkiolus (saluran napas yang kecil) akibat infeksi virus. Penyakit ini sering dialami oleh anak di bawah 2 tahun dengan puncaknya pada usia 2-6 bulan. Seperti halnya asma, saluran napas (bronkiolus) juga menyempit akibat respon peradangan. Pada umumnya, 1-4 hari anak mengalami pilek/hidung tersumbat terlebih dahulu, ada demam, lalu barulah diikuti oleh batuk, sesak, mengi, dsb. Pengobatannya bersifat suportif yaitu dengan pemeberian oksigen, cairan agar tidak dehidrasi, sering juga disertai obat pelebar jalan napas seperti asma.\r\n        Bila anak Anda sering mengalami gejala-gejala seperti yang Anda keluhkan, sebaiknya ajaklah ia berobat ke dokter. Dokter akan mengevaluasi, mendiagnosis, dan membuat perencanaan, apakah anak Anda memerlukan terapi pemeliharaan jangka panjang atau cukup dengan terapi saat serangan itu muncul. Pada bronkiolitis, umumnya dapat sembuh dengan baik, sementara asma sifatnya kambuhan namun seiring pertambahan usia, gejala asma biasanya lebih jarang muncul.\r\n       Bila ada riwayat asma/alergi di keluarga Anda, maka bisa saja anak Anda memang mengalami asma. Hindarilah ia dari segala faktor pencetus munculnya serangan batuk dan mengi yang dialaminya selama ini. Berikan asupan ASI/cairan yang cukup serta makanan yang sehat. Jauhkan ia dari asap rokok atau polusi lingkungan. Di samping itu, Anda juga harus memperhatikan kebersihan tangan Anda selama merawat anak Anda. '),
(25, 'Anak saya suara napasnya ngrok kadang terdengar seperti sesak napas saat tidur, apa umur 1 bulan bisa disedot lagi masalahnya kasian tiap tidur suaranya nyaring. apa harus bagaimana? Sudah mau keluar lendirnya ketarik lagi sama bayinya kedalam. bagaimana solusinya?', 'Lendir pada saluran nafas bayi usia 1 bulan dapat disebbakan karena berbagai penyebab. Beberapa keadaan yang dapat menyebabkan terbentuknya lendir pada saluran nafas misalnya:\r\n•	asma paru\r\n•	bronktis\r\n•	infeksi paru\r\n•	pneumonia aspirasi\r\n\r\nsalah satu penyebab yang sering menyebabkan saluran nafas berlendir adalah asma paru. Asma merupakan suatu keadaan dimaan terjadi hipersensitifitas pada saluran nafas, hal tersebut dapat disebabkan karena udara dingin, bulu binatang, asap. Asma bersifat diturunkan  dari orang tua ya. Asma dapat menyebabkan bayi batuk berdahak, lendir pada saluran nafas, pilek, dan dapat disertai dengan bunyi mengi ketika bernafas. Jika memang lendir anak sangat banyak maka diperlukan tindakan nebulisasi/ uap untuk membantu mengeluarkan dahak/ lendir.\r\n\r\nmaka dari itu, untuk menentukan penyebab dari keadaan anak anda maka sebaiknya anda memeriksakan anak anda langsung ke dokter Spesialis anak ya, sehingga dokter dapat memberikan terapi yang tepat untuk anak anda.\r\n\r\njangan memberikan asi atau minum dengan posisi anak berbaring ya,karena dapat membuat anak tersedak dan masuk ke paru yang juga dapat menyebabkan nafas banyi terdengar grok grok.\r\n\r\nberikut artikel yang dapat anda baca mengenai Menangani Asma pada Anak\r\n\r\nsemoga bermanfaat. Terimakasih   '),
(26, 'Saya mau menanyakan apakah penderita penyakit asma dapat memakan santan. Apakah di bolehkan atau tidak memakan kari yang mengandung santan?', 'Asma adalah penyakit yang menyerang sistem pernapasan. Saat serangan asma datang, saluran pernapasan menyempit mengakibatkan penderitanya merasa sesak dan sulit bernapas. Sebab terjadinya asma itu sendiri sampai sekarang tidak diketahui, namun diantara hal yang bisa memicu kondisi asma adalah:\r\n•	Kelelahan\r\n•	Kurang tidur\r\n•	Udara dingin\r\n•	Infeksi pada sistem pernapasan\r\n•	Debu, polusi dan asap rokok\r\n•	Aktivitas fisik yang berat\r\n•	Stress, gugup, cemas atau rasa sedih berlebihan\r\n•	Alergi makanan\r\n•	Penyakit asam lambung\r\n•	Obat-obatan tertentu\r\nSehingga mengenai pertanyaan Anda, santan itu sendiri bukan penyebab langsung dari asma. Namun jika Anda memiliki alergi terhadap santan, atau santan menyebabkan asam lambung Anda naik, asma bisa saja terpicu. Sehingga saran kami, jika Anda tidak yakin apakah Anda memiliki alergi atau penyakit asam lambung, sebaiknya Anda coba mengonsumsi santan sedikit demi sedikit terlebih dahulu dan bila tidak ada keluhan berarti tidak masalah untuk dilanjutkan. Sekian, semoga menjawab pertanyaan Anda.'),
(27, 'Semisal penderita asma dipaksa untuk terus melakukan olahraga fisik, bahaya tidak? Apalagi kalau kambuh di tengah aktivitas tersebut.', 'Asma adalah penyakit saluran pernapasan jangka panjang yang disebabkan oleh peradangan yang menyebabkan penyempitan saluran pernapasan. Penyempitan saluran pernapasan ini menyebaban penderitanya mengalami sesak napas. Selain penyempitan saluran pernapasan, produksi lendir juga meningkat yang lebih lanjut memperburuk gejala penderita. Penderitanya juga mengalami keluhan batuk-batuk, sakit dada, dan mengi. Penyebab asma belum diketahui dengan pasti namun asma berkaitan dengan pemicu berikut ini : debu, udara dingin, bulu hewan, serbuk sari, asap rokok, infeksi virus, paparan zat kimia, dan aktivitas fisik. Jika penderita mengalami gejala ketika berolahraga, maka sebaiknya penderita segera menghentikan aktivitas fisik tersebut. Jika penderita tetap memaksakan diri , penyempitan saluran pernapasan membuat oksigen sulit masuk ke dalam paru-paru dan menyebabkan gangguan/ gagal pernapasan. Penderita yang mengalami gagal napas yang dapat mengancam jiwa. \r\n\r\nJika keluhan ini tercetus oleh aktivitas fisik, biasanya penderita disarankan untuk menggunakan inhaler sebelum beraktivitas fisik. Silakan sarankan penderita untuk berkonsultasi dengan dokter spesialis paru-paru lebih lanjut agar gejala penderita dapat tetap terkendali. Penderita juga dianjurkan untuk menghindari pemicu lainnya untuk mencegah kekambuhan gejala.\r\n\r\nSemoga informasi ini berguna. '),
(28, 'Mau bertanya saya cek hasil ronsen saya terdapat bercak pada lapangan atas paru kiri suspek tb paru maksudnya apa ya?', 'Corakan bronkovaskular menggambarkan aliran pembuluh darah kecil di paru. Adanya peningkatan pada corakan bronkovaskular dapat menandakan adanya beberapa kemungkinan, diantaranya adalah:\r\ngagal jantung kongestif\r\ninfeksi pada paru\r\nbronkitis kronis\r\nasma\r\nBila yang dituliskan adalah bercak pada paru, kemungkinan terlihat juga adanya infiltrat pada paru. Infiltrat menandakan adanya suatu substansi yang lebih padat dari udara pada paru, bisa nanah, darah, ataupun protein. Infiltrat pada paru umumnya disebabkan oleh infeksi bakteri, tuberkulosis, infeksi jamur, dll. Bila infiltrat ditemukan di bagian atas lapang paru (apeks paru), umumnya kecurigaan akan diarahkan pada infeksi tuberkulosis (TB paru). Meskipun demikian, untuk mendapat diagnosis yang pasti, hasil pemeriksaan laboratorium tersebut harus digabungkan dengan gejala-gejala pasien, hasil pemeriksaan fisik, dan hasil pemeriksaan penunjang lainnya. Oleh karena itu sebaiknya bawa hasil radiologis tersebut ke dokter yang meminta dilakukannya pemeriksaan untuk mendapat analisis dan diagnosis yang lebih pasti.\r\nSekian informasi dari saya, semoga cukup menjawab');
INSERT INTO `data_ori` (`id_data_ori`, `pertanyaan`, `jawaban`) VALUES
(29, 'Ayah saya sudah sekitar beberapa bulan ini napasnya berbunyi, dan terus menerus mengeluarkan dahak. Sebelumnya sempat ada pembengkakan kelenjar dekat lehernya. Dahak yang dihasilkan cenderung encer, bukan seperti saat kita batuk berdahak biasa.', 'Adanya perubahan suara pada nafas kemungkinan disebabkan karena adanya dahak yang menyumbat pada paru-paru ayah anda. Sehingga suara yang masuk dan keluar pada paru-paru akan bergesekan dengan dahak yang menempel pada kantung paru-paru. Adanya pembengkakan kelenjar pada daerah sekitar leher menunjukkan bahwa kelenjar getah beningnya mengalami pembesaran. Hal ini terjadi karena kelenjar getah bening tersebut berusaha keras untuk membentuk sistem pertahanan tubuh untuk menghalau infeksi yang masuk ke tubuh.\r\n\r\nDahak yang ada sebenarnya adalah hasil lendir yang berisi dari bakteri/ virus/ kuman yang menginfeksi paru-paru, yang oleh paru-paru berusaha dikeluarkan lewat respon batuk. Jika respon batuknya bagus, dahak akan dikeluarkan secara tuntas dari paru-paru, sehingga infeksi dapat berkurang sedikit demi sedikit dan mengalami perbaikan. Tentunya dalam hal ini dibutuhkan pengobatan yang tepat yang sesuai dengan penyebab dari infeksi yang terjadi. Oleh karena itu sudah sebaiknya anda membawa serta ayah anda untuk memeriksakan diri ke dokter supaya dapat diketahui penyebab dari sakit yang dialami. Karena hal ini jika dibiarkan berlama-lama akan berbahaya bagi kesehatan ayah anda sendiri dan juga kesehatan orang disekitarnya yang kontak dan serumah dengan beliau.\r\n\r\nPada pemeriksaan yang akan dilakukan oleh dokter, nantinya akan dilakukan pemeriksaan wawancara medis dan pemeriksaan fisik/ tubuh ayah anda. Atau jika dokter membutuhkan pemeriksaan tambahan maka kemungkinan akan dilakukan pemeriksaan laboratorium darah dan juga pemeriksaan foto Rongten dada. Dari hasil pemeriksaan semuanya maka dapat disimpulkan penyebab dari penyakit yang diderita. Sehingga penanganan dapat sesuai dan tepat untuk ayah anda.\r\n\r\nKemungkinan dari penyakit yang diderita oleh ayah anda sangat beragam, mulai dari infeksi saluran pernapasan atas (ISPA), bronkhitis, pneumonia, TBC paru, dan lain sebagainya. Namun kami tidak dapat memastikan penyakit apa yang diderita oleh ayah anda karena kami tidak melakukan pemeriksaan secara langsung dengan ayah anda. Untuk sementara demi mengurangi keluhan, maka sebaiknya sarankan kepada ayah anda untuk :\r\n\r\n1.	menggunakan masker baik dirumah terutama diluar rumah untuk mengurangi kemungkinan penyebaran infeksi\r\n2.	konsumsi air putih sebanyak mungkin minimal 1,5L perhari dan kurangi minuman yang mengandung gula/ pemanis buatan\r\n3.	hindari mengonsumsi makanan yang digoreng\r\n4.	hindari membuang dahak disembarang tempat\r\n5.	istirahat yang cukup\r\n6.	pilih makanan yang bergizi dan bersih untuk dikonsumsi sehari-hari\r\nDemikian yang dapat kami sampaikan, semoga membantu. Terimakasih.  '),
(30, 'Lahir prematur sesak napas kalau kelelahan. sampai sekarang saya masih suka kambuh. Apakah benar jika anak lahir prematur pasti punya penyakit asma?', 'Lahir prematur merupakan suatu keadaan dimana terjadi persalinan sebelum usia kehamilan 38 minggu. Bayi yang lahir prematur, terutama jika lahir kurang dari 36 minggu maka dapat menyebabkan belum matangnya atau terdapat kelainan organ tubuh ya. Namun kelainan organ tersebut belum tentu terjadi. Beberapa keadaan yang mungkin dapat menyertai lahir prematur seperti:\r\n•	Berat badan lahir rendah\r\n•	kelainan / belum matangnya paru\r\n•	penyakit jantung bawaan\r\n•	gangguan anggota tubuh\r\n•	gangguan sistem saraf pusat\r\n\r\ndari keadaan yang anda alami, lahir prematur biasanya tidak berhubungan dengan asma ya. Asma merupakan suatu penyakit hipersensitifitas saluran nafas, hal tersebut dapat terjadi pada bayi prematur ataupun tidak. Salah satu keadaan yang anda alami memang dapat disebabkan karena asma, asma dapat menyebabkan gejala seperti rasa sesak nafas, nafas terasa berat, disertai dengan bunyi mengi.\r\n\r\nTetapi dapat juga keadaan yang anda alami disebabkan karena penyebab lainnya seperti yang telah disebutkan diatas. Oleh karena itu, untuk memastikan penyebab dari keadaan yang anda alami maka sebaiknya anda memeriksakan diri secara langsung ke dokter ya, sehingga dokter dapat melakukan pemeriksaan secara langsung.\r\n\r\nberikut aritkel yang dapat anda baca mengenai Kelahiran Prematur\r\n\r\nsemoga bermanfaat. Terimakasih   '),
(31, 'Usia kandungan saya masuk 8 bulan saya mempunyai riwayat asma tapi saya kambuh hanya saat batuk pilek saja ketika tidak, tidak kambuh apakah bisa lahiran normal?', 'Asma adalah salah satu penyakit kambuhan yang menyerang sistem pernapasan dan ditandai dengan penderitanya merasa sesak napas karena sebab-sebab tertentu, seperti alergi debu, serbuk bunga, infeksi bakteri atau virus pada sistem pernapasan, alergi bulu hewan, olahraga fisik yang berat, udara dingin, kelelahan, dan alergi terhadap makanan tertentu.\r\n\r\nMengenai pertanyaan Anda, asma sebenarnya merupakan salah satu kondisi medis yang seringkali berpotensi memberikan dampak buruk pada kehamilan. Namun tidak semua jenis asma. Asma yang terkontrol dengan baik, jarang kambuh, dan tidak berlangsung dalam jangka waktu lama tidak memberikan risiko yang signifikan baik pada ibu maupun pada janin. Yang menjadi masalah adalah bila asmanya tidak terkontrol, sering kambuh, berlangsung lama, dan lain sebagainya karena ini bisa menyebabkan tekanan darah tinggi, kelahiran prematur, hambatan tumbuh kembang, berat badan lahir rendah, dan pada beberapa kasus bahkan bisa menyebabkan kematian.\r\n\r\nJadi bila disimpulkan sekali lagi, dari cerita Anda, nampaknya asma yang Anda miliki tidak akan mengganggu proses kehamilan maupun persalinan Anda. Namun, hal ini harus diklarifikasi lagi oleh dokter, karena ada ketentuannya dimana asma itu disebut terkontrol atau tidak. Karena itu saran kami sebaiknya Anda periksakan diri Anda ke dokter paru atau dokter kandungan untuk dinilai risiko kehamilan Anda berdasarkan riwayat asma yang Anda miliki dan apakah diperlukan penanganan lebih lanjut untuk menghindari hal-hal yang tidak diinginkan.\r\n\r\nSementara itu, jaga kesehatan dan daya tahan tubuh Anda dengan baik, hindari stress, asap rokok, debu, dan lain sebagainya yang bisa memicu asma Anda, istirahat yang cukup, konsumsi makanan kaya nutrisi, dan rutin periksakan kehamilan Anda. Sekian, semoga menjawab pertanyaan Anda.'),
(32, 'Setiap saat saya sedang bekerja, nonton, menyetir, main hp dan kegiatan lainnya napas saya kalau dirasa terasa pendek sekali, jadi ketika saya bernapas harus ditarik dulu dari dada dan sambil membuka mulut lalu di keluarkan napasnya. Saya memang ada sinusitis dan skoliosis, apakah ada hubungannya diantara itu?', 'Banyak hal yang dapat terjadi Berkaitan dengan keluhan nafas terasa pendek atau sulit bernapas, yaitu:\r\n1. Gangguan psikologis, seperti gangguan cemas atau serangan panik.\r\n2. Seseorang dengan berat badan berlebih atau obesitas.\r\n3. Penyakit anemia.\r\n4. Hamil\r\n5. Gangguan paru-paru, seperti asma, pneumonia, edema paru, pneumothorak dan penyakit paru obstruktif kronik.\r\n6. Gangguan jantung, seperti penyakit jantung, gagal jantung dan Aritmia (gangguan irama jantung).\r\nKarena banyak hal yang dapat terjadi, sebaiknya anda berkonsultasi dengan dokter spesialis penyakit dalam agar dapat dilakukan pemeriksaan lebih lanjut guna mengetahui apa penyebabnya. Dokter akan melakukan wawancara medis, pemeriksaan fisik dan pemeriksaan penunjang, seperti darah rutin, rekam jantung dan Rontgen dada. Nantinya pengobatan yang dokter berikan akan berdasarkan penyakit penyebab keluhan.\r\nSementara itu, rutinkanlah melakukan relaksasi pernapasan, dengan menarik napas dalam melalui hidung kemudian hembuskan perlahan melalui mulut, ulangi beberapa kali hingga pernapasan anda terasa lapang dan mudah. Pada saat serangan datang bawalah duduk bersandar, tinggalkan aktivitas yang sedang dikerjakan, tenang, pejamkan mata dan mulailah melakukan relaksasi pernapasan.\r\nDemikian semoga bermanfaat.'),
(33, 'Saya ingin bertanya apakah jika seseorang yang terkena penyakit asma bisa dapat di sembuhkan? Apakah harus mengikuti operasi agar dapat sembuh? Agar paru paru nya tidak menyempit kembali?', 'Asma adalah suatu kondisi peradangan saluran pernapasan yang berlangsung lama/ kronis yang menyebabkan penyempitan saluran pernapasan sehingga penderitanya mengalami keluhan sesak napas. Selain peradangan, saluran pernapasan penderita juga umumnya menjadi lebih sensitif yang menyebabkan terjadinya peningkatan produksi lendir/ dahak yang kemudian memperburuk penyempitan saluran pernapasan. Selain sesak napas, penderitanya juga dapat mengalami gejala batuk, sakit dada, dan mengi. Penyebab terjadinya asma tidak diketahui dengan pasti namun, asma sering dipicu oleh paparan debu, bulu hewan, serbuk bunga, asap rokok, aktivitas fisik, udara dingin, dan infeksi.\r\nSeseorang yang terbukti mengalami asma dari pemeriksaan dokter akan diobati dengan obat-obatan yang bertujuan untuk mengendalikan gejala dan mencegah kekambuhan karena asma tidak dapat disembuhkan. Jenis obat dan penanganan lain yang dianjurkan oleh dokter tergantung pada kondisi masing-masing penderita. Selain pengobatan, penderitanya juga dianjurkan untuk menghindari pemicu yang dapat memunculkan gejala asma, seperti yang telah disebutkan di atas. Vaksinasi terhadap influenza dan pneumonia secara teratur juga dianjurkan untuk mencegah kekambuhan asma karena kedua infeksi tersebut. Tindakan operasi bukanlah merupakan tindakan penanganan asma yang utama. Tindakan operasi merupakan tindakan terakhir yang akan dianjurkan dokter pada penderita asma berat yang tidak terkendali dengan obat-obatan.\r\nJika Anda mengalami asma, silakan Anda berkonsultasi dengan dokter spesialis paru-paru untuk pemeriksaan dan penanganan lebih lanjut. Anda juga dianjurkan untuk kontrol secara rutin dengan dokter untuk memastikan gejala asma Anda terkendali dengan baik.\r\nSemoga informasi ini berguna.'),
(34, 'Saya mau bertanya saya adalah orang yang mengidap penyakit asma bawaan. Apakah saya masih bisa melakukan donor darah?', 'Donor darah adalah kegiatan suka rela untuk menyumbangkan darah kepada orang lain. Saat donor darah, akan diambil darah dari pendonor sebanyak lebih kurang 400-500 ml. Oleh karena itu diperlukan calon pendonor yang secara fisik sehat. Beberapa kriteria untuk dapat mendonorkan darah antara lain:\r\n•	Usia >=17 tahun\r\n•	Berat badan >= 45 kg\r\n•	Tekanan darah sistol antara 90-190 mmHg dan tekanan darah diastol antara 50-100 mmHg\r\n•	Kadar hemoglobin di antara 12,5-17 g/dl\r\nAnda kemungkinan tidak bisa menjadi pendonor apabila menderita kondisi berikut:\r\n•	Riwayat hepatitis B, C\r\n•	HIV/AIDS positif\r\n•	Sifilis positif\r\n•	Riwayat tato/tindik/transfusi dalam 6 bulan terakhir\r\n•	Riwayat operasi dalam 1 tahun terakhir\r\n•	Riwayat vaksinasi polio, infulenza, difteri, tetanus dalam 24 jam terakhir\r\n•	Riwayat vaksinasi parotitis, campak dalam 2 minggu terakhir\r\n•	Hamil atau riwayat persalinan 6 bulan terakhir atau sedang menyusui\r\n•	Epilepsi\r\n•	Ketergantungan obat-obatan terlarang atau alkohol\r\n•	Kelainan pembekuan darah, gangguan pembuluh darah vena\r\n•	Kelainan paru - tuberkulosis paru aktif\r\n•	Kelainan jantung\r\nPasien dengan penyakit asma yang terkontrol (dalam pengobatan/ sudah lama tidak kambuh/ tidak dalam kondisi muncul gejala asma) boleh mendonorkan darah asalkan memenuhi persyaratan lainnya. Sebelum mendonorkan darah, akan dilakukan skrining dasar seperti berat badan, tekanan darah, kadar hemoglobin, dan penyakit-penyakit menular yang menjadi kontraindikasi donor darah. Demikian penjelasan dari saya, semoga bermanfaat. '),
(35, 'Setiap hari saya merasakan pusing di kepala dan juga rasa sesak napas kadang juga disertai sakit dada. Apakah itu bagian dari asma atau yang lain ya? Cari obat pereda nyeri tapi tidak tahu nama obatnya apa ada lagi dok ini maag atau apalagi ya tiap beres makan kadang perut saya perih seperti ada luka', 'Pusing, sesak napas, dan nyeri dada tidak selalu menandakan asma. Memang, orang dengan keturunan asma lebih berisiko untuk juga memiliki asma. Namun, ada juga keturunan asma yang tidak menderita asma. Asma merupakan salah satu jenis penyakit atopik, sama halnya dengan rhinitis alergi dan dermatitis atopik. Keturunan asma bisa juga memiliki penyakit atopik lainnya, tidak selalu asma.\r\n\r\nBila pusing, sesak napas, dan nyeri dada yang Anda alami muncul disertai juga dengan keluhan perih yang terasa di perut setiap habis makan, lebih mungkin kondisi ini terjadi akibat peningkatan asam lambung. Normalnya, lambung akan memproduksi sejumlah asam lambung untuk membantu proses pencernaan makanan. Namun, akibat beragam faktor, di antaranya jenis makanan yang dikonsumsi, tekanan psikologis, efek samping obat, dan sebagainya, bisa juga asam lambung ini diproduksi berlebihan sehingga menyebabkan lambung meradang. Peradangan ini pada akhirnya yang bisa memicu rasa nyeri dan sesak napas di area dada dan juga perut (terutama perut bagian atas). Lebih lanjut, stres yang tubuh Anda alami akibat rasa tidak nyaman ini bisa memicu diproduksinya banyak hormon stres yang berperan dalam mencetuskan rasa pusing, nyeri kepala, dan beragam keluhan lainnya. Dalam ranah medis, kondisi seperti ini kerap diistilahkan dengan gastritis.\r\n\r\nSelain gastritis dan asma, bisa juga keluhan-keluhan Anda muncul karena sebab lainnya, contohnya GERD (gastrosophageal reflux disease), kolangitis, pankreatitis, pneumonia, bronkhitis, fibromyalgia, serangan panik, gangguan cemas berlebih, dan sebagainya.\r\n\r\nAnda bisa coba dulu atasi keluhan Anda melalui beberapa langkah berikut:\r\n•	Lebih teratur memperhatikan waktu makan, makanlah setiap 3 hingga 5 jam sekali, porsi kecil hingga sedang\r\n•	Kurangi konsumsi makanan yang bisa memicu peningkatan asam lambung, contohnya makanan asam, pedas, berlemak, mengandung gas, minuman berkafein\r\n•	Hindari konsumsi makanan dan minuman yang tidak diolah dengan higienis\r\n•	Jangan makan terlalu kenyang, apalagi mendekati waktu tidur\r\n•	Tidak sembarangan mengkonsumsi obat, termasuk obat anti nyeri, anti radang, antibiotik\r\n•	Kelola stres Anda dengan bijaksana\r\n•	Tidur dengan teratur, jangan biasakan begadang\r\n•	Rutin berolahraga\r\n•	Jalani pola hidup sehat, jangan merokok apalagi mengkonsumsi alkohol\r\n\r\nJika langkah-langkah di atas masih belum berhasil mengatasi keluhan Anda, sebaiknya Anda kunjungi langsung dokter atau dokter spesialis penyakit dalam di fasilitas kesehatan terdekat ya.. Dengan pemeriksaan yang komprehensif, tentu kondisi Anda bisa ditangani dengan baik sehingga Anda pun bisa kembali beraktifitas dengan normal tanpa kendala berarti.\r\n\r\nSemoga membantu.   '),
(36, 'Asma batuk suka mengeluarkan lendir kayak jely dan setiap kambuh saya suka pakai obat ventolin inhaler apakah obat itu bila dikonsumsi setiap hari tidak apa dan apakah penyakit saya bisa sembuh?', 'Perlu diperjelas sebelumnya, apakah sebelumnya Anda sudah pernah memeriksakan diri ke dokter dan didiagnosis asma? Apakah obat tersebut Anda peroleh dengan resep dokter? Lantas, apakah dokter memang menganjurkan pada Anda untuk selalu menggunakan obat tersebut saat asma Anda kambuh?\r\n\r\nAsma bronkhiale, atau lebih umum disebut dengan asma, merupakan suatu peradangan kronis pada saluran pernapasan bagian bawah yang menyebabkan penderitanya mengalami sesak napas, bunyi napas tambahan (mengi), dan juga batuk-batuk. Gejala-gejala ini muncul karena jalan napas yang mengalami penyempitan dan juga lendir saluran napas yang diproduksi berlebihan. Asma merupakan penyakit kambuhan. Kekambuhan penyakit ini bisa dicetuskan oleh banyak faktor, seringnya faktor lingkungan (seperti cuaca dingin, berdebu, berasap, banyak mengandung serbuk sari), faktor psikis (seperti saat sedang merasa stres, cemas, panik, atau takut), faktor fisik (seperti saat sedang mengalami kelelahan, sedang berolahraga), infeksi saluran pernapasan, refluks (aliran balik) asam lambung, hingga pengaruh konsumsi beberapa jenis obat (contohnya beta bloker, aspirin, ibuprofen).\r\n\r\nKarena produksi lendir saluran napas yang meningkat inilah penderita asma seringkali mengalami batuk disertai keluarnya lendir menyerupai jelly sebagaimana yang Anda alami. Kondisi ini perlu mendapat penanganan yang tepat supaya tidak membatasi penderitanya dalam beraktifitas. Bila benar Anda sudah pernah memeriksakan diri ke dokter dan didiagnosis asma, maka dokter biasanya akan memberikan Anda 2 jenis penanganan utama, yakni penanganan saat timbul serangan asma, dan penanganan untuk mengontrol supaya serangan asma tidak terjadi berulang. Obat yang Anda sebutkan tersebut merupakan bagian dari penanganan ini. Bila obat tersebut Anda gunakan berulang atas saran langsung dari dokter yang memeriksa Anda, semestinya kondisi ini tidak berbahaya. Namun, bila dokter Anda tidak menyarankan langsung tindakan tersebut, sebaiknya Anda tidak melakukannya sembarangan.\r\n\r\nAsma hingga kini bukan merupakan suatu penyakit yang bisa disembuhkan secara total. Namun, penderita asma bisa tetap beraktifitas sebagaimana orang normal tanpa kendala yang berarti bila ia mampu mengelola pencetus asmanya dengan baik. Karenanya, langkah terbaik yang perlu dilakukan adalah pencegahan agar serangan asma tidak selalu kambuh dan berulang. Beberapa upaya yang bisa Anda lakukan di antaranya:\r\n•	Kenali, hal-hal apa saja yang biasanya memicu serangan asma Anda, lalu sebisa mungkin hindari pemicu tersebut\r\n•	Jalani imunisasi agar terlindung dari infeksi saluran pernapasan yang sering terjadi, contohnya influenza dan pneumonia\r\n•	Rajin melakukan latihan pernapasan\r\n•	Rutin berolahraga 1-2 hari sekali\r\n•	Kelola stres dengan bijaksana\r\n•	Jalani pola makan yang sehat, teratur, hindari makanan yang rentan membuat Anda alergi\r\n•	Bila serangan asma kambuh, periksakan diri langsung ke dokter atau dokter penyakit dalam agar diberikan penanganan yang tepat\r\nSemoga membantu.  '),
(37, 'Asma sudah 6 bulan periksa ke dokter dan diberi obat teosal dan obat batuk, setiap saya minum jantung saya berdetak kencang, lemas, mulut pahit dan lambung terasa nyeri, itu kenapa? obat apa yang bagus?', 'Teosal adalah obat yang berisi Salbutamol dan Teofilin. Salbutamol memiliki efek samping sebagai berikut:\r\n1.	jantung berdebar dan denyut jantung ireguler\r\n2.	nyeri dada\r\n3.	badan gemetar/tremor\r\n4.	rasa cemas/gelisah\r\n5.	sakit kepala\r\n6.	mual muntah\r\n7.	pusing\r\n8.	batuk dan nyeri tenggorok\r\n9.	rasa tidak enak di mulut\r\n\r\nBeberapa efek samping dari Teofilin antara lain:\r\n1.	mual muntah\r\n2.	nyeri perut\r\n3.	sakit kepala\r\n4.	sulit tidur\r\n5.	diare\r\n6.	rasa cemas/gelisah\r\n7.	tidak bisa diam\r\n8.	gemetar\r\n\r\nGejala-gejala yang anda rasakan tersebut sebenarnya merupakan efek samping dari obat yang anda minum. Terapi untuk asma sendiri harus disesuaikan dengan seberapa sering anda mengalami serangan asma dan beratnya serangan asma. Sebaiknya anda memeriksakan diri anda secara langsung ke dokter paru untuk dilakukan evaluasi dan tatalaksana lebih lanjut.\r\n\r\nBerikut ini adalah beberapa hal yang dapat anda lakukan:\r\n\r\n1.	Hal yang terutama yang paling penting adalah anda harus mencari hal-hal yang memicu terjadinya serangan asma anda dan menghindari pemicu tersebut\r\n2.	Bila serangan asma jarang terjadi, dokter akan memberikan obat jenis reliever, yaitu obat yang hanya digunakan untuk menghentikan serangan asma. Obat yang diberikan biasanya dalam bentuk inhaler untuk meminimalisasi risiko terjadinya efek samping.\r\n3.	Bila serangan asma sering terjadi, selain pemberian reliever, dokter juga akan memberikan obat jenis controller, yaitu obat yang ditujukan untuk mencegah terjadinya serangan asma. Saat ini obat controller sudah tersedia dalam bentuk inhaler untuk meminimalisasi risiko terjadinya efek samping.\r\n4.	Anda harus belajar mengenali tanda-tanda serangan asma anda. Saat anda mulai merasa tanda serangan asma terjadi, anda harus menggunakan obat reliever anda sesegera mungkin. Menunda terapi dapat menyebabkan serangan memberat dan semakin sulit diatasi.\r\n5.	Belajar cara menggunakan inhaler anda sebaik-baiknya saat anda berobat ke dokter. Cara penggunaan inhaler yang benar sangat penting dalam penatalaksanaan asma.\r\nBerikut ini artikel mengenai asma yang dapat anda baca\r\n\r\nSekian informasi dari saya, semoga cukup menjawab  '),
(38, 'Saya mau bertanya. Saya punya asma biasanya saya pakai combivent / ventolin nebulizer tapi kemarin saat saya kambuh saya ganti pakai pulmicort + bisolvon untuk mengurangi batuknya, tapi kenapa makin sesak napas ya? Apakah dosisinya salah?', 'Ventolin adalah obat dengan kandungan zat aktif berupa salbutamol yang memiliki kerja untuk membuka saluran nafas yang mengalami penyempitan sehingga biasanya akan digunakan saat terjadi serangan akut asma sehingga saluran yang menyempit akan dibuka dengan zat dalam obat tersebut.\r\nCombivent memiliki kandungan zat aktif salbutamol dan ipatroprium bromide. Sehingga salbutamol akan bertugas untuk membuka saluran pernapasan. Dan untuk ipatroprium bromide memiliki cara kerja membuka saluran nafas dengan berikatan pada reseptor otot saluran nafas dan biasanya untuk astma akan efektif bila digunakan dengan campuran dengan golongan lainnya salah satunya adalah salbutamol.\r\nPulmicort memiliki kandungan aktif berupa budesonide yang memiliki kerja sebagai anti peradangan sehingga berguna untuk menurunkan reaksi peradangan pada saluran pernapasan.\r\nAmbroxol adalah obat yang memiliki fungsi utama untuk mengencerkan dahak. Biasanya akan dihindari pada serangan asma yang akut karena bisa menyebabkan sumbatan jalan nafas oleh dahak itu sendiri.\r\nUntuk pengobatan saat sesak terjadi sebaiknya sesuai dengan obat yang telah diresepkan oleh dokter dengan aturan pakai yang telah dijelaskan karena obat obat tersebut termasuk obat keras dan perlu cara penggunaan yang benar untuk mencegah terjadinya komplikasi. Selain itu bila serangan tetap tidak membaik dengan konsumsi obat tersebut sebaiknya dibawa ke IGD RS sehingga dapat diperiksa lebih lanjut mengenai kondisi saluran pernapasan apakah butuh obat tambahan atau ada indikasi dengan pengobatan lainnya. Karena serangan asma adalah suatu kondisi darurat dan penanganan harus secara tepat.\r\nDemikian informasi yang dapat kami sampaikan semoga bermanfaat terimakasih'),
(39, 'Anak saya batuk dan flu umur 6 bulan Napas sampai payah bunyi. Tapi sudah 2 minggu belum juga baik. Sudah berobat sana sini juga. Apa solusi penanganannya ya dok. Obat apakah yang paling ampuh buat batuk asma pada bayi', 'Batuk, pilek, disertai napas berbunyi ngik ngik pada bayi sesungguhnya tidak selalu disebabkan oleh asma. Bisa juga, keluhan ini muncul akibat bronkhitis, bronkhiolitis, atau penyakit lainnya. \r\n\r\nAsma (asma bronkhiale) bisa menimpa siapa saja, tidak terkecuali bayi. Kondisi ini terjadi karena saluran pernapasan yang meradang, sehingga memproduksi lendir berlebihan dan menyempit diameternya. Secara klinis, penderita asma bisa mengalami batuk, sesak napas, dan suara napas yang berbunyi ngik ngik (mengi). Kondisi ini biasanya memburuk saat penderita berada di lingkungan dingin, habis banyak melakukan aktifitas fisik, terpajan debu atau iritan pernapasan lainnya, atau juga mengalami infeksi saluran pernapasan. \r\n\r\nMembedakan asma dengan kemungkinan penyakit lain yang bisa mencetuskan keluhan serupa sebagaimana disebutkan di atas perlu dilakukan dengan pemeriksaan dokter secara langsung. Pada bayi, mungkin juga perlu dilakukan pemeriksaan penunjang, seperti tes laboratorium, rontgen, dan sebagainya. Bila benar yang bayi Anda alami adalah asma, maka penanganan bisa diberikan dengan beberapa obat, seperti melalui rute inhalasi (uap), oral, dan sebagainya disesuaikan dengan keluhan yang muncul. Setelah serangan asma reda sekalipun, dokter bisa juga memberikan beberapa jenis obat untuk mencegah serangan asma kembali terjadi. Karenanya, untuk mendapat penanganan yang tepat, periksakan kembali bayi Anda ke dokter atau dokter spesialis anak ya..\r\n\r\nBerikut langkah penanganan awal yang sebaiknya Anda lakukan:\r\n•	Beri bayi Anda ASI supaya daya tahan tubuhnya terjaga --- pemberian ASI terbukti menurunkan risiko infeksi dan alergi saluran pernapasan pada bayi\r\n•	Jaga lingkungan sekitar bayi agar senantiasa bersih, berventilasi, dan berpencahayaan baik\r\n•	Lindungi bayi agar tidak terpajan rokok dan asapnya\r\n•	Bila ada orang dewasa yang sedang mengalami infeksi saluran pernapasan, hindarkan supaya tidak berkontak dekat dengan bayi\r\n•	Bila bayi tampak sesak, tenangkan ia, senandungkan irama yang membuatnya nyaman, susui ia\r\n•	Hindari penggunaan alas tidur atau alas main berbahan kapuk atau yang mudah terhirup \r\n•	Hindari penggunaan kipas angin \r\n•	Saat bayi sedang batuk pilek, hindari juga pemberian makanan dan minuman yang terlalu dingin, gorengan, dan yang mengandung pemanis buatan\r\n•	Tidak sembarangan memberikan obat pada bayi tanpa resep dokter\r\nSemoga membantu ya..  '),
(40, 'Saya penderita asma. saya terapi inhaler dengan symbicort. tapi semenjak saya pakai mulut saya ruam terus tenggorokan saya perih. apa itu efek samping symbicort karena saya tidak cocok?', 'Symbicort memiliki kandungan kortikosteroid dan LABA (long acting beta agonist) yang diindikasikan untuk mengatasi gejala asma bronkhiale (asma). Meski jarang, obat ini bisa saja memicu reaksi alergi pada orang yang sensitif. Reaksi alergi yang muncul akibat obat ini bisa bervariasi, mulai dari ruam kulit, gatal, bengkak, sesak, mual, muntah, hingga syok (renjatan) yang perlu mendapat penanganan cepat dan tepat agar tidak berujung pada kondisi yang mengancam jiwa.\r\n\r\nNamun, perlu Anda ketahui juga, bahwa ruam di mulut dan perih di tenggorokan yang Anda alami, selain akibat alergi obat, bisa juga muncul karena faktor lain, misalnya:\r\n\r\n•	Iritasi, contohnya karena kemasukan duri makanan, konsumsi makanan pedas berlebihan\r\n•	Infeksi, bisa karena virus, bakteri, atau mikroorganisme lain\r\n•	Keganasan di sekitar rongga mulut dan tenggorokan\r\n•	Kekurangan vitamin C\r\n•	Gangguan sistem imun, contohnya akibat HIV, dan sebagainya\r\n\r\nPerlu diperjelas, apakah keluhan tersebut hanya muncul seusai Anda menggunakan obat tersebut, atau tidak? Sudah berapa lama keluhan tersebut Anda alami? Apakah ada substansi lain yang kerap membuat Anda alergi?\r\n\r\nSaran kami, agar kondisi Anda mendapat penanganan yang baik, sebaiknya Anda periksakan langsung diri Anda ke dokter atau dokter spesialis penyakit dalam. Pertama-tama, dokter akan menilai kemungkinan yang menyebabkan munculnya ruam di mulut dan perih di tenggorokan Anda. Selanjutnya, dokter akan menilai derajat keparahan asma Anda, dan menentukan penanganan yang terbaik disesuaikan dengan keluhan yang muncul.\r\n\r\nSaat ini, berikut saran yang sebaiknya Anda lakukan:\r\n•	Kenali apa saja yang kerap memicu serangan asma Anda, dan hindari sebisa mungkin pemicu tersebut agar serangan asma tidak terus kambuh dan berulang\r\n•	Olahraga yang rajin, dengan intensitas, frekuensi, dan durasi yang dinaikkan secara bertahap\r\n•	Kendalikan emosi dan stres Anda dengan bijaksana\r\n•	Jaga lingkungan tempat Anda tinggal supaya senantiasa bersih dan bersirkulasi udara baik\r\n•	Rajin menyikat gigi dan berkumur dengan larutan garam\r\n•	Tidak berlebihan mengkonsumsi makanan berminyak, pedas, dan terlalu keras\r\n•	Perbanyak minum air putih, boleh juga ditambahkan madu atau jahe\r\n•	Jangan merokok\r\nSemoga membantu ya.. '),
(41, 'Saya sering sekali nyeri di dada, apalagi kalau menghisap asap rokok. Biasanya sampai ke punggung. Tapi kadang kalanya suka batuk tapi tidak terus menerus. Sesak napas biasanya kalau menghisap asap rokok. Tapi kalau melakukan aktivitas agak berat saya merasa sehat saja tidak merasakan sesak. Itu gejala penyakit apa?', 'Asap rokok mengandung ribuan zar racun yang berbahaya bagi tubuh manusia terutama pada saluran pernafasan. Sebagian asap rokok dilepaskan ke udara berupa asap sekunder dan dapat terhirup oleh orang yang berada di lingkungan perokok yang menjadikan orang di area tersebut menjadi perokok pasif. Selain itu racun yang twrkandung dapat melekat dan meresap pada pakaian, rambut, meja kursi, sofa, dll yang berada pada area tempat merokok hingga waktu yang lamabyang di sebut sebagai asap tersier yang menjadikan orang yang melakukan kontak dengan benda-benda tersebut sebagai perokok tersier.\r\nPaparan asap rokok menimbulkan iritasi, peradangan hingga dalam waktu yang lebih lama dapat menyebabkan kerusakan pada jaringan paru yang bersifat ireversibel atau tidak dapat kembali seperti semula. Beberapa masalah medis yang dapat di timbulkan antara lain:\r\nIritasi saluran pernafasan\r\nAsma\r\nBronkitis\r\nPPOK\r\nKanker paru\r\nMengingat adanya respon hipersensitivitas terhadap asam rokok, sebaiknya:\r\nHindari lingkungan banyak asap rokok\r\nHindari polusi, debu\r\nMenggunakan masker\r\nMenghindari udara terlalu panas atau terlalu dingin\r\nBanyak mengkonsumsi air putih\r\nTidur dan istirahat cukup\r\nMengkonsumsi multivitamin\r\nBila intensitas kemunculan gejala yang anda rasakan semakin sering dan mengganggu akan lebih baik bila anda bisa melakukan pemeriksaan ke dokter spesialis paru untuk evaluasi lebih lanjut dan mendapatkan pemeriksaan-pemeriksaan yang lebih lengkap\r\nSekian informasi dari saya, semoga membantu '),
(42, 'Pagi dok, mau tanya.. Kenapa pada pasien asma, fase ekspirasinya lebih panjang dari fase inspirasi.. terimakasih dok dan ditunggu jawabannya  ', 'Asma adalah penyakit kornis pada saluran pernapasan yang menyebabkan peradangan sehingga menyebabkan penyempitan pada saluran pernapasan. Beberapa hal berikut dapat memicu serangan asma yaitu asap rokok, debu, bulu hewan, aktivitas fisik, udara dingin, atau infeksi. Peradangan ini diperparah dengan produksi lendir saluran pernapasan yang meningkat sehingga saluran pernapasan bertambah sempit dan menimbulkan gejala sesak napas. Selain sesak napas, penderitanya juga dapat mengalami gejala batuk, sakit dada, dan mengi.\r\n\r\nPernapasan terdiri dari dua fase yaitu fase inspirasi (menghirup udara) dan fase ekspirasi (menghembuskan udara). Pada proses pernapasan yang normal, fase ekspirasi merupakan gerakan pasif yang tidak memerlukan gerakan otot pernapasan. Pada penderita asma, saluran pernapasan yang menyempit menyebabkan udara terperangkap di dalam kantung udara sehingga proses pengeluaran udara pernapasan berlangsung lebih lama, atau dengan kata lain, fase ekspirasi menjadi memanjang.\r\n\r\nUntuk mengatasi penyakit ini hal yang terpenting adalah dengan menghindari pemicunya. Pengobatan yang ada bertujuan mengendalikan gejala dan mencegah kekambuhan gejala, tergantung pada tingkat keparahan penyakit yang dialami penderita. Penderita juga disarankan untuk segera berkonsultasi dengan dokter jika mengalami sesak napas yang tidak kunjung membaik walaupun sudah menggunakan pengobatan agar kondisi ini segera ditangani.\r\n\r\nSemoga informasi ini membantu.'),
(43, 'Saya sudah mengalami batuk kering kurang lebih 2 minggu tenggorokan terasa gatal dan dada terkadang terasa sesak. Kira-kira solusinya apa ya untuk mengatasinya?', 'Batuk merupakan bagian dari reflex normal tubuh untuk mengeluarkan kuman, bakteri maupun benda aisng dari dalam tubuh kita terkhusus dari saluran pernafasan atas. Namun bila respon batuk terjadi secara terus menerus hal tersebut justru dapat mengganggu kenyamanan dan dapat menyebabkan iritasi pada saluran pernafasan atas. Terdapat begitu banyak penyebab batuk, namun berdasarkan dari informasi yang anda sampaikan, berikut beberapa kemungkinan penyebabnya:\r\n•	ISPA\r\n•	Batuk asma\r\n•	Alergi\r\n•	Faringitis\r\n•	Laringitis\r\nMemerlukan pnggalian lebih lanjut terkait adanya gejala lain yang menyertai keluhan anda seperti misalanya demam, nyeri menelan, suara serak, dll serta pemeriksaan fisik secara langsung yang terarah dan sistematis\r\nunutk sementara:\r\n•	Hindari debu, polusi, asap rokok\r\n•	Tidak mengkonsumsi makanan pedas, gorengan, keripik\r\n•	Tidak mengkonsumsi makanan manis seperti permen, coklat, dll\r\n•	Perbanyak minum air putih\r\n•	Menghindari pemakaian selimut berbulu dan boneka berbulu\r\n•	Mengganti dan membersihkan sprei dan gorden\r\n•	Membuka jendela rumah agar udara bersirkulasi\r\nBila batuk yang anda rasakan tidak juga membaik, saya sarankan anda sebaiknya menjumpai dokter umum terdekat agar bida mendapatkan pemeriksaan secara langsung\r\nSekian informasi dari saya, semoga membantu.'),
(44, 'Saya mau tanya bronkitis ashmacitis itu apakah penyakit menular? Hasil ronsen asma bronchiale itu apa ya? Keluarga saya tidak ada riwayat asma. Terus apa yang harus saya lakukan agar tidak kambuh.', 'Asma merupakan suatu keadaan yang cukup sering terjadi. Asma merupakan suatu penyakit paru. Penyebab pasti asma hingga saat ini belum diketahui secara pasti, namun asma berkaitan dengan beberapa faktor resiko seperti sering terpapar debu, asap rokok, bulu binatang, aktifitas fisik, udara dingin, serta iritasi bahan kimia tertentu. Hal tersebut dapat mencetuskan asma. Asma memang berkaitan dengan faktor keluarga, tetapi asma tetap dapat terjadi walaupun tidak ada riwayat keluarga yang memiliki asma.\r\n\r\nAsma menyebabkan saluran nafas menjadi sangat sensitif terhadap alergen. Alergen adalah suatu zat yang dapat menyebabkan terjadi nya serangan asma, seperti misalnya stres berlebihan, paparan asap, udara dingin, debu, dll. \r\n\r\nAsma bukan merupakan suatu penyakit menular. Asma tidak ditularkan melalui udara pernafasan. \r\n\r\nBiasanya asma akan kambuh jika terpapar alergen tersebut seperti yang telah disebutkan diatas. Asma dapat menyebabakn gejala seperti rasa sesak disertai dengan mengi, batuk berdahak, demam, pusing, atau pada keadaan yang parah dapat terjadi gagal nafas.\r\n\r\nOleh karena itu, penting untuk anda melakukan kontrol rutin ke dokter. atau jika terjadi serangan asma ulang, maka sebaiknya anda segera berobat ke dokter sehingga mendapat pertolongan yang tepat.\r\n\r\nterdapat beberapa tips yang dapat anda lakukan:\r\n\r\nHindari paparan alergen tersebut, misalnya dengan menghindari udara yang terlalu dingin, gunakan masker pada saat berada di luar rumah, hindari kontak dengan binatang berbulu, dll\r\nOlahraga teratur pada saat sedang tidak terjadi serangan asma\r\nJangan merokok dan jangan konsumsi alkohol\r\nHindari stres berlebihan\r\nJika diperlukan nanti dokter akan memberikan obat controler untuk mengontrol kekambuhan asma jika memang diperlukan\r\ndll'),
(45, 'Saya mau bertanya kenapa setiap saya merasa kedinginan atau cuaca dingin saya selalu sesak napas?', 'Pada orang normal, perubahan suhu udara umumnya tidak akan menyebabkan gangguan pernafasan seperti sesak nafas. Bila udara dingin membuat anda menjadi sesak nafas, maka perlu diperiksa kembali apakah anda memiliki penyakit seperti asma, PPOK, atau bronkitis. Pada orang yang memiliki asma, PPOK, ataupun bronkitis, udara dingin bisa menyebabkan saluran nafas menjadi lebih kering dan teriritasi dan juga bisa menyebabkan saluran nafas menjadi lebih menyempit (terkonstriksi) sehingga dapat memicu terjadinya sesak nafas.\r\nBila sesak nafas tersebut anda rasakan saat anda berada di tempat yang dingin dan tinggi (misalnya di pegunungan), maka masih mungkin sesak yang anda rasakan tersebut masih normal saja. Kandungan oksigen di udara di tempat yang tinggi memang lebih sedikit dibanding di dataran rendah, oleh karena itu kadang di tempat yang tinggi nafas terasa menjadi lebih susah dan sesak.\r\nBila anda merasakan sesak nafas setiap kali udara menjadi dingin (tidak melihat apakah tempat tersebut termasuk dataran tinggi atau tidak), maka sebaiknya lakukan pemeriksaan ke dokter paru untuk evaluasi lebih lanjut. Dokter dapat melakukan pemeriksaan langsung pada paru anda atau bisa menyaranakan anda untuk melakukan rontgen ataupun tes fungsi paru untuk melihat apakah terdapat penyakit tertentu pada paru anda.\r\nBeberapa hal yang bisa anda lakukan untuk mengurangi kemungkinan terjadinya sesak nafas di udara dingin:\r\ngunakan pakaian yang tebal dan berlapis\r\nbalut longgar syal/scarf di sekitar hidung dan mulut anda agar anda bisa bernafas dengan udara yang lebih hangat dan lembab\r\nbila anda banyak berada di ruang ber-AC, cobalah lebih sering membersihkan AC anda dan juga gunakan pelembab udara atau humidifier di ruangan tersebut.\r\nSekian informasi dari saya, semoga cukup menjawab'),
(46, 'Mau tanya gimana cara atasi bayi yang kayak pilek tapi tidak ada lendir nya dibilang hidung tersumbat tapi masih bisa napas kalau pelan-pelan Seperti ngrok Di rongga hidung gitu usia bayi 27 hari', 'Kondisi yang dialami anak Anda bisa terjadi karena berbagai kemungkinan, diantaranya adalah:\r\nInfeksi bakteri atau virus pada sistem pernapasan\r\nPenumpukan lendir pada saluran pernapasan\r\nAsma\r\nKelainan struktur pernapasan\r\nAdanya benda asing pada saluran pernapasan\r\nSaran kami, mengingat usia anak Anda yang juga masih belum genap 1 bulan, sebaiknya Anda langsung periksakan ia ke dokter anak, agar bisa diamati langsung, diperiksakan sehingga tidak terjadi kesalahpahaman. Hal ini amat penting karena anak seusianya masih amat rentan terhadap apapun. Dengan diperiksakan ke dokter anak, segala kemungkinan bisa dipertimbangkan dan penanganannya pun bisa lebih tepat.\r\nSementara itu, tetap berikan ASI kapanpun ia minta, serta perhatikan betul kondisi fisiknya. Jika ia kemudian bernapas lebih cepat dari biasanya, nampak lemas, demam tinggi atau menunjukkan gejala lain yang mengkhawatirkan, jangan ragu untuk memeriksakannya ke IGD RS terdekat. Sekian, semoga menjawab pertanyaan Anda.'),
(47, 'Kenapa kalau saya duduk lama napas saya menjadi pendek dan terasa sesak? Dan dada saya suka kebas, serta perut kiri saya sampai ke tulang rusuk terasa ada yang mengganjal. ', 'Kondisi sesak napas seringkali dikaitkan dengan masalah pada sistem pernapasan yakni sistem paru. Namun pada kenyataannya rasa sesak napas bisa juga dirasakan sebagai indikasi atau pertanda dari kemungkinan lain, yang bisa lebih ringan, dan bisa juga lebih berat. Beberapa kondisi yang dapat membuat orang merasakan sensasi kurang nyaman pada saat bernapas meliputi :\r\n•	asma bronkial yakni penyempitan saluran napas karena saluran napas terlalu sensitif dan mudah membengkak ketika mengalami suatu reaksi alergi. Kondisi ini biasanya ditemukan sejak kecil\r\n•	penyakit paru obstruktif kronis yakni kondisi rusaknya jaringan paru akibat paparan asap rokok maupun polusi lingkungan kerja maupun tempat tinggal sehingga paru menjadi sangat sensitif dan mudah menyempit\r\n•	paru yang bengkak, atau secara medis disebut dengan edema paru, terjadi ketika jantung gagal memompa secara efektif darah yang mengalir ke jantung yang berasal dari paru sehingga cairan menumpuk di paru\r\n•	serangan jantung, tak jarang dikarakteristikkan dengan sesak atau rasa terhimpit didada disertai rasa kesemutan yang menjalar ke lengan kiri, dada, atau bahu\r\n•	kondisi asam lambung atau pada penyakit maag sering pula menimbulkan rasa tidak nyaman pada daerah ulu hati\r\nKetika menghadapi kondisi sesak yang perlu dipastikan ialah mantap tidaknya jalan napas yang bisa dinilai dari apakah seseorang yang sesak mampu bersuara dengan lancar. Bila sesak sudah sedemikian buruk hingga seseorang sulit berbicara, maka kondisi tersebut membutuhkan pertolongan segera di unit gawat darurat. Ketika sesak timbul usahakan untuk duduk tegak, dan bukan berbaring karena akan semakin menambah sesak. Penting bagi Anda untuk mengevaluasi penyebab sesak yang timbul untuk kemudian mendapatkan penanganan yang tepat.'),
(48, 'Sesak napas saya selama ini kok tidak hilang hilang, padahal saya sudah coba cek paru, jantung, bukan berasal dari organ tersebut. Memang saya ada asam lambung, tapi kalau saya lakukan MRI agar saya lebih mengerti sebenarnya sesak napas saya dikarenakan oleh apa, itu bisa tidak, jika saya melakukan MRI? Dan apakah MRI juga akan mengetahui penyakit apa sebenarnya yang saya derita? ', 'Sesak napas bisa beragam kemungkinan penyebabnya, mulai dari gangguan pernapasan (seperti asma, bronkhitis, pneumonia, pneumothorax), gangguan pencernaan (seperti gastroesophageal reflux disease, tukak lambung, gastritis), gangguan jantung (seperti gagal jantung kongestif, serangan jantung, gangguan katup atau irama jantung), gangguan muskuloskeletal (seperti patah tulang rusuk, skoliosis), gangguan mental (seperti kecemasan berlebih, serangan panik, gangguan somatoform), alergi, efek samping obat, cidera dada, gangguan ginjal, gangguan hati, dan sebagainya.\r\nKarena penyebabnya yang beragam, pemeriksaan yang perlu dilakukan untuk mendeteksi penyebabnya pun bisa berbeda, demikian pula penanganannya. Seringnya, untuk menggali penyebab sesak napas, dokter akan melakukan wawancara mendalam (anamnesis), dibarengi dengan pemeriksaan fisik menyeluruh dari kepala hingga kaki, juga pemeriksaan penunjang, contohnya rontgen, rekam jantung (elektrokardiografi, echocardiography), USG, endoskopi, dan sebagainya. Meski sangat jarang dilakukan, MRI mungkin saja dilakukan untuk mendeteksi penyebab sesak jika dicurigai berkaitan dengan patah tulang belakang atau rusuk, tumor di sekitar rongga dada, cidera dada, atau gangguan lainnya.\r\nBerkonsultasilah langsung dengan dokter atau dokter spesialis penyakit dalam supaya kondisi Anda bisa dievaluasi dan ditangani dengan baik sesuai penyebabnya. Dengan pengalaman dan kompetensinya, dokter yang memeriksa Anda tentu lebih memahami pemeriksaan seperti apa yang perlu dan tidak diperlukan pada kasus Anda.\r\nSementara ini, Anda bisa kurangi sesak yang Anda rasakan dengan cara:\r\nAplikasikan kompres hangat di area yang sesak\r\nRajin lakukan latihan pernapasan, contohnya dengan berenang, yoga, meditasi, bernyanyi, mengaji\r\nBila ada substansi yang kerap membuat Anda alergi, jauhi substansi tersebut\r\nMakanlah dengan teratur, sedikit-sedikit tapi sering\r\nJauhi makanan atau minuman yang rentan memperberat sesak, contohnya yang banyak mengandung gas (seperti kol, sawi, umbi-umbian), yang berlemak, berminyak, bersantan, pedas, juga minuman berkafein (seperti teh, kopi, soda, cokelat)\r\nJaga kebersihan lingkungan Anda\r\nKelola emosi dan pikiran Anda dengan baik\r\nJangan sembarangan minum obat tanpa resep dokter\r\nJauhi rokok dan asapnya\r\nSemoga membantu ya.'),
(49, 'Saya saat ini sedang menderita batuk, disertai mual saat batuk dan sering merasa cepat capek dada berdetak cepat dan berat badan saya berkurang atau kurus mohon penjelasannya', 'Kondisi yang Anda alami bisa terjadi karena berbagai kemungkinan, diantaranya adalah:\r\nBronkitis kronis\r\nAsma\r\nAlergi\r\nTuberkulosis\r\nEfek samping obat penurun tekanan darah\r\nPPOK\r\nDan bisa juga sebab lainnya tergantung dari hasil pemeriksaan. Saran kami, sebaiknya Anda periksakan keluhan Anda pada dokter paru untuk dilakukan penggalian riwayat, pemeriksaan fisik serta penunjang seperti tes dahak dan rontgen, untuk mengerucutkan kemungkinan dan menentukan diagnosisnya. Penanganan yang akan Anda terima nanti tergantung hasil pemeriksaan ini.\r\nSementara itu, perbanyak konsumsi minuman hangat yang dicampur jahe, madu atau lemon, mandi atau berendamlah dengan air hangat, istirahat yang cukup, hindari debu, asap rokok dan polusi, istirahat yang cukup dan periksakan diri Anda ke dokter. Sekian, semoga menjawab pertanyaan Anda.'),
(50, 'Napas saya sering sesak kepala langsung pusing apa lagi kalau kecapean, terus telapak tangan sering berwarna hijau atau biru dengan tiba-tiba saya juga tidak tahu awalnya kenapa nanti tiba-tiba berwarna begitu Tolong solusinyaa biar sembuh', 'Berbagai kondisi kesehatan dapat menyebabkan keluhan sesak napas. Gejala ini dapat disertai dengan gejala lain seperti batuk, pilek, hidung tersumbat, mengi, sakit dada, jantung berdebar, mual, muntah, sakit perut, keringat dingin, bersendawa, dan lainnya. Karena banyaknya kondisi kesehatan yang menyebabkan keluhan serupa, maka untuk memastikan penyebabnya diperlukan pemeriksaan oleh dokter secara langsung.Jika Anda tidak memeriksakan diri, maka mustahil untuk mengetahui penyebab dari keluhan ini dan menentukan penanganan yang tepat.\r\nBeberapa penyebab dari keluhan sesak napas adalah:\r\nsinusitis\r\nefusi pleura\r\npenyakit paru obstruktif kronis\r\nasma\r\npenyakit asam lambung\r\ngangguang fungsi jantung, hati, atau ginjal\r\ngangguan kecemasan\r\nDemikian juga dengan keluhan telapak tangan yang berubah warna. Beberapa kondisi yang dapat menyebabkan perubahan warna kulit telapak tangan adalah sindrom Raynaud, skleroderma, lupus, dermatomyositis, atau gangguan pembuluh darah tangan.\r\nMengingat keluhan ini sudah terjadi selam beberapa waktu, sebaiknya Anda segera berkonsultasi dengan dokter spesialis penyakit dalam terlebih dahulu. Dokter perlu melakukan tanya jawab untuk memahami keluhan Anda, melakukan pemeriksaan fisik pada Anda, dan menganjurkan pemeriksaan lain seperti pemeriksaan darah, foto rontgen, EKG (rekam jantung), CT scan, dan lainnya. Setelah mengetahui penyebab dari keluhan Anda, dokter baru dapat memberikan penanganan yang sesuai untuk Anda. Penanganan untuk setiap kondisi kesehatan akan berbeda-beda oleh karena itu, penting bagi Anda untuk memastikan penyebabnya dengan memeriksakan diri ke dokter.\r\nSilakan Anda lakukan anjuran berikut:\r\nhindari aktivitas fisik yang terlalu berat\r\nberolahraga dengan teratur\r\nhindari konsumsi makanan pedas, berminyak, dan berlemak\r\nhindari konsumsi minuman berkafein, bersodam, dan beralkohol\r\nhindari kebiasaan merokok\r\nmenjaga berat badan agar tetap ideal\r\nmengelola stres dengan baik\r\nhindari paparan udara dingin\r\nSemoga informasi ini membantu Anda.'),
(51, 'Apakah menggunakan rokok elektrik lebih berbahya di banding rokok biasa?', 'Hingga saat ini rokok elektrik dianggap sedikit lebih aman daripada rokok biasa. Namun WHO dan BPOM menyatakan bahwa rokok elektrik belum bisa dikatakan aman karena penelitian mengenai efek samping jangka panjangnya belum diteliti secara maksimal. Beberapa peneliti menemukan bahwa pada rokok elektrik bisa mengeluarkan zat aktif penyebab kanker yang berbahaya bagi tubuh bila terkena panas. Dan merokok elektrik dalam ruangan pun akan berbahaya karena bisa mengeluarkan zat yang sama dengan rokok biasa. Anda bisa membaca lebih jauh mengenai keamanan rokok elektrik pada artikel Apakah Rokok elektrik aman? Memilih Rokok elektrik / rokok Biasa\r\nSemoga membantu.'),
(52, 'Anak saya umur 6 bulan sakit batuk berdahak dan pilek? kemarin saya sudah beli alat nebulizer daripada bolak balik terapi. obat untuk terapi nebulizer itu apa saja. dan berapa takarannya?', 'Nebulizer merupakan sebuah alat yang merubah obat cair sehingga dapat terlarut menjadi uap. Pengguunaan terapi nebulizer [pada anak ini biasa digunakan untuk membantu meredakan gejala pilek, batuk, sesak dan penyakit - penyakit lain yang dapat menghambat jalannya aliran udara.\r\n\r\nVentolin merupakan merk dagang yeng mengandung salbutamol yang berguna untuk melegakan jalan nafas. Termasuk kedalam golongan bronkodilator reaksi cepat. Obat ini memang dapat dipergunakan untuk inhalasi dengan nebulizer dalam mengatasi keluhan - keluhan yang anak anda alami. Namun dosis pemberiaannya sangatlah bergantung pada berat badan anak. Yang menjadi pertanyaan berapakah berat badan anak anda? \r\n\r\nSebaiknya diskusikan kembali mengenai penggunaan nebulizer ini dengan dokter yang menangani anak anda, karena frekuensi pemberian obat inhalasi ini juga dipengaruhi oleh tingkat keparahan penyakit yang dialami anak anda. '),
(53, 'Beberapa hari ini, ayah saya sering mengalami kejang setelah batuk. Ayah saya merupakan penderita jantung koroner. Apa penyebabnya?? Apa ada hubungan antara penderita jantung dengan kejang? Kalo batuknya sampai terdengar kaya kehabisan napas dan cukup lama batuknya.', 'Kejang merupakan gangguan aktivitas listrik pada otak yang terjadi secara abnormal dan tidak terkontrol, kejang dapat di sebabkan oleh banyak faktor mulai dari kelainan struktur otak itu sendiri atau penyebab lain yang menyebabkan gangguan pada otak. Perlu dipastikan dan di evaluasi lebih lanjut mengenai keluhan kejang yang anda maksudkan, mulai dari pola kejang, gerakan tubuh, sebelum terjadi kejang, setelah kejang serta durasi waktu kejang yang anda maksud.\r\nUmumnya kejang terjadi secara singkat dalam waktu 30detik hingga 2 menit, dan selama terjadi kejang pasirn tidak sadarkan diri. Pada penderita penyakit jantung kaitan yang paling umum terjadi adalah bila terdapat kegagalan pompa jantung yang mengakibatkan aliran darah ke otak menjadi tidak efektif sehingga terjadi kekurangan oksigen pada otak.\r\nTerkait keluhan batuk yang terjadi pada ayah anda juga di perlukan evaluasi lebih lanjut terkait kemungkinan penyebab terjadinya batuk, mulai dari batuk asma, ppok, pneumonia, atau batuk akibat penumpukan cairan di paru terkait penyakit jantung yang di derita ayah anda\r\nBeberapahal yang perlu di perhatikan:\r\n•	Hindari penggunaan pakaian ketat\r\n•	Lepaskan kalung, gelang dan semua aksesoris tubuh\r\n•	Hindari memasukan benda-benda pada mulut ketika kejang\r\nBila kejang terus terjadi ada baiknya anda segera membawa ayah anda ke UGD terdekat agat bisa mendapatkan pemeriksaan serta penatalaksanaan yang tepat dan cepat\r\nSekian informasi dari saya, semoga membantu');
INSERT INTO `data_ori` (`id_data_ori`, `pertanyaan`, `jawaban`) VALUES
(54, 'Saya usia 21 tahun, dari kecil saya sudah kena asma, sering banget sesak napas dan batuk mangi kalau cuaca dingin. Sampai usia saya 21 tahun kok belum juga sembuh. apa obat penyembuh sakit saya dok. Saya merasa kalau sesak dada saya sakit sekali', 'Penyakit Asma tergolong penyakit jangka panjang (kronis) sehingga penyakit tersebut bisa saja terus dialami hingga berpuluh-puluh tahun lamanya. Bahaya atau tidaknya asma tidak di tentukan dari berapa lamanya penyakit asma dialami, melainkan seberapa berat serangan asma terjadi. Jadi analogi suatu penyakit kalau makin lama akan semakin berat kurang tepat menggunakan analogi tersebut pada penyakit asma\r\n\r\nPenyebab terjadinya asma sendiri masih belum diketahui secara pasti, namun para ahli berpendapat bahwa kondisi tersebut bisa terpicu akibat adanya alergen (debu, serbuk bunga, bulu hewan), polusi udara, kelembaban udara, faktor emosi dan psikologis, dsb. \r\n\r\nObat-obatan asma pada umumnya membantu untuk mengurangi gejala yang terjadi, namun selama pemicunya masih terus ada maka serangan asma bisa muncul kembali. Itulah mengapa peran sertai dari pasien itu sendiri untuk mengingat-ingat kapan biasanya serangan asma muncul, dan memeperkirakan faktor apakah yang menjadi pemicunya, sehingga untuk kedepannya faktor tersebut bisa di dihindari atau diminimalisir. Jangan ragu untuk memeriksakan diri ke dokter ahli paru, supaya bisa dilakukan beberapa pemeriksaan dan wawancara kesehatan, supaya bisa di dapatkan informasi tambahan untuk menentukan penanganan apakah yang paling sesuai dengan Ayu.\r\n\r\nAdapun saran untuk Ayu coba lakukan adalah : menjaga kebersihan kamar dan rumah supaya tidak terlalu banyak debu berterbangan, karena keluhan yang dialami oleh Ayu cenderung terjadi pada saat cuaca dingin, maka pada saat musim hujan diharapkan mengkonsumsi obat asma secara rutin untuk mencegah terjadinya kekambuhan\r\n\r\nSemoga bermanfaat '),
(55, 'Saya mengalami batuk hampir setiap hari, dan asma saya juga sering sekali kumat, dan daya tahan tubuh saya kurang, sering kali keringat dingin, saya sudah menjalani pemeriksaan Thorax PA untuk ke dua kalinya, hasilnya Thorax saya saat ini masih normal namun terdapat flek-flek putih pada foto Thorax, saya ingin tahu apakah ini berbahaya untuk kedepannya? Dan mengapa batuk saya tidak kunjung sembuh?', 'Apakah keluhan batuk “lama” yang terjadi setiap hari itu telah berlangsung lebih dari 2 minggu?\r\nTerdapat beberapa kemungkinan yang dapat menyebabkan keluhan batuk lama yang berlangsung 2 minggu atau lebih, antara lain:\r\n1.	Tuberkulosis (TB/TBC) paru, yakni penyakit infeksi paru oleh bakteri Mycobacterium tuberculosis, keluhan berupa batuk lama yang berlangsung 2 minggu atau lebih, banyak berkeringat terutama pada malam hari, penurunan berat badan tanpa penyebab yang jelas, dan demam lama\r\n2.	Rhinosinusitis akut, yakni radang mukosa hidung dan sinus di sekitar hidung, disebut akut bila berlangsung kurang dari 12 minggu; disebut kronis jika lebih dari 12 minggu, keluhan berupa ingus kental yang terasa mengalir di belakang tenggorokan, batuk, nyeri pada wajah, hidung tersumbat, demam, nyeri tenggorok, sakit kepala\r\n3.	Asma, yakni penyakit radang kronis di saluran pernapasan yang mengakibatkan respons berlebih, sumbatan, dan keterbatasan aliran udara akibat penyempitan saluran napas bagian bawah serta penumpukan lendir, keluhan berupa mengi saat mengeluarkan napas, batuk yang memberat di malam hari, kesulitan bernapas, dada seperti diikat, keluhan memberat ketika terpapar faktor risiko seperti debu, tungau, asap rokok, olahraga, infeksi saluran napas, atau stress emosional\r\n4.	Penyakit refluks gastroesofageal (gastroesophageal reflux disease [GERD]), yakni penyakit akibat naiknya asam lambung ke kerongkongan, faring, dan/atau paru, keluhan berupa rasa terbakar di ulu hati yang naik sampai ke belakang tulang dada, rasa pahit/asam di mulut, banyak bersendawa, perut cepat kembung, mual; keluhan memberat setelah makan atau berbaring)\r\n5.	Efek samping obat, contoh: obat antitekanan darah tinggi golongan penghambat enzim pengonversi angiotensin\r\n6.	Kanker paru, lebih banyak terjadi di usia tua, keluhan batuk lama yang dapat disertai darah, sesak, penurunan berat badan, badan lemas\r\nAnda disarankan untuk memeriksakan diri ke dokter, dokter spesialis penyakit dalam, atau dokter spesialis paru supaya dapat dilakukan evaluasi dan penanganan yang tepat. Selain anamnesis dan pemeriksaan fisis, dokter mungkin merencanakan pemeriksaan penunjang (contoh: pemeriksaan dahak, foto rontgen dada, pemeriksaan darah) bila ditemukan indikasi.\r\nSebagai anjuran, Anda disarankan untuk istirahat yang cukup, minum air putih yang banyak, makan makanan bergizi seimbang, serta mengenakan masker bila batuk-batuk. Demikian informasi dari kami. Mudah-mudahan senantiasa sehat. Semoga bermanfaat.\r\nGuna memperkaya wawasan, Anda dapat membaca artikel mengenai batuk kronis. Demikian informasi dari kami. Mudah-mudahan senantiasa sehat. Semoga bermanfaat.'),
(56, 'Saya dari sebelum hamil sering merasa pengap seperti berada di ruangan yang kekurangan udara. kadang kalau habis makan yang berminyak selalu pengap susah napas, seperti ada dahak di tenggorokan susah dikeluarkan. apalagi sekarang saya sedang hamil 4 bulan, saya bingung harus bagaimana? kalo berada di ruangan yang kurang ventilasi kadang suka jadi sesak, merasa tidak kuat dan ujung-ujungnya saya pingsan. apakah saya harus di gurah / di uap?', 'Perlu ditelaah lebih lanjut mengenai kondisi sesak yang Anda alami. Perlu diketahui sejak kapan sesak dialami, pencetus sesak (setelah aktivitas, bersama dengan batuk dan pilek, setelah beraktivitas fisik atau berdebar), gejala yang lain dialami, riwayat alergi, riwayat penyakit dan pengobatan yang sudah Anda lakukan sebelumnya.\r\nKondisi sesak napas dapat disebabkan akibat beberapa penyebab, seperti gangguan saluran pernapasan akibat obstruksi atau infeksi, gangguan organ kardiovaskular, kondisi kehamilan (penambahan volume pada daerah abdomen yang dapat menyebabkan penekanan ke rongga dada, kondisi asma. Disarankan untuk melakukan konsultasi pada dokter terkait pemeriksaan dan penatalaksanaan lebih lanjut, terutama bila terjadi pingsan.\r\nPerlu dilakukan pemeriksaan lebih lanjut untuk menegakkan diagnosis yang menyebabkan kondisi sesak dan pingsan, sehingga dapat ditentukan pengobatan yang sesuai. Bila terjadi lemas hingga ingin pingsan, segera periksakan diri Anda ke dokter atau fasilitas kesehatan terdekat. Hindari melakukan aktivitas yang terlalu berat, hindari menggunakan pengobatan sendiri tanpa instruksi dokter, pastikan Anda mendapatkan asupan nutrisi, cairan, dan istirahat yang cukup, khususnya dalam kondisi kehamilan.\r\nSemoga informasi ini dapat membantu Anda.'),
(57, 'Apakah susu beruang dapat berfungsi untuk menetralisir tubuh karena terpapar asap solder wire dari aktivitas men-solder? atau dari paparan yang timbul dari aktivitas mesin laser cut?', 'Produk susu yang Anda sebutkan dihasilkan dari pengolahan susu sapi. Konsumsi susu memang baik sebagai pelengkap kebutuhan gizi harian Anda. Menurut banyak literatur, susu berguna dalam menjaga daya tahan tubuh agar tidak muda sakit. Tidak hanya itu, minum susu secara teratur juga bisa membuat tubuh lebih segar, bugar, kemampuan konsentrasi dan mengingat membaik, kesehatan tulang pun lebih terjaga.\r\nHingga kini, belum ada penelitian khusus yang menyebutkan bahwa konsumsi produk susu yang Anda sebutkan bisa menetralisasi paparan asap solder wire dan aktifitas mesin laser cut sebagaimana yang Anda sebutkan. Karenanya, kami tidak berwenang untuk merekomendasikan atau melarang penggunaannya untuk tujuan tersebut. Secara garis besar, semua susu baik untuk menjaga kesehatan Anda.\r\nAdapun yang patut Anda waspadai dari aktifitas-aktifitas tersebut ialah pajanan asapnya yang kemungkinan mengandung beragam zat kimia, seperti aseton, metil alkohol, formaldehid, metana, karbon dioksida, asam diterpin, karbon monoksida, dan isopropil alkohol. Asap ini, jika terhirup, terlebih dalam jumlah banyak dan jangka panjang, bisa merusak jaringan di paru Anda hingga memicu beragam penyakit, seperti asma, bronkhitis, dan emfisema. Risiko Anda mengalami keganasan (tumor ganas) juga lebih tinggi dengan pajanan asap ini.\r\nOleh karenanya, agar terhindari dari potensi dampak bahaya asap ini, Anda perlu lindungi diri Anda dengan penggunaan APD (alat pelindung diri) yang benar, jaga kebersihan diri (termasuk dengan mandi dan cuci tangan yang rajin, dan jalani selalu pola hidup yang sehat. Tidak lupa, guna meminimalisasi dampak negatif bagi kesehatan yang ditimbulkannya, aktifitassolder wire dan penggunaan mesin laser cut tersebut sebaiknya dilakukan di ruangan yang bersih, berpencahayaan dan bersirkulasi udara baik.\r\nSemoga membantu ya.'),
(58, 'Dari kemarin batuk, hidung meler, mata berair. Aku pikir itu hanya flu biasa. Tapi stelah malam datang, tiba tiba anak sesak napas, napasnya dalam. Apakah anak saya alergi? Bagaimana penanganannya?', 'Batuk, pilek, hidung dan mata berair bisa terjadi karena beragam sebab, contohnya alergi, iritasi, hingga infeksi pada saluran pernapasan. Keluhan ini, jika muncul disertai sesak, mungkin juga menandakan anak Anda mengalami asma (asma bronkhiale), yakni suatu peradangan di saluran napas bagian bawah yang menyebabkan jalan napas menyempit serta produksi lendir pun meningkat. Bisa juga, sesak terjadi karena pneumonia, bronkhitis, bronkhiolitis, gangguan jantung, juga refluks (aliran balik) asam lambung.\r\nMembedakan gejala yang muncul akibat alergi dengan kondisi lain memang gampang-gampang sulit. Namun, gejala akibat alergi khasnya akan terus berulang saat anak terpajan alergen, dan membaik usai alergen dijauhkan. Adapun alergen yang dimaksud bisa sangat bervariasi, contohnya dingin, tungau debu, bulu atau kotoran hewan, serbuk sari, spora jamur, makanan atau obat tertentu, dan sebagainya. Anak dengan alergi juga seringnya memiliki keturunan ayah, ibu, atau kerabat dekat lain yang juga menderita alergi.\r\nUntuk memastikannya, lebih baik Anda periksakan anak Anda langsung ke dokter atau dokter spesialis anak. Melalui observasi langsung, seringnya dokter sudah mampu mengidentifikasi kondisi yang berbahaya dan memberikan penanganan terbaiknya. Jika benar alergi, dokter bisa memberikan anak Anda obat-obatan anti alergi, juga obat lain disesuaikan dengan keluhan yang muncul. Obat ini bisa diberikan melalui rute oral (obat minum) atau juga nebulisasi (uap).\r\nSaat ini, yang perlu Anda lakukan:\r\n•	Jangan panik\r\n•	Kenali pencetus keluhan anak Anda, lalu sebisa mungkin, jauhkan anak dari pencetus tersebut\r\n•	Beri anak variasi makanan bergizi, dan minum yang cukup supaya lebih tenang, daya tahan tubuhnya pun terjaga\r\n•	Hindarkan anak dari kondisi lingkungan yang terlalu dingin, berangin, berudara kering, berasap\r\n•	Jauhkan juga anak dari kontak langsung dengan orang yang sedang menderita infeksi pernapasan menular\r\n•	Pastikan lingkungan sekitar anak dalam kondisi bersih, bersirkulasi dan berpencahayaan baik\r\n•	Mandikan anak dengan air hangat\r\n•	Hindari memberikan anak makanan atau minuman yang terlalu dingin\r\n•	Tidak sembarangan memberi obat pada anak tanpa resep langsung dari dokter\r\nSemoga membantu ya. '),
(59, 'Anak saya punya riwayat bronkopneumonia dan pernah dirawat inap -+2 minggu yang lalu. Sekarang batuk pilek lagi hampir seminggu, sudah di bawa ke dokter tapi tetap masih batuk, apakah bronkopneumonia itu bisa kambuh lagi? Saya takut kalau kambuh lagi dan harus rawat inap lagi. apakah batuk yang hampir seminggu itu bisa jadi gejala dari kambuhnya bronkopneumonia?', 'Kami turut prihatin dengan kondisi anak Anda. Bronkopneumonia merupakan salah satu penyakit saluran napas yang dapat terjadi pada anak-anak dan lansia, terutama karena sistem kekebalan tubuhnya yang rendah. Kondisi ini gejala utamanya adalah batuk, sehingga tidak spesifik dan bisa disalahartikan dengan penyakit lain. Penyebab terjadinya kondisi ini bisa karena infeksi bakteri, virus dan jamur. Sehingga mengenai pertanyaan Anda, penyakit ini memang bisa terjadi lebih dari sekali karena penyebabnya ada banyak dan tubuh tidak membentuk kekebalan khusus layaknya penyakit cacar.\r\nKemudian, untuk keluhan batuk pilek selama seminggu yang dialami anak Anda, selain bronkopneumonia, harus dipertimbangkan juga kemungkinan lain seperti:\r\n•	ISPA atau infeksi saluran pernapasan akut\r\n•	Asma\r\n•	Tuberkulosis\r\n•	Alergi\r\n•	Batuk rejan\r\n•	Croup\r\nDan masih banyak kemungkinan lainnya tergantung dari hasil pemeriksaan. Saran kami, sebaiknya jika kondisi anak Anda tidak membaik, segera Anda bawa ia ke dokter paru untuk dilakukan pemeriksaan lebih lanjut. Dokternya nanti mungkin akan melakukan pemeriksaan penunjang seperti USG dan tes dahak bila anak Anda bisa mengeluarkan dahaknya. Tes semacam ini penting untuk mengerucutkan kemungkinan dan menentukan penanganan terbaik baginya.\r\nSementara itu, bantu kesembuhan anak Anda dengan menjauhkannya dari debu, polusi, asap rokok, memenuhi kebutuhan nutrisinya, menjaga kebersihan dirinya dan lingkungan, selalu mencuci tangan seluruh anggota keluarga, dan segera memerisakannya ke dokter. Sekian, semoga menjawab pertanyaan Anda.'),
(60, 'Asma sudah lama saya derita, setiap hari saya konsumsi obat asma ventolin inhaler, seminggu lalu saya kena serangan jantung dan masuk ICU, dan katanya itu aritmia. yang mau saya tanyakan, masih bolehkah saya menggunakan ventolin inhaler jika saya juga menderita aritmia?', 'Asma merupakan suatu penyakit dimana terjadi hipersensitifitas saluran nafas terhadap suatu alergen seperti misalnya debu, udara dingin, asap, bulu binatang, atau terkadang ketika terlalu lelah aktifitas. \r\n\r\nAritmia merupakan suatu keadaan dimana terjadi kelainan pada listrik jantung. aritmia sendiri dapat terdiri dari berbagai macam jenis aritmia. Tipe aritmia apakah yang anda alami? karena tidak semua tipe aritmia sama. \r\n\r\nventolin merupakan suatu obat yang mengandung kandungan salbutamol. salbutamol merupakan suatu obat golongan beta agonist. Obat golongan tersebut dapat mencetuskan terjadinya suatu aritmia pada jantung seperti misalnya ventrikel takikardia, atau terjadinya takikardia supra ventrikel. \r\n\r\nOleh karena itu biasanya penggunaan obat seperti ventolin tidak dianjurkan pada penderita aritmia. Maka dari itu disarankan agar anda berkonsultasi langsung ke dokter spesialis penyakit dalam ya, sehingga dokter dapat memeriksa jenis aritmia anda, memeriksa keadaan fisik anda, dan dapat menganjurkan terapi yang tepat untuk anda.\r\n\r\nberikut artikel yang dapat anda baca mengenai aritmia\r\n\r\nsemoga bermanfaat. terimakasih  '),
(61, 'Flu berat karena terpapar angin kencang, setelah itu saya minum semacam susu diet, dada saya terasa sangat sakit dan kering, bernapas terbatas dan bengek. Apakah flu tersebut berpengaruh dengan asma?', 'Munculnya rasa nyeri di dada, sesak napas, dan juga mengi (bengek) memang bisa jadi disebabkan oleh asma (asma bronkhiale). Asma sendiri merupakan suatu peradangan kronis pada saluran pencernaan bagian bawah yang menyebabkan diameter saluran pernapasan menyempit dan produksi lendir menjadi meningkat. Kondisi ini bisa menyebabkan penderitanya mengalami keterbatasan aktifitas, hingga mengganggu kualitas tidurnya.\r\n\r\nAsma merupakan penyakit yang sifatnya kambuhan. Kekambuhannya biasanya dicetuskan oleh banyak faktor, termasuk juga infeksi saluran pernapasan (yang ditandai dengan hidung tersumbat atau berair), paparan angin atau alergen lain (seperti serbuk sari, dingin, tungau debu, kutu hewan, spora jamur), dan konsumsi makanan atau minuman tertentu (termasuk produk olahan susu). Tidak hanya itu, bisa juga serangan asma muncul akibat dipicu oleh aktifitas fisik yang berlebihan, pajanan polutan udara (contohnya asap), efek samping obat, perubahan emosi yang drastis, refluks asam lambung, dan beragam faktor lainnya.\r\n\r\nBelum diketahui penyebab pasti dari asma. Namun, banyak ahli menduga kondisi ini terjadi berkaitan dengan faktor genetik (keturunan) yang mengakibatkan seseorang mengalami kecenderungan atopik, tidak hanya asma, namun bisa juga rhinitis alergi dan juga dermatitis atopik.\r\n\r\nTidak hanya asma, mungkin juga nyeri dada, sesak napas, dan juga mengi yang Anda alami muncul akibat pencetus lain, contohnya bronkhitis, pneumothoraks, GERD (gastroesophageal reflux disease), tuberkulosis, pneumonia, gagal jantung kongestif, serangan panik, efek samping obat, dan sebagainya.\r\n\r\nApabila keluhan Anda terasa amat mengganggu, sebaiknya Anda periksakan langsung diri Anda ke dokter ya.. Dengan pemeriksaan klinis secara langsung, umumnya dokter sudah mampu membedakan antara asma dengan penyakit lainnya. Namun, bisa juga, dokter mengarahkan Anda menjalani pemeriksaan penunjang lain, seperti rontgen, tes dahak, tes laboratorium, dan sebagainya untuk mengkonfirmasi diagnosis yang tepat. Bila benar Anda mengalami asma, bisa juga dokter merujuk Anda ke dokter spesialis paru untuk mendapat tatalaksana lebih lanjut.\r\n\r\nSebagai penanganan awal, coba redakan keluhan Anda dengan cara berikut:\r\n\r\n•	Saat keluhan datang:\r\no	Pindah ke tempat yang nyaman\r\no	Jangan panik\r\no	Atur napas Anda dengan baik\r\no	Longgarkan pakaian Anda\r\no	Kompres dada yang nyeri dengan air hangat\r\no	Duduk tegak sambil beristirahat dari kegiatan yang terlalu melelahkan Anda\r\n•	Minimalisasi risiko terjadinya infeksi saluran pernapasan, yakni dengan meningkatkan kebersihan diri, gunakan masker penutup hidung, rajin cuci tangan\r\n•	Tingkatkan daya tahan tubuh, yakni dengan rutin berolahraga, banyak mengonsumsi sayur, buah, dan makanan bergizi lainnya, tidur teratur\r\n•	Tidak merokok\r\n•	Hindari pajanan dingin, polutan, dan iritan udara lainnya\r\n•	Jangan stres, panik, atau cemas berlebihan\r\n•	Hindari konsumsi obat sembarangan\r\n•	Makan dan minum dengan teratur\r\nSemoga membantu ya..    '),
(62, 'Obat herbal untuk asma apa?', 'Asma merupakan penyakit peradangan kronis pada saluran nafas yang timbul karena reaksi alergi dimana tubuh sensitif terhadap paparan alergen seperti udara dingin, debu, asap, makanan, minuman, dan lain sebagainya. Paparan alergen tersebut akan memicu respon berlebihan di tubuh dengan melakukan penyempitanpada saluran nafas danmenimbulkan gejalaberupa sesak nafas, disertai bunyi mengi, dengan/tanpa disertai batuk. Asma ini merupakan penyakit yang diturunkan, biasanya orang-orang akan lebih berisiko terkena asma bila memiliki riwayat alergi atau asma dalam keluarga. Apabila keluhan asma ini dirasakan sering timbul dan mengganggu sebaiknya konsultasikan ke dokter untuk mendapat penanganan yang tepat. Dokter akan melakukan pemeriksaan menyeluruh dan pemeriksaan tambahan seperti pemeriksaan rontgen, spirometri, dll sesuai kebutuhan. Penanganan biasanya dengan pemberianobat-obatan pelega nafas (bronkodilator), seperti salah satunya adalah salbutamol, obat antiradang, dan obat-obatan lainnya sesuai kebutuhan. Penanganan utama penyakit asma adalah dengan cara menghindari pencetusnya karena bila tidak terpapar dengan pencetus tersebut maka serangan tidak akan terjadi. Mengenai obat-obatan herbal, saat ini belum ada obat-obatan herbal yang disarankan yang bisa mengobati penyakit asma. Sebaiknya tetap lakukan pola hidup sehat, stop rokok dan hindari paparan asap rokok dan paparan debu atau asap, olahraga teratur, makan makanan yang sehat dan bergizi, cukupi kebutuhan cairan, serta istirahat yang cukup.\r\nDemikian, semoga membantu.'),
(63, 'Anak saya lahir prematur 8 bulan. Dan sekarang anak saya terkena penyumbatan di bagian paru. setelah di ronsen paru nya tersumbat gelembung udara terus apa yang saya lakukan?', 'Perlu diperjelas, seperti apa persisnya gejala yang anak Anda alami saat ini? Berapa usianya sekarang?\r\n\r\nKondisi dimana paru-paru tersumbat oleh gelembung udara yang Anda maksud mungkin emboli paru.\r\n\r\nEmboli paru terjadi ketika pembuluh darah yang mensuplai paru dengan oksigen dan nutrisi mengalami penyumbatan. Akibatnya, jaringan paru bisa rusak dan fungsi pernapasan pun akan terganggu, sehingga penderita akan mengalami batuk, nyeri dada, sesak napas, kebiruan di jari dan bibirnya, lemas, gelisah, bahkan bisa pula menurun kesadarannya. Kondisi ini sesungguhnya lebih umum dialami orang tua, namun tidak menutup kemungkinan juga kondisi ini terjadi pada anak-anak, terlebih yang jarang bergerak, mengalami masalah dengan penggumpalan darah, atau mengalami gangguan jantung tertentu.\r\n\r\nSelain emboli paru, kondisi bayi Anda mungkin juga merujuk pada kondisi lain, misalnya pneumonia, bronkhitis, bronkhiolitis, asma, pneumothoraks, hambatan pematangan paru akibat permaturitas, dan sebagainya. Sangat banyak kemungkinan kondisi yang bayi Anda alami, sehingga untuk mengetahui penanganan terbaiknya, idealnya Anda bertanya langsung dengan dokter atau dokter spesialis anak yang merawat bayi Anda guna mengindari misinterpretasi. Sebelum memberikan penanganan, dokter terlebih dulu akan menegakkan diagnosis atas keluhan bayi Anda dengan wawancara mendalam, pemeriksaan fisik, juga beberapa tes penunjang, contohnya rontgen, laboratorium, tes saturasi oksigen, dan sebagainya. Dengan cara ini, dokter tentu bisa memberikan bayi Anda tatalaksana terbaik sesuai dengan penyebab yang mendasarinya.\r\n\r\nSaat ini, Anda sebaiknya berfokus memberikan bayi Anda ASI yang cukup sesuai kebutuhan agar daya tahan tubuhnya terjaga, dan risiko gangguan pernapasan karena masalah paru-paru pun bisa diminimalisasi dengan baik. Tidak hanya itu, banyak-banyaklah berkonsultasi dengan dokter yang merawat bayi Anda berkenaan dengan langkah penanganan yang perlu dilakukan. Anda tidak perlu panik atau cemas berlebihan. Dengan pengalaman dan kompetensi yang dimilikinya, dokter tentu bisa memberikan bayi Anda tatalaksana yang tepat demi kesembuhannya. '),
(64, 'Apakah obat hipertensi paru dapat memperburuk penyakit ASMA?', 'Hipertensi paru ialah tekanan darah tinggi yang mengenai pembuluh darah arteri di paru dan jantung sebelah kanan. Pada kasus yang ringan, seringkali kondisi ini tidak memunculkan keluhan khas. Namun, jika kondisi memberat, penderita bisa mengalami sesak napas, lemas, mudah lelah, pusing, seperti ingin pingsan, nyeri dada, bengkak-bengkak di tubuh (terutama di kaki dan perut), kulit dan bibir kebiruan, nadi cepat, dan jantung pun terasa berdebar-debar. Hipertensi paru ini bisa terjadi akibat pengaruh genetik, efek samping obat, gangguan jantung, gangguan jaringan ikat, HIV, gangguan hati, emfisema, gangguan paru, gangguan tidur, emboli paru, kelainan darah, sarkoidosis, gangguan metabolik, atau juga karena penyebab yang tidak diketahui (idiopatik). Jika tidak ditangani dengan baik, hipertensi paru bisa memicu bengkak jantung, gagal jantung, pembekuan darah, gangguan katup jantung, hingga perdarahan yang berujung kematian.\r\nHipertensi paru bukanlah merupakan kondisi yang bisa disembuhkan. Namun, dokter bisa memberikan Anda penanganan agar gejalanya membaik dan Anda pun bisa kembali beraktifitas tanpa kendala berarti. Penanganan ini bisa dilakukan dengan pemberian beberapa jenis obat, seperti vasodilator, antagonis reseptor endotelin, penghambat saluran kalsium dosis tinggi, antikoagulan, stimulator SGC (soluble guanylate cyclase), diuretik, dan sebagainya. Operasi, seperti septostomi atrium, cangkok paru, hingga cangkok jantung-paru bisa juga dilakukan pada kasus yang tidak merespon baik dengan pengobatan.\r\n\r\nBeberapa pengobatan yang kerap diberikan pada penderita hipertensi paru ada yang bisa memperburuk gejala asma, meningkatkan frekuensi serangannya, ada pula yang tidak. Tidak jarang, gejala yang muncul akibat hipertensi paru juga sangat mirip dengan gejala asma. Karenanya, perburukan asma yang muncul pada hipertensi paru tidak selalu murni terjadi akibat efek samping obatnya.\r\nSayangnya, Anda tidak menjelaskan apa persisnya jenis pengobatan yang sedang Anda jalani. Oleh karenanya, sebaiknya, konsultasikan langsung dengan dokter atau dokter spesialis penyakit dalam yang merawat pasien jika terjadi perburukan asma saat menjalani pengobatan hipertensi paru. Dengan demikian, dokter bisa melakukan evaluasi lebih lanjut untuk mendeteksi penyebabnya, dan memberikan penanganannya dengan tepat.\r\nSemoga membantu ya..'),
(65, 'Saya mau tanya, setiap bangun tidur dada sampai punggung saya terasa agak sesak, biasanya punggung yang terasa seperti pegal. Saya memang punya kebiasaan buruk seperti sering mandi di malam hari (terutama setelah lembur kerja), apa rasa sesak itu pengaruh dari mandi malam? Saya disarankan untuk meminum Susu \'beruang\' atau obat masuk angin sebelum tidur, tapi hanya sedikit efek yang saya rasakan. Mohon penjelasan dan saran untuk saya?', 'Rasa sesak saat bangun tidur secara umum dapat disebabkan oleh gangguan di saluran pernapasan, saluran cerna, atau bahkan gangguan psikiatri. Beberapa kondisi medis yang dapat mendasarinya antara lain:\r\n1. Refluks asam lambung\r\nRefluks asam lambung ke kerongkongan atau disebut dengan GERD menyebabkan sendawa berlebihan disertai dengan sesak, rasa terbakar di dada atau nyeri ulu hati.\r\n2. Rinitis alergi\r\nRinitis alergi merupakan penyakit inflamasi yang disebabkan oleh reaksi alergi pada individu yang memiliki riwayat alergi oleh karena bahan alergen tertentu dan diperantarai oleh reaksi imunologis di dalam tubuh, gejalanya antara lain ingus encer dari hidung, bersin, mata gatal, hidung tersumbat rasa gatal pada hidung dan mata, atau sesak ringan karena hidung tersumbat.\r\n3. Asma\r\nAsma merupakan penyempitan saluran napas bawah akut akibat reaksi alergi dengan gejala utama sesak disertai mengi yang dapat lebih sering terjadi di pagi hari.\r\n4. Serangan panik\r\nKondisi yang terjadi secara mendadak dan berlangsung dalam periode yang singkat. Penyebabnya tidak jelas dan dapat menimbulkan gejala akut seperti dada berdebar, berkeringat, dan sesak napas.\r\nJika keluhan dirasakan semakin memberat atau intensitas serangan semakin sering sebaiknya lakukan pemeriksaan lebih lanjut dengan dokter. Jika diagnosis telah dapat ditegakkan melalui pemeriksaan tersebut maka pengobatan yang diberikan dapat lebih terarah sehingga diharapkan gejala dapat pulih sempurna.\r\nSekian, semoga dapat membantu.'),
(66, 'Saya penderita tb kelenjar dan saya sedang masa pengobatan bulan ke 3. dan sekarang tiba-tiba saya batuk disertai demam. apakah tb saya kambuh lagi atau mungkin hanya demam biasa? karena sehari sebelum demam saya sempat kena angin malam. Pertanyaan saya selanjutnya apakah jika tb saya kambuh selagi saya masa pengobatan bisa menjadi tb resisten?', 'Pada dasarnya batuk bisa disebabkan oleh banyak kemungkinan, tidak selalu disebabkan oleh infeksi tuberkulosis dan tidak selalu menandakan tuberkulosis anda kembali lagi. Berikut ini adalah beberapa kemungkinan penyebab batuk:\r\n1.	infeksi saluran nafas atas (misalnya selesma atau common cold)\r\n2.	alergi (misalnya karena ketombe binatang, kutu debu, serbuk sari bunga, spora jamur, dll)\r\n3.	iritasi (misalnya karena paparan asap rokok ataupun polusi udara)\r\n4.	GERD atau penyakit asam lambung\r\n5.	asma\r\n6.	efek samping obat-obatan tertentu\r\n7.	dan masih banyak lagi\r\nPenyebab-penyebab di atas tetap bisa terjadi bersamaan dengan anda minum obat tuberkulosis. Oleh karena itu tentunya tidak bisa dipastikan apakah batuk dan demam yang anda alami saat ini disebabkan oleh kambuhnya tuberkulosis atau disebabkan karena hal lainnya. Untuk memastikan apakah memang tuberkulosis kambuh kembali, harus dilakukan pemeriksaan rontgen atau pemeriksaan dahak ulang.\r\nBila batuk dan demam anda tidak membaik dalam 5-7 hari ke depan, sebaiknya periksakan diri anda ke dokter kembali. Untuk saat ini, anda dapat mencoba untuk istirahat dan tidur lebih banyak, banyak minum air putih, makan makanan bergizi lengkap dalam jumlah yang cukup, menggunakan pelembab udara (humidifier) di kamar ataupun ruang kerja anda. Ada juga dapat mengkonsumsi obat batuk yang dapat anda beli secara bebas di apotek (sesuaikan dengan jenis batuk anda).\r\nSekian informasi dari saya, semoga cukup menjawab'),
(67, 'Saya punya riwayat asma sekarang lagi kambuh saya setiap minum obat selalu tremor walaupun dosisnya sudah dikurangin tapi tetap kenapa ya terus obat apa yang cocok untuk kasus seperti saya. saya biasa minum obat salbutamol yang 1mg aja masih tremor.', 'Asma adalah suatu kondisi dimana terjadi penyempitan dan pembengkakkan pada saluran nafas kecil di paru yang muncul akibat pemicu tertentu. Terapi untuk asma sendiri harus disesuaikan dengan terkontrol tidaknya asma, beratnya serangan, serta harus disesuaikan juga dengan kondisi masing-masing pasien. Secara umum terapi untuk asma dibagi menjadi terapi serangan akut dan terapi pengontrol serangan.\r\n\r\nSalbutamol adalah obat dari golongan SABA (short acting beta agonist) yang digunakan untuk terapi serangan akut asma. Bila anda memang tidak bisa mentoleransi penggunaan obat ini, terdapat obat lainnya yang dapat digunakan sebagai terapi serangan akut seperti obat-obatan dari golongan antikolinergik dan kortikosteroid.\r\n\r\nAsma adalah suatu kondisi kronis yang tidak dapat disembuhkan. Terapi yang diberikan untuk penderita asma ditujukan untuk mengontrol agar tidak terjadi kekambuhan dan serangan akut. Oleh karena itu, penderita asma dianjurkan untuk melakukan kontrol secara rutin ke dokter. Anda dapat berkonsultasi dengan Dokter Paru untuk dilakukan evaluasi lebih lanjut serta pemberian terapi yang lebih sesuai untuk kondisi anda. Sementara itu, anda harus mencoba untuk mencari pemicu asma anda dan menghindari pemicu tersebut.\r\n\r\nBerikut ini artikel yang dapat anda baca terkait penyakit asma\r\n\r\nSekian informasi dari saya, semoga cukup menjawab '),
(68, 'Saya mengeluh Napas berbunyi, dahak bening kental (kadang-kadang putih berbusa), dada & pungung sakit, cepat lelah. Itu ciri-ciri penyakit apa ya?', 'Untuk keluhan tersebut sebaiknya diperhatikan beberapa hal berikut yaitu sejak kapan hal tersebut dialami, untuk bunyi nafas seperti apa apakah berbunyi mengi atau mengorok, apakah dipicu oleh sesuatu untuk keluhan yang dirasakan.\r\nMasih terdapat beberapa kemungkinan yaitu\r\n-asma\r\nAsma adalah salah satu kelainan pada saluran pernafas berupa terjadinya penyempitan. Hal ini terkait dengan kondisi alergi seperti pada makanan tertentu atau alergi saluran nafas seperti sering bersin dan hidung berair. Gejala yang dialami pada seseorang dengan asma adalah sesak nafas dipacu oleh suatu zat tertentu, suara nafas terdengar mengi, kadang dengan sekret pada hidung atau mulut yang berupa berwarna keputihan\r\n-sumbatan jalan nafas terutama saat tidur (obstructive sleep apnea syndrome)\r\nHal ini adalah kondisi dimana terjadi sumbatan jalan nafas terutama saat kondisi tidur. Biasanya gejala yang dirasakan adalah sering terbangun tiba tiba saat tidur, tidur mengorok, saat pagi atau siang terasa lemas dan mengantuk. Hal ini dapat disebabkan oleh beberapa hal seperti pembesaran amandel, abnormal struktur lidah sehingga mudah terjatuh ke bagian belakang\r\nBeberapa hal yang dapat meredakan gejala adalah\r\n-hindari paparan terhadap suatu zat yang menyebabkan keluhan pernafasan\r\n-nutrisi yang cukup dengan gizi yang baik\r\n-olahraga secara rutin\r\n-menjaga kebersihan diri\r\n-hindari untuk terpapar sakit terutama infeksi saluran pernafasan\r\nApabila gejala menetap dan semakin menganggu sebaiknya lakukan pemeriksaan lebih lanjut ke dokter agar dapat dicari tahu penyebab dari keluhan yang dirasakan.\r\nDemikian hal yang dapat kami sampaikan.'),
(69, 'Apakah seseorang yang terlalu gemuk akan sulit untuk bernapas melalui hidung?', 'Orang yang mengalami kegemukan atau obesitas lebih rentan mengalami gangguan saluran pernafasan. Walaupun sebabnya perlu diteliti lebih lanjut, lemak berlebih pada daerah leher, dada dan perut bisa menyebabkan kesulitan bernafas dengan baik. Hormon tertentu juga dihasilkan, yang kemudian bisa mempengaruhi pola nafas yang kemudian akan menyebabkan kesulitan bernafas. Kesulitan bernafas pada orang kegemukan disebut dengan sindrom hipoventilasi obesitas (obesity hipoventilation syndrome).\r\nTerlalu gemuk juga menyebabkan beban berlebih pada seluruh tubuh, karena oksigen yang dibutuhkan menjadi lebih banyak sehingga kerja jantung menjadi lebih berat. Penyakit pernafasan seperti asma juga biasanya lebih berat jika terjadi pada orang yang mengalami kegemukan.\r\nSindrom hipoventilasi obesitas menyebabkan kadar karbondioksida di darah lebih tinggi dari kadar oksigen, gejala yang ditimbulkan diantaranya adalah rasa kelelahan dan mengantuk terus menerus, merasa kehabisan nafas, dan sering pusing. Mungkin orang terdekatnya akan mengeluhkan penderitanya mendengkur dengan keras saat malam hari karena terhambatnya saluran nafas.\r\nMengenai pertanyaan Anda, orang yang terlalu gemuk bisa saja mengalami kesulitan bernafas, namun secara umum, bukan hanya dari hidung saja. Jika Anda merasa ada yang menyumbat hidung dan tidak bisa bernafas dengan baik, sebaiknya Anda memeriksakan diri ke dokter untuk konsultasi mengenai keluhan Anda.'),
(70, 'Saya terasa sesak, rasanya seperti habis maraton, setelah saya cek heart rate nya 99bpm. Apakah itu tidak apa apa?', 'Sesak yang disertai dengan takikardi (heart rate atau denyut jantung 99 bpm), dapat disebabkan oleh beberapa hal berikut:\r\n1. Asma: asma merupakan penyakit yang diakibatkan karena adanya penyempitan dari saluran napas sehingga menyebabkan gejala sesak, berdebar-debar (denyut jantung cepat biasanya lebih dari 100x/m), dan jika parah sampai terjadi lemas dan penurunan kesadaran. Pengobatan dari asma ini harus segera, dan harus dibawa ke IGD RS terdekat untuk mendapatkan oksigen dan uap serta obat-obatan lainnya.\r\n2. Gangguan pada jantung: keluhan sesak yang disertai dada berdebar-debar (berdenyut kencang), dapat disebabkan kemungkinan karena masalah di organ jantung, biasanya ditandai dengan nyeri dada sebelah kiri, menjalar ke tangan, punggung dan leher. Keluhan ini juga harus ditangani dengan segera, dengan dibawa ke IGD RS terdekat untuk diberikan oksigen dan mendapatkan penanganan awal serta rekam jantung jika diperlukan.\r\n3. Gangguan pada ginjal: gejala dari adanya gangguan ginjal juga dapat berupa sesak, nyeri dada dan lemas. Gangguan ginjal biasanya diawali dari adanya sakit darah tinggi atau gula darah tinggi. Sehingga lama-kelamaan akan menyebabkan kerusakan pada fungsi dan organ ginjal\r\n4. Gangguan panik (gejala psikologis): jika berdasarkan pemeriksaan yang dilakukan oleh dokter semua hasilnya normal, kemungkinan yang terjadi adalah adanya gangguan panik atau gejala psikologis lainnya yang berupa sesak, dada berdebar-debar, dan sebagainya.\r\nUntuk mengetahui diagnosis dari keluhan anda, sebaiknya anda langsung berkonsultasi dengan dokter spesialis paru atau dokter spesialis jantung, agar anda dilakukan pemeriksaan langsung mulai dari pemeriksaan fisik sampai pemeriksaan lanjutan seperti rontgen dada, rekam jantung dan sebagainya jika diperlukan.\r\nJika didapatkan tanda bahaya seperti sesak berat, dada berdebar-debar, nyeri dada sebelah kiri yang menjalar ke punggung, tangan dan leher, seperti tertimpa beban berat, sebaiknya anda langsung datang ke IGD RS terdekat untuk mendapatkan penanganan awal.\r\nPencegahan yang dapat dilakukan:\r\n1. kurangi aktivitas fisik berat dan aktivitas sehari-hari\r\n2. istirahat cukup tidur minimal 6-8 jam perhari\r\n3. kurangi konsumsi lemak, asin, manis dan sebagainya\r\n4. kenali penyebab alergi jika anda memiliki riwayat sakit asma\r\n5. makan makanan sehat dan bergizi, tingkatkan konsumsi buah dan sayur\r\nDemikian, semoga bermanfaat :)'),
(71, 'Asma kambuh pada saat sedang batuk pilek. napas saya selalu berbunyi. padahal tidak. apakah saya harus memakai inhaler? karena sebagai pengidap asma, saya tidak pernah pakai inhaler, saya hanya mengkonsumsi obat salbutamol.', 'Asma adalah kondisi penyempitan saluran pernapasan jangka panjang yang disebabkan oleh peradangan dan produksi lendir berlebihan yang menyebabkan terjadinya sesak napas. Keluhan pada umumnya dipicu oleh paparan terhadap asap rokok, debu, bulu hewan, kegiatan fisik, udara dingin, atau infeksi. Napas yang berbunyi/ mengi disebabkan oleh adanya penyempitan pada saluran pernapasan. Jika Anda mengalami keluhan ini, silakan Anda menggunakan inhaler untuk melegakan pernapasan. Inhaler pada umumnya lebih baik karena dapat bekerja langsung pada saluran pernapasan untuk membuka saluran pernapasan, sedangkan tablet memerlukan beberapa waktu untuk diserap saluran pencernaan sebelum bekerja pada saluran pernapasan.\r\n\r\nJika keluhan ini sudah berlangsung selama beberapa hari atau disertai dengan sesak napas dan demam tinggi, sebaiknya Anda segera memeriksakan diri ke dokter. Dokter perlu bertanya lebih lanjut tentang keluhan ini dan memeriksa Anda. Dokter akan menentukan penanganan selanjutnya untuk mengatasi keluhan Anda ini.\r\n\r\nSementara itu, silakan Anda gunakan inhaler sesuai dengan anjuran. Hindari paparan debu, serbu sari, tungau, bulu hewan, udara dingin, atau hal-hal lain yang dapat memicu keluhan pada diri Anda.\r\n\r\nSemoga informasi ini berguna.    '),
(72, 'Apakah asma dengan gagal ginjal akut ataupun kronik saling berkaitan?', 'Perlu Anda ketahui sebelumnya bahwa asma merupakan penyakit kronis yang disebabkan oleh karena peradangan pada saluran pernapasan. Peradangan ini membuat saluran pernapasan bengkak dan sangat sensitif, sehingga saluran pernapasan menyempit.\r\n\r\nPenyakit gagal ginjal akut maupun kronis umumnya bukan diakibatkan oleh karena Asma. Penyakit asma sendiri jarang menimbulkan komplikasi jika diatasi dengan baik. Komplikasi yang paling mungkin terjadi oleh karena asma diantaranya adalah: kegagalan pernapasan, kegagalan jantung, kematian, dll.\r\nPenyakit gagal ginjal (akut dan kronis), biasanya disebabkan oleh karena: penyakit kronis yang berhubungan dengan metabolisme (misal: diabetes, tekanan darah tinggi, dll.), dehidrasi berat, mengonsumsi obat - obatan tertentu, penyumbatan saluran kencing, peradangan pada gunjal, dsb. '),
(73, 'Saya penderita lupus dan asma, juga penebalan jantung, dada berat, napas sesak jika beraktivitas, berbaring terasa lebih lega, hasil usg 6 bulan lalu, hanya terjadi kekakuan otot jantung, penyebab kenapa?', 'Sesak nafas yang terjadi saat aktivitas dapat disebabkan beberapa kemungkinan, diantaranya adalah:\r\n\r\ngangguan pada saluran nafas, misalnya asma ataupun PPOK eksaserbasi, infeksi paru, edema paru, hipertensi pulmonal, emboli paru, keganasan paru, pneumothoraks, dll\r\ngangguan pada jantung misalnya gagal jantung kongestif, penyakit jantung koroner, gangguan katup jantung, aritmia jantung, dll\r\npenyakit lainnya seperti anemia berat, asidosis metabolik, gangguan pada liver ataupun ginjal, dll\r\nGangguan pada paru biasanya dapat dideteksi dari pemeriksaan fisik ataupun rontgen paru (meski kadang diperlukan juga pemeriksaan lain seperti tes fungsi paru). Namun untuk bisa melihat kondisi jantung lebih jelas, sangat rasional bila dokter anda mengajukan untuk dilakukannya pemeriksaan USG jantung atau echocardiography ulang, terutama bila gejala ini memang baru anda rasakan.\r\n\r\nSebaiknya untuk memastikan penyebab sesak nafas anda dan juga untuk mengetahui pengobatan terbaik untuk anda, anda mengikuti saran yang diberikan oleh dokter anda tersebut.    '),
(74, 'Dokter, saya mau tanya sampai berapa penggunaan avamys? Apakah bisa dipakai berbulan-bulan setiap hari?  ', 'Avamys adalah suatu obat semprot untuk hidung. Avamys mengandung komposisi fluticasone. Fluticasone merupakan obat golonga steroid. Obat tersebut biasa digunakan untuk mengobati rhinitis alergi atau asma. Penggunaan obat semprot hidung sebaiknya tidak dilakukan sembarangan dan harus melalui pemeriksaan oleh dokter terlebih dahulu. \r\n\r\nFluticasone dapat digunakan setiap hari sesuai anjuran dokter. Biasanya penggunaan obat semprot hidung yang mengandung fluticasone biasanya tidak digunakan lebih dari 30 hari. Oleh karena itu, untuk mengetahui berapa lama pemakaian yang tepat untuk anda, maka sebaiknya anda menanyakan langsung ke dokter spesialis THT, sehingga dokter dapat memeriksa keadaan anda secara langsung terlebih dahulu.\r\n\r\nberikut artiel yang dapat anda baca mengenai pengobatan asma\r\n\r\nsemoga bermanfaat. terimakasih'),
(75, 'Saya ingin tanya kenapa saya merasa dada saya berasa ke tekan dan napas saya tidak lancar? Apakah itu ASMA?', 'Sebelum membantu menjawab keluhan anda, dokter diperlukan beberapa informasi tambahan seperti berapa usia anda, sudah berapa lama keluhan tersebut anda rasakan, apakah anda memiliki riwayat asma ataualergi, apakah terdapat keluhan lainnya seperti demam, batuk, pilek, nyeri pada dada, mual atau muntah? Apakah memiliki kebiasaan merokok? Apakah memiliki riwayat penyakit darah tinggi, kencing manis, atau jantung?\r\nBeberapa penyebab dari keluhan anda antara lain:\r\n•	Pilek/ flu\r\n•	Asma\r\n•	Penyakit paru obstruksi kronik (PPOK)\r\n•	Sinusitis\r\n•	Gagal jantung\r\n•	Infeksi saluran pernapasan\r\nKeluhan sulit bernapas bisa disebabkan oleh gangguan pada saluran pernapasan gangguan pada jantung, ataupun gangguan pada organ lainnya. Untuk menentukan penyebab yang pasti dari keluhan anda, diperlukan pemeriksaan fisik, pemeriksaan darah, pemeriksaan rontgen dada ataupun pemeriksaan alergi. Sebaiknya anda berkonsultasi dengan dokter spesialis paru-paru agar mendapatkan penanganan yang tepat. Jika memang sesak napas cukup berat hingga tidak bisa berbicara atau kulit terlihat kebiruan atau pucat maka sebaiknya segera mendatangan fasilitas kesehatan terdekat.\r\nBeberapa hal yang anda dapat lakukan adalah:\r\n•	Temukan pencetus atau alergi anda, dan cobalah untuk menghindarinya\r\n•	Jaga kebersihan rumah dan diri anda\r\n•	Hindari stres berlebihan\r\n•	Istirahat dan minum air putih yang cukup\r\n•	Konsumsi makanan yang sehat dan bergizi seimbang\r\nSemoga informasi ini dapat bermanfaat. Terimakasih'),
(76, 'Akhir-akhir ini sering kambuh, pernah sampai opname terus dikasih obat inhaler berotec. waktu kambuh pakai obat itu tidak mempan, bagaimana? Sementara pakai salbutamol, apa tidak apa-apa kalau sehari bisa mengonsumsi salbutamol 2 sampai 2 tablet yang 2mg? Terlalu sering di uap itu akan menyebabkan saluran pernapasan menjadi kaku?', 'Asma merupakan suatu kondisi dimana terjadi pembengkakkan dan penyempitan di saluran nafas kecil di dalam paru disertai dengan produksi lendir yang berlebihan. Asma adalah penyakit yang tidak bisa disembuhkan, namun bisa dikontrol dengan menghindari pemicu asma dan menggunakan obat-obatan.\r\n\r\nBeratnya asma saat sedang terjadi serangan asma bisa berbeda-beda demikian juga respon terhadap pengobatan yang diberikan. Misalnya saat terjadi serangan berat, pengobatan dengan berotec (fenoterol) saja mungkin tidak cukup. Mungkin diperlukan terapi dengan ipratropium ataupun kortikosteroid intravena. Bila serangan berikutnya ringan, mungkin pemberian fenoterol saja sudah cukup untuk meredakan gejala.\r\n\r\nPengobatan untuk pencegahan serangan asma tergantung dari seberapa sering serangan terjadi. Salbutamol merupakan obat beta agonis kerja pendek (SABA-short acting beta agonist), sehingga sebenarnya tidak digunakan untuk pencegahan serangan asma dalam jangka panjang.\r\n\r\nSebaiknya untuk kontrol penyakit asma ibu anda, konsultasikan kondisi ibu anda tersebut dengan Dokter Paru. Terapi untuk asma benar-benar bisa berbeda-beda pada setiap pasien, tergantung dari sering tidaknya serangan terjadi, adanya pemicu-pemicu tertentu, kondisi kesehatan pasien sendiri, ada tidaknya kontraindikasi terhadap pengobatan, dan lain sebagainya. \r\n\r\nPemberian terapi inhalasi tidak akan membuat saluran nafas menjadi kaku, namun kondisi asma yang tidak terkontrol sendiri dapat menyebabkan penyempitan dan kerusakan pada saluran nafas yang permanen. Kerusakan saluran nafas ini yang akan membuat saluran nafas menjadi kaku dan tidak bisa mengembang dan mengempis dengan sempurna.\r\n\r\nBeberapa hal yang dapat dilakukan ibu anda antara lain:\r\n\r\n1.	kenali dan hindari pemicu asma\r\n2.	kontrol ke dokter secara rutin\r\n3.	minum obat asma sesuai dengan petunjuk dari dokter\r\n4.	gunakan inhaler dengan benar sesuai dengan petunjuk dokter\r\n5.	lakukan vaksinasi sesuai rekomendasi dokter secara rutin\r\n \r\nBerikut ini artikel yang dapat anda baca seputar asma\r\n\r\nSekian informasi dari saya, semoga cukup menjawab   '),
(77, 'Hallo dok, saya mau tanya. Setiap pagi atau di cuaca yang dingin saya selalu mengalami flu. Ditambah saya juga penderita asma yang setiap malam sebelum tidur selalu memakai obat semprot, karena kalau tidak akan kambuh disekitar jam 3 pagi. Apa baik jika saya selalu memakai obat setiap hari dan bagaimana cara mengobati flu saya ini. Terimakasih....  ', 'Gejala flu seperti bersin dan hidung berair bisa terjadi diluar kondisi flu, diantara kondisi yang bisa memberikan gejala serupa adalah:\r\n•	Rhinitis Alergi\r\n•	Rhinitis Vasomotor\r\n•	Sinusitis kronis\r\n\r\n\r\nSementara mengenai asma, diantara pemicu kondisi ini memang adalah udara dingin, sehingga sangat wajar bagi penderita asma untuk kambuh asmanya bila terpapar udara dingin seperti pada dini hari atau ketika hujan. Itulah sebabnya sebaiknya penderita asma memiliki dua jenis obat, yakni pengontrol dan pelega agar penyakit asmanya tidak sering muncul meski ada pemicunya. Mengenai pertanyaan Anda, tidak masalah bila Anda menggunakan obat tersebut tiap hari, karena memang obat tersebut dirancang untuk sering digunakan. Saran kami, konsultasikan masalah Anda pada dokter paru untuk asma yang Anda miliki dan dokter THT untuk perihal gejala flu berulang yang Anda rasakan.\r\n\r\nSementara itu, untuk mengurangi kemungkinan kambuhnya gejala tersebut, upayakan untuk meminimalisir udara dingin yang Anda rasakan pada pagi hari seperti mengatur timer pendingin ruangan, menggunakan selimut dan lain sebagainya. Bersihkan juga kamar Anda sehingga bebas dari debu dan kotoran, dan segera periksakan diri Anda. Semoga Anda dan keluarga sehat selalu.\r\n\r\nSekian, semoga membantu.'),
(78, 'Kalau pengidap asma boleh minum cetirizine?', 'Cetirizinemerupakan suatu obat dari golongan anti-histamin atau anti-alergi yang biasanya digunakan untuk gejala-gejala alergi. Penggunaan cetirizine harus sesuai dengan resep dan anjuran dokter Anda. Sebaiknya berkonsultasi dengan dokter Anda mengenai keluhan yang anda rasakan agar diberikan pilihan terapi yang sesuai dengan keluhan Anda.\r\nCetirizine bukanlah menjadi pilihan pertama untuk mengobati penyakitasma. Terdapat beberapa pilihan obat lainnya yang lebih efektif untuk mengobati asma. Perlu diperjelas lagi tujuan anda mau minum cetirizine atau gejala yang anda rasakan pada saat ini. Jika memang anda memiliki gejala-gejala alergi dan dokter anda meresepkan cetirizine untuk alergi anda, maka anda dapat mengkonsumsi obat ini sesuai dengan anjuran dari dokter Anda.\r\nPerlu juga diketahui beberapa efek samping dari obat cetirizine antara lain:\r\n•	Rasa mengantuk, pusing, lemas dan lelah\r\n•	Gangguan pada perut, mual, ataupun diare\r\n•	Mulut kering\r\n•	Iritasi hidung\r\n•	Sakit tenggorokan\r\nSemoga informasi ini dapat bermanfaat untuk Anda.'),
(79, 'Apakah tes darah di laboratorium bisa mendeteksi penyakit asma atau hanya bisa dideteksi menggunakan spirometri', 'Asma merupakan penyakit kronis pada saluran pernafasan yabg di tandai oleh adanya penyempitan atau peradangan pada saluran nafas sehingga menimbulkan gejala seska nafas dan nafas berbunyi atau mengi, batuk, hingga nyeri dada.\r\nDiagnosis penyakit asma di lakukan berdasarkan 3 komponen penilaian klinis, mulai dari penggalian riwayat melalui wawancara, pemeriksaan fisik secara langsung dan pemeriksaan penunjang. Pemeriksaan penunjang utama yang digunakan dalam diagnosis asma adalah spirometer, dimana pemeriksaan ini menilai ada tidaknya hambatan dalam hembusan udara yang di lakukan pasien dalam 1detik, data yang di peroleh kemudian di bandingkan dengan data populasi sehat atau di bandingkan dengan data pasien pada pemeriksaan ulang setelah pemberian obat pelega asma. Pemerksaan darah umumnya hanya sebagai penunjang dalam menyingkirkan adanya kemungkinan lain seperti infeksi, dll namun bukan sebagai modalitas penegak diagnosis asma.\r\nUntuk sementara yang dapat anda lakukan antara lain:\r\n•	Mengevaluasi waktu kambuh gejala, mencari tau pencetus dan menghindarinya\r\n•	Menghindari debu, polusi, asap rokok\r\n•	Tidak merokok\r\n•	Tidak konsumsi alkohol\r\n•	Menghindari udara terlalu panas atau terlalu dingin\r\n•	Menghindari penggunaan selimut berbulu dan boneka berbulu\r\n•	Menjaga kebersihan diri dan lingkungan\r\n•	Mengganti dan membersihkan sprei dan gorden\r\n•	Membuka jendela rumah setiap pagi agar udara bersirkulasi dan cahaya matahari masuk\r\nBila keluhan yang anda rasakan tidak membaik atau anda khawatir sebaiknya anda memeriksakan diri anda ke dokter spesialis paru untuk mendapatkan pemeriksaan dan penanganan lebih lanjut terkait dengan kondisi anda\r\nSekian informasi dari saya, semoga membantu');
INSERT INTO `data_ori` (`id_data_ori`, `pertanyaan`, `jawaban`) VALUES
(80, 'Kenapa kalau lendir di tenggorokan saya tidak mau hilang dan lendir menyembabkan bau mulut. Saya ada penyakit asam lambung apakah asam lambung yang menyebabkan lendir dan bau mulut saya?', 'Keluhan tenggorokan sering berlendir sebagaimana yang Anda sampaikan dapat disebabkan oleh beberapa kemungkinan, yang tersering antara lain:\r\n1.	Rhinosinusitis kronis (radang mukosa hidung dan sinus di sekitar hidung, berlangsung lebih dari 12 minggu dengan 4 kali episode atau lebih per tahun, keluhan berupa nyeri pada wajah seperti ditekan, hidung tersumbat, ingus kental, gangguan fungsi penghidu, batuk, nyeri kepala, demam, dapat disertai rasa telinga tersumbat)\r\n2.	Asma (penyakit peradangan kronis di saluran pernapasan, menyebabkan respons berlebih, sumbatan, serta aliran udara menjadi terbatas karena penyempitan jalan napas bagian bawah dan penumpukan lendir, keluhan berupa suara mengi saat mengeluarkan napas, batuk yang memberat di malam hari, sulit bernapas, dada terasa diikat, gejala semakin berat ketika ada paparan faktor risiko [debu, tungau, asap rokok, olahraga, infeksi saluran napas, atau stress emosional])\r\n3.	Faringitis kronis (radang dinding faring yang berlangsung terus-menerus dalam beberapa minggu, keluhan berupa tenggorokan kering, batuk kering, sensasi ada benda asing di faring, faktor risikonya meliputi rhinosinusitis kronis, perokok lama, konsumsi alkohol, dan kebiasaan bernapas melalui mulut pada pasien dengan deviasi septum hidung\r\n4.	Gastroesophageal reflux disease (GERD, penyakit refkluks gastroesofageal), keluhan berupa rasa terbakar di ulu hati yang bisa menjalar sampai belakang tulang dada, rasa pahit/asam di mulut, perut kembung, sering bersendawa, mual, muntah; gejala-gejala tersebut muncul semakin parah setelah makan atau berbaring\r\n5.	Laryngopharyngeal reflux (LPR), mirip dengan GERD namun asam lambung yang naik dari lambung juga masuk ke tenggorokan, keluhan berupa nyeri tenggorokan, tenggorokan meradang, suara serak, sensasi mengganjal di tenggorokan, sering berdehem, batuk berkepanjangan (3 minggu atau lebih), nyeri atau kesulitan menelan\r\nKarena gejala tenggorokan berlendir yang Anda rasakan telah berlangsung sejak lama, kami menyarankan Anda untuk berkonsultasi langsung dengan dokter atau dokter spesialis THT. Dokter akan melakukan anamnesis, pemeriksaan fisis, serta pemeriksaan penunjang jika perlu, contohnya endoskopi. Dengan demikian, diharapkan dapat diperoleh evaluasi penyakit penyebab yang tepat dan penanganan yang sesuai untuk Anda.\r\nSebagai anjuran di rumah, Anda disarankan untuk menghindari pajanan terhadap bahan/keadaan yang diduga memicu kambuhnya keluhan, jaga higienitas diri dan lingkungan, serta konsumsi makanan bergizi seimbang. Disarankan pula untuk memelihara kebersihan gigi dan rongga mulut dengan sikat gigi 2 kali sehari untuk mengatasi keluhan bau mulut.\r\nDemikian informasi dari kami. Mudah-mudahan senantiasa sehat. Semoga bermanfaat.'),
(81, 'Apakah batuk bronkitis atau pneumonia terjadi secara terus menerus atau hanya temporal saja (kadang-kadang), lalu apa ciri umum dari batuk bronkitis?', 'Bronkitis dan pneumonia memang sama-sama dapat menyebabkan batuk. Batuk umumnya akan terjadi terus menerus selama proses penyakit masih berlangsung pada kedua penyakit ini. Batuk pada bronkitis pada umumnya adalah batuk disertai dengan dahak, dapat disertai dengan demam, nafas berbunyi mengi, rasa lemas. Pneumonia sendiri juga dapat dicirikan dengan batuk berdahak yang hampir selalu disertai dengan gejala demam tinggi, sesak nafas, nafas berbunyi, nyeri dada, serta rasa lemas.\r\nKadang memang sulit untuk membedakan antara batuk pilek biasa (selesma/commond cold) dengan bronkitis dan juga membedakan bronkitis dengan pneumonia. Namun secara umum gejala-gejala yang dirasakan pada penyakit selesma biasanya tidak seberat bronkitis (bisa hanya batuk berdahak saja, demam ringan), sementara gejala bronkitis tidak seberat gejala pneumonia. Bronkitis dan pneumonia dapat dibedakan melalui pemeriksaan radiologis (rontgen dada). Sebaiknya konsultasikan dengan dokter segera bila anda mengalami gejala-gejala pneumonia.\r\nSekian informasi dari saya, semoga cukup menjawab.'),
(82, 'Ketika saya kerja terlalu lama depan komputer membuat kepala saya pusing, migren. obat yang saya gunakan adalah asam mefenamat. sebelum meminum obat ini saya baca caca dulu di artikel dan hasilnya obat ini berpengaruh bagi penderita asma, saya punya riwayat asma sejak kecil. Apakah obat ini aman bagi saya yang penderita asma?', 'Asam mefenamat merupakan salah satu jenis pengobatan obat antiinflamasi non steroid. Konsumsi asam mefenamat dapat memberikan efek meredakan inflamasi, juga dapat meredakan rasa nyeri. Pada dasarnya, asam mefenamat bekerja dengan menghambat enzim yang berperan dalam menimbulkan rasa nyeri. Beberapa kondisi dimana asam mefenamat dapat digunakan antara lain mengurangi nyeri akibat peradangan sendi, nyeri pada saat menstruasi, nyeri pada luka pasca operasi.\r\nPada konsumsi asam mefenamat, ada beberapa kondisi medis yang perlu diperhatikan dan sebaiknya dihindari antara lain kondisi tukak lambung, peradangan usus, asma, anemia, edema, alergi terhadap obat antiinflamasi nonsteroid (misalnya aspirin dan ibuprofen), gangguan hati, gangguan ginjal, penyakit jantung, gangguan penggumpalan darah, hipertensi, epilepsi.\r\nPerlu ditelaah lebih lanjut mengenai riwayat asma apakah muncul pada saat usia kanak-kanak, atau masih menetap hingga sekarang. Jika kondisi asma masih menetap dan sering kambuh, sebaiknya konsumsi asam mefenamat dihindari. Jika kondisi asma hanya dialami pada usia kanak-kanak, perlu dilakukan konsultasi pada dokter terkait pemeriksaan dan penatalaksanaan yang sesuai dengan kondisi Anda. Terdapat penelitian yang melakukan analisis dan mendapatkan adanya kemungkinan kekambuhan kembali asma dengan konsumsi obat anti-inflamasi nonsteroid. (1) Meski didapat beberapa keterbatasan dalam analisis penelitian, kondisi asma ataupun riwayat asma perlu menjadi pertimbangan dalam pemberian pengobatan. Disarankan untuk melakukan konsultasi kembali pada dokter terkait pemeriksaan dan penatalaksanaan terhadap kondisi Anda.\r\nSemoga informasi ini dapat membantu Anda.'),
(83, 'Saya mengalami batuk dan asma (napas pendek) selama 4 hari Saya minum obat salbutamol dan actifed sirup. Apakah penyebabnya?', 'Asma merupakan penyakit saluran napas yang bersifat kronis (jangka panjang). Penyebab pasti dari penyakit ini masih belum diketahui, namun kejadiannya dapat dipicu oleh debu, asap rokok, cuaca dingin, kelelahan dan paparan zat kimia tertentu. \r\n\r\nJika anda sebelumnya pernah memeriksakan diri ke dokter dan telah didiagnosis mengalami asma, makas ebaiknya anda mengamati apa hal-hal yang menyebabkan penyakit asama anda kembuh. Hal ini disebabkan oleh sensitifitas tiap penderita asma terhadap zat tertentu berbeda-beda.\r\n\r\nsekian semoga bermanfaat ya    '),
(84, 'Anak saya umur 2,8 bulan sedang batuk pilek udah 1 minggu, napasnya agak sesak terus badan berkeringat tapi keringatnya dingin badan juga dingin, itu tanda penyakit apa?', 'Batuk merupakan salah satu mekanisme pertahanan tubuh untuk mengeluarkan benda asing di saluran nafas. Batuk pada anak merupakan hal yang sering terjadi dan pada beberapa kasus, batuk dapat menimbulkan kesulitan bernafas/sesak nafas. Batuk yang disertai kesulitan bernafas dapat disebabkan oleh beberapa penyakit, seperti:\r\n•	Flu, paling sering disebabkan infeksi virus, biasanya disertai pilek, bersin-bersin, dan demam.\r\n•	Asma, batuk biasanya disertai suara mengi akibat penyempitan saluran nafas dan biasanya memiliki keturunan atau keluarga dengan asma juga.\r\n•	Pneumonia, yaitu penyakit infeksi paru-paru, dimana terjadi batuk berdahak disertai nafas sesak/kesulitan bernafas, karena produksi lendir di paru-paru meningkat\r\n•	Croup, yaitu penyakit infeksi saluran pernafasan (laring, trakea, dan bronkus) yang menyebabkan produksi lendir berlebihan sehingga merangsang batuk dan kesulitan bernafas. Batuk biasanya memburuk di malam hari dan saat anak menangis\r\n•	Bronkiolitis, yaitu penyakit infeksi virus yang terjadi pada anak kurang dari 2 tahun yang disebabkan karena saluran kecil di paru-paru mengalami pembengkakan dan produksi lendir berlebihan sehingga batuk yang terjadi disertai tersengal, nafas cepat, dan suara serak.\r\n•	Pertusis atau batuk rejan, terjadi akibat infeksi bakteri pertusis yang menyebabkan saluran nafas meradang dan menyempit. Batuk rejan dapat dikenali dari rentetan batuk keras secara terus-menerus, diawali tarikan napas panjang lewat mulut (whooping cough).\r\nBronkitis adalah peradangan pada saluran nafas bronkial yang biasanya disebabkan oleh infeksi dan biasanya lebih sering terjadi pada orang dewasa. Penyakit akibat infeksi saluran nafas umumnya menyebabkan produksi lendir di saluran nafas berlebihan sehingga merangsang batuk, dan apabila produksi lendir ini terus terjadi dan pada anak-anak biasanya kesulitan untuk mengeluarkannya, dapat menimbulkan kesulitan bernafas. Kesulitan bernafas akan menyebabkan oksigen yang beredar di seluruh tubuh berkurang sehingga tubuh akan merespon dengan penyempitan aliran darah di bagian tubuh yang kurang penting seperti kulit, dll untuk meningkatkan aliran darah ke organ-organ vital. Oleh karena itu pada anak dengan sesak nafas dapat menyebabkan kaki dan tangan dingin. Untuk mengetahui penyebab dari batuk disertai kesulitan bernafas, sebaiknya konsultasikan ke dokter spesialis anak. Dokter akan melakukan pemeriksaan menyeluruh dan pemeriksaan penunjang bila dibutuhkan, seperti pemeriksaan laboratorium, rontgen, dll. Pengobatannya akan disesuaikan dengan penyebab timbulnya keluhan. Beberapa hal yang dapat dilakukan untuk mengurangi keluhan antara lain:\r\n•	Perbaiki kondisi kelembapan udara di kamar anak\r\n•	Perbanyak konsumsi air putih, atau minum minuman hangat seperti teh, jus jeruk lemon hangat, atau air putih hangat ditambah madu\r\n•	Hirup uap air panas untuk membantu mengencerkan lendir\r\n•	Makan makanan bergizi, kurangi makanan yang merangsang batuk, seperti makanan pedas, berminyak\r\n•	Istirahat yang cukup\r\nJangan ragu untuk segera kunjungi dokter jika batuk anak dirasakan semakin memberat apalagi bila disertai sesak nafas, nafas cepat, kaki dan tangan dingin, bibir biru, demam tinggi, anak tampak lemas, atau batuk disertai darah.\r\nDemikian, semoga bermanfaat. '),
(85, 'Mau bertanya kenapa ya obat mukolitik tidak dianjurkan untuk penderita asma? kenapa hanya ekspektoran? lalu kalau obat ekspektoran mukolitik itu diperbolehkan tidak?', 'Pada dasarnya asma merupakan kondisi dimana terdapat penyempitan salran nafas karena adanya peningkatan sensitifitas saluran napas terhadap zat tertentu (zat alergen). Biasanya penderita asma memiliki riwayat alergi atau riwayat keluarga dengan asma atau alergi lainnya. Dan kondisi asma dapat kambuh karena aktivitas fisik yang berat, seperti stres, kelelahan, infeksi, paparan debu, dingin, atau serbuk bunga.\r\nKedua jenis obat batuk tersebut memiliki prinsip yang sama yaitu pengencer dahak namun memiliki cara pengenceran dahak yang berbeda. Dan tentunya akan memiliki efek samping yang berbeda pula. Ekspektoran adalah obat yang merangsang pengeluaran dahak dari saluran pernapasan dengan merangsang selaput lendir lambung dan secara refleks merangsang sekresi kelenjar saluran pernapasan lewat saraf vagus, sehingga menurunkan kekentalan dahak dan dahak dapat dengan mudah dikeluarkan. Sedangkan golongan mukolitik adalah obat yang bekerja dengan mengencerkan sekret saluran pernapasan dengan memecah benarng-benang yg membentuk sputum. Agen mukolitik berfungsi dengan cara mengubah viskositas sputum melalui aksi kumia langsung pada ikatan komponen mukoprotein.\r\nKedua-duanya adalah obat yang dapat digunakan untuk kasus asma, namun tentunya penggunaannya disesuaikan dengan kondisi dari penderita, obat ekspektoran tidak disarankan untuk digunakan pada penderita asma dengan gangguan lambung. Sebaiknya penggunaan obat tersebut dikonsultasikan sebelumnya dengan dokter anda secara langsung, supaya anda juga diperiksa dengan seksama dan dokter bisa memilihkan obat batuk yg sesuai dengan kondisi saluran pernapasan anda. Demikian yang dapat kami sampaikan, semoga informasi dari kami bermanfaanuntuk anda. Terima kasih '),
(86, 'Jika terkena GERD, apakah dengan ventolin inhaler itu merupakan pengobatan yang cocok untuk asma? Atau justru yang kita fokuskan pengobatan kepada lambungnya?', 'GERD dan asma merupakan 2 kondisi medis yang berbeda namun dapat terjadi secara tumpang tindih atau bersamaan. Beberapa studi menyebutkan bahwa adanya GERD dapat memperberat gejala asma yang di timbulkan, meski mekanosme pastinya belum di ketahui dengan jelas.\r\nOleh sebab itu, di perlukan pula penanganan yang simultan atau bersamaan baik GERD maupun asma.\r\nUntuk sementara yang dapat anda lakukan antara lain:\r\n•	Menghindari debu, asap rokok, dan polusi\r\n•	Menghindari udara terlalu panas atau terlalu dingin\r\n•	Tidak merokok dan tidak mengkonsumsi alkohol\r\n•	Menghindari penggunaan selimut berbulu maupun boneka berbulu\r\n•	Mengganti sprei secara berkala\r\n•	Membersihkan tirai penutup jendela\r\n•	Menggunakan masker saat keluar ruangan, bila perlu\r\n•	Makan sehat dan teratur\r\n•	Makan lebih sering dengan porsi kecil\r\n•	Menghindari makan terlalu malam atau mendekati waktu tidur\r\n•	Menghindari makanan pedas, asam, berminyak, dan santan\r\n•	Menghindari minuman berkafein seperti kopi, teh dan bersoda\r\n•	Tidur dengan 2-3 bantal dengan posisi bersandar untuk mencegah asam lambung naik ke kerongkongan\r\n•	Olahraga rutin dan teratur\r\nBila keluhan yang anda rasakan tidak membaik, ada baiknya anda memeriksakan diri anda ke dokter yang sebelumnya merawat anda.\r\nSekian informasi dari saya, semoga membantu.'),
(87, 'Saya punya penyakit asma napas berbunyi dada saya setiap bangun tidur dingin kaya abis di kompres es batu. perut saya jadi buncit padahal saya coba tidak makan malah keras perut saya itu penyakit apa? ', 'Istilah asma digunakan untuk menggambarkan penyakit penyempitan pada saluran pernapasan, yang utamanya disebabkan oleh reaksi alergi, yang menyebabkan dinding-dinding dari saluran pernapasan membengkak dan mempersempit ruang pertukaran udara. Penyakit asma kebanyakan timbul sejak kecil dan berkurang ketika dewasa. Ketika penyakit asma tersebut semakin sering terjadi, maka bisa dibilang paparan alergen (penyebab alergi) lebih sering terjadi. Alergen bisa termasuk debu di sekitar, polusi, rokok, dan kotoran di kasur tempat tidur. Asma juga bisa terjadi pada kondisi infeksi saluran napas seperti misalnya radang paru atau pneumonia. \r\n\r\nTerkait perut buncit, kondisi bisa disebabkan oleh asupan makanan berlebihan, pembesaran organ dalam perut seperti organ hati, ataupun saluran pencernaan yang penuh misalnya terisi udara pada kasus kembung. Hal ini bisa berkaitan pula dengan sakit maag ataupun infeksi saluran pencernaan. Karena kompleksitas dari keluhan yang Anda paparkan, penting bagi Anda untuk memeriksakan diri terlebih dahulu ke dokter untuk menentukan sebab yang melatarbelakangi keluhan Anda. Berikut kami lampirkan artikel mengenai asma. Semoga bermanfaat.    '),
(88, 'Lalu bagaimana dengan tes fisiknya dok? Soalnya kan selain diperiksa mata, gigi, dll juga ada ronsen dada dok, apa itu ada pengaruhnya dok? Terakhir saya tes disalah satu poltekkes saya gagal dok, saya malah berfikir itu dikarenakan ronsen dari thorax nya saya yang seorang penderita asma dok. Terimakasih dok.  ', 'Syarat penerimaan setiap fakultas kedokteran memiliki kondisi masing masing pada tiap universitas. Umumnya tes kemampuan diri secara akademis (nilai dan tes akademis), pemeriksaan kesehatan dan tes buta warna, dan tes psikologis . Terkadang ada pula universitas yang memasukkan tes wawancara langsung kepada setiap calon mahasiswanya.\r\n\r\nSetiap tes memiliki porsi masing masing yang besarnya hanya diketahui oleh setiap universitas. Akan lebih baik dan jelas jika Anda langsung menanyakan kepada universitas yang Anda tuju alasan mereka tidak menerima Anda sebagai mahasiswanya.\r\n\r\nMenurut pemahaman kami, Asma bukanlah salah satu indikator bagi Anda untuk gagal diterima di fakultas kedokteran.\r\n\r\nJanganlah berkecil hati, Anda masih bisa melakukan tes di fakultas lain atau mencoba kembali tahun depan. Jangan patah semangat dan terus asah kemampuan diri Anda serta tingkatkan kesehatan hidup Anda dengan cukup beristirahat, konsumsi makanan sehat seimbang, olahraga rutin, hindari kebiasaan hidup buruk seperti merokok, bergadang dan minum alkohol. \r\n\r\nDengan kebiasaan hidup sehat maka kondisi tubuh dan stamina Anda bisa membaik.\r\n\r\nSemoga membantu.'),
(89, 'kena ppok. setelah divonis dokter spesialis paru. setelah menjalani pengobatan selama 1 tahun membaik hingga sembuh. terus 2 tahun ini saya batuk kering disertai sesak napas. akhirnya sama dokter divonis asma. pertanyaan saya. Apakah penyebabnya?', 'Gangguan kesehatan yang Anda alami yaitu asma, merupakan suatu jenis penyakit jangka panjang atau kronis pada saluran Pernapasan yang ditandai dengan Peradangan dan penyempitan saluran pernapasan yang menimbulkan sesak atau kesulitan bernapas. \r\n\r\nSelain gejala yang telah disebutkan diatas, penderita asma juga biasanya dapat merasakan nyeri dada, batuk - batuk, dan mengi (bunyi suara ketika bernapas pada saat asma kambuh). Asma dapat diderita oleh semua golongan usia, baik muda ataupun tua. \r\n\r\nSalah Satu pemicu yang dapat menimbulkan asma adalah terdapatnya riwayat infeksi paru-paru. Akan teTapi kemungkinan pemicu yang menimbulkan asma pada Anda adalah terdapatnya keluarga dengan riwayat penyakit asma juga. \r\n\r\nAsma sendiri merupakan penyakit yang dapat dikendalikan, asalkan Anda: mengenali dan menghindari pemicu asma, mengikuti rencana penanganan asma yang dibuat bersama dokter, mengenali serangan asma dan melakukan langkah pengobatan yang tepat, menggunakan obat - obatan asma yang disarankan oleh dokter secara teratur, memonitor kondisi saluran Napas Anda.    '),
(90, 'Saya mau tanya anak saya usia 3 setengah tahun sedang batuk, saat batuk dia seperti mau muntah tapi setelah batuk dia terengah engah bicarapun terengah engah, bibirnya merah seperti panas dalam jantungnya berdetak cepat, pernah diperiksa dan di tes darah katanya tipes tapi kalau anaknya aktif hanya batuk yang mengganggu anak saya, kira-kira kenapa?', 'Kondisi yang dialami anak Anda bisa berarti banyak hal, diantaranya adalah:\r\n•	Asma\r\n•	Bronkitis\r\n•	Infeksi saluran napas akut\r\n•	Penyakit jantung bawaan\r\nDan masih banyak kemungkinan lainnya tergantung dari hasil pemeriksaannya. Adapun untuk kondisi tipus, kemungkinan besar yang terjadi padanya waktu itu berbeda dengan apa yang terjadi padanya sekarang, karena tipus penyakitnya dicirikan dengan gejala demam, diare atau malah sulit BAB, pusing, lemas, nyeri otot, sakit perut, muncul ruam dan lidah kotor, bukan batuk. Jadi saran kami, sebaiknya Anda periksakan anak Anda pada dokter anak untuk mendapatkan pemeriksaan lebih lanjut meliputi penggalian riwayat mengenai kehamilan Anda dulu, kebiasaan dan pola hidup anak Anda selama ini dan riwayat penyakitnya, pemeriksaan fisik, dan penunjang seperti rekam jantung, rontgen dan USG. Dengan demikian bisa diketahui dengan jelas kemungkinan penyakit dan penanganan terbaiknya.\r\nSementara itu, tetap berikan nutrisi yang terbaik bagi anak Anda, hindari untuk jajan terlebih dahulu, jauhkan dari orang sakit, polusi dan asap, berikan air putih hangat, oleskan minyak kayu putih pada dadanya, dan jaga kebersihan makanan, minuman, tangan serta lingkungan rumah. Sekian, semoga menjawab pertanyaan Anda.'),
(91, 'Saya kan sedang hamil 12 minggu jadi saya memang mempunyai asma sejak dulu tapi semenjak 6 bulan ini tidak pernah kambuh tapi tiba-tiba pagi ini kambuh dan karena sudah tidak tahan lagi saya menggunakan inhaler yang semprot itu 2 kali.\r\napakah berbahaya bagi janin saya?\r\njika berbahaya apa yang harus saya lakukan mengatasi jika asma saya tiba-tiba kambuh dok? dan apakah saya bisa melahirkan normal dikemudian hari dok?', 'Asma pada ibu hamil dapat menimbulkan rasa khawatir pada ibu. Yang perlu diketahui bahwa ketika terjadi serangan asma maka dapat mengganggu asupan oksigen ke janin. Maka baiknya jika anda memiliki asma dan sedang hamil maka hindari pencetus asma. Pencetusnya dapat berupa asap rokok, debu, udara dingin, makanan dan minuman yang dapat memicu timbulnya keluhan, serta hindari stres psikis. \r\n\r\nJika anda memiliki asma maka pastikan bahwa dokter kandungan anda mengetahui keadaan anda sehingga dapat disarankan obat2an apa saja yang aman untuk janin. Walaupun pada umumnya obat asma aman untuk kehamilan. Obat asma lebih baik digunakan oleh ibu hamil jika manfaatnya lebih besar daripada efek sampingnya.\r\n\r\nJika selama kehamilan sering sekali mengalami serangan asma maka efek bagi kehamilan diantaranya:\r\n\r\n•	sulit dalam persalinan\r\n•	peningkatan tekanan darah selama kehamilan\r\n•	kelahiran prematur\r\n•	pertumbuhan janin terganggu\r\n•	berat badan bayi rendah\r\n\r\nMelihat efek samping yang ada, maka hindari pencetus asma dan rutinlah memeriksakan kehamilan, makan makanan yang bergizi, dan rutin mengecek pergerakan janin.\r\n\r\nbaca juga: asma ketika hamil\r\n\r\nSemoga bermanfaat '),
(92, 'Saya penderita asma sejak bayi namun saat menginjak usia remaja hingga umur 19 tahun asma saya tidak pernah kambuh. Namun akhir-akhir ini pada saat usia saya 20 tahun asma saya tiba-tiba kambuh dan membuat saya tidak bisa tidur dengan pulas dan hanya sekitar 2 jam tertidur. Kira-kira posisi tidur bagaimana yang nyaman bagi penderita asma?', 'Penyakit asma merupakan penyakit yang dapat diturunkan menandakan tubuh mempunyai kerentanan genetik yakni alergi, penyakit asma ditandai dengan penyempitan saluran nafas paru sehingga menyebabkan sulit bernafas, batuk-batuk dapat kering atau berdahak. Kekambuhan asma biasanya dipicu oleh sesuatu dapat udara dingin, udara kotor seperti debu, asap, AC kotor hingga makanan atau sedang terinfeksi penyakit paru lain seperti Faringitis atau Bronkitis.\r\n\r\nBila Asma yang sedang diderita kambuh sebaiknya memeriksakan diri ke dokter, dokter akan melakukan pemeriksan fisik paru, rontgen paru, pemeriksana darah dan pemeriksana spirometri bila perlu. Pengobatan pada penderita asma dapat menggunakan antihistamin, bronkodilator baik tablet atau hisap paru, mukolitik atau pengencer dahak, hingga antibiotik bila diperlukan. Pengobatan yang tepat dan cepat akan membantu penyembuhan, mencegah komplikasi dan mencegah kekambuhan. Dokter dapat memberikan pengobatan inhalasi atau hirup yang dapat digunakan sebagai pertolongan pertama saat mulai dirasakan sesak. Atau bila kekambuhan hampir setiap hari maka dokter akan memberikan pengobatan rutin secara hisap paru (inhalasi kontroler).\r\n\r\nYang dapat disarankan untuk cegah kekambuhan adalah paling utama menghindari kontak dengan pencetus kekambuhan, seperti hindari udara dingin malam, hindari mandi malam atau pagi dengan air dingin melainkan gunakan air hangat . Guankan masker bila berpergian untuk menghindair polusi dan cegah penularan virus dari penderita lain. Stop merokok atau berada dilingkungan merokok. Bersihkan ventilasi rumah, kipas atau AC rutin. Hindari makanan pencetus alergi bila ada seperti kacang-kacangan atau seafood. Posisi yang nyaman saat kambuh adalah setengah duduk dengan kemiringan 30-60 derajat. Namun penting untuk segera mengatasi sesak bila sedang kambuh seperti konsumsi obat atau mendapat terapi nebulasi obat bronkodilator di IGD terdekat. Bila tidak teratasi dengan pengobatan maka tidur akan sulit untuk nyenyak.  '),
(93, 'Saya penderita sesak asma, saya sempat ke Dokter, dan diberikan obat inhaler (dosis 160). Dan saya sudah menggunakan selama hampir 3 tahun, dan benar-benar lega & jarang kambuh, 1 botol 120 hirup bisa untuk 1 tahun. Apakah saya salah karena tidak pernah kontrol lagi ke Dokter & bila inhaler habis saya beli sendiri ke toko online.  ', 'Dalam mengatasi gejala Asma, dokter akan meresepkan obat asma sesuai dengan kebutuhan dan kondisi pasien. Obat asma ada yang berupa tablet minum maupun inhaler yang dapat dihirup. \r\n\r\nObat inhaler yang tersedia memiliki banyak jenis, misalnya obat anti radang (kortikosteroid), atau teofilin untuk merelakskan otot-otot pernapasan. Intinya obat inhaler ada yang bertugas sebagai pereda dan pencegah.\r\n\r\nMeski sebagian besar obat inhaler ditujukan untuk penggunaan jangka panjang, namun anda sebaiknya tidak membeli obat tersebut tanpa menggunakan resep dokter. Setidaknya penderita disarankan untuk melakukan kontrol paling lama satahun sekali. Dokter akan mengevaluasi kondisi terkini anda, apakah perlu diturunkan dosisnya atau bahkan perlu mengganti jenis obat karena kondisi anda saat ini mungkin memiliki kontraindikasi untuk menggunakan obat inhaler yang sebelumnya anda gunakan.\r\n\r\nPenggunaan jangka panjang tanpa pengawasan dokter juga beresiko tinggi terjadinya efek samping seperti kram otot, sakit kepala, infeksi jamur pada mulut, batuk-batuk, hingga irama jantung tidak teratur.\r\n\r\nSelain menggunakan obat-obatan, penderita asam juga dihimbau untuk mengkonsumsi makanan sehat dan bergizi seimbang, menghindari pencetus asma, dan melakukan olah raga secara rutin.'),
(94, 'Usia 40 tahun saya asma sejak usia 15 tahun sudah 25 tahun. selama ini sesaknya kalau malam saja. namun setahun ini setelah saya melahirkan anak. Setiap hari sesak baik siang maupun malam. saya menggunakan obat semprot dan hirup. saya ingin mengurangi / tidak mau tergantung obat bagaimana caranya? apakah saya boleh hamil lagi?', 'Asma merupakan penyakit peradangan dan penyempitan saluran nafas yang timbul karena adanya faktor pencetus yaitu allergen. Asma bersifat kronis (jangka panjang), tidak dapat disembuhkan, namun bisa dikontrol gejalanya. Yang terpenting dari pengobatan asma adalah:\r\n\r\n1.     Menghindari faktor pencetusnya. Cari hal-hal yang biasa membuat Anda sesak lalu hindarilah hal-hal tersebut. Jika perlu, Anda bisa ke rumah sakit dan meminta pemeriksaan alergi agar Anda tau Anda alergi pada hal apa saja, sehingga Anda dapat menghindarinya.\r\n\r\n2.     Minum dan konsumsi obat secara teratur dari dokter.\r\n\r\n3.     Kontrol pada dokter secara teratur untuk melihat respon Anda terhadap obat yang diberikan, melihat perkembangan kondisi Anda, dan menyesuaikan dosis yang Anda perlukan. Dokter dapat mempertimbangkan pengubahan dosis sesuai dengan kemajuan kondisi Anda. Jika menurut pemeriksaan kondisi Anda makin lama makin baik, dokter bisa secara bertahap mengurangi hingga menghentikan pengobatan pengontrol.\r\n\r\nAnda dapat mengonsultasikan hal ini pada dokter spesialis paru. Jika ingin hamil lagi, konsultasikan hal ini pada spesialis kandungan juga. Karena, usia 40 tahun merupakan salah 1 risiko tinggi kehamilan terlebih Anda memiliki riwayat asma. Kehamilan risiko tinggi adalah kondisi dimana kehamilan dapat mengancam kesehatan dan keselamatan ibu dan janin. Contoh kehamilan risiko tinggi adalah:\r\n\r\n1.     Usia terlalu muda (di bawah 18 tahun) atau terlalu tua (di atas 35 tahun)\r\n\r\n2.     Kehamilan kelima atau lebih\r\n\r\n3.     Jarak antar kehamilan di bawah 2 tahun dan di atas 5 tahun\r\n\r\n4.     Penyakit dan kondisi kesehatan ibu, seperti penyakit paru, jantung, ginjal, kelainan darah, konsumsi alkohol, obat-obatan terlarang, merokok\r\n\r\n5.     Ada gangguan/kelainan pada alat reproduksi Ibu\r\n\r\nSekian, semoga bermanfaat yaa. '),
(95, 'Saya menderita penyakit asma sejak kecil. setiap hari saya mengkonsumsi obat TEOSAL. dan saya mau ganti obat sepmrot inhaler. kira kira merk obat inheler yang dosisnya sama dengan teosal?', 'Pada orang dengan asma, seringkali memang harus mengonsumsi obat jangka panjang. Asma terdiri dari beberapa derajat, bergantung kepada frekuensi serangan dan seberapa berat gejala yang timbul. Orang dengan asma umumnya harus menjalani pemeriksaan fungsi paru setidaknya sekali setahun. Hal tersebut penting untuk dilakukan, agar dokter dapat memantau kemajuan penyakit. Dokter akan menyesuaikan jenis dan dosis obat berdasarkan hasil pemeriksaan fungsi paru anda.\r\nObat yang anda konsumsi tersebut berisi 1 mg salbutamol dan 130 mg teofilin. Inhaler terdiri dari dua jenis, yaitu inhaler pereda dan inhaler pencegah. Obat yang digunakan pada inhaler pereda umumnya adalah golongan short-acting beta agonist. Inhaler pereda digunakan saat terjadi serangan. Inhaler pencegah digunakan sebelum timbulnya serangan. Umumnya inhaler pencegah mengandung steroid anti inflamasi. Bila penggunaan inhaler sangat sering dalam seminggu, maka harus dikaji ulang jenis dan dosis obatnya. Dokter juga mungkin saja akan memberikan inhaler yang mengandung long-acting beta agonist. Teofilin umumnya dikonsumsi secara oral.\r\nMaka dapat anda tarik kesimpulan bahwa perpindahan obat dari obat oral kepada inhaler, tidak dapat anda lakukan begitu saja tanpa konsultasi dengan dokter yang merawat anda. Dokter perlu mengetahui dulu fungsi paru anda, mencari jenis inhaler yang cocok, dan mengkaji adakah masalah pada penggunaan inhaler. Harap anda tidak sembarangan memakai inhaler, karena penggunaan yang tidak tepat, bukan tidak mungkin akan menimbulkan komplikasi fatal.\r\nSemoga jawaban ini dapat membantu anda'),
(96, 'Saya punya masalah dok, dibagian belakang, tulang terasa ngilu, gatal dibagian kaki dan tangan, dan juga pernapasan terasa sesak, sering pusing. Kira-kira itu penyakit apa ya dok? Dan bagaimana cara mengatasinya !!!   ', 'Pada dasarnya gejala yang Anda kemukakan bisa saja tidak berkaitan satu sama lain. Nyeri pada bagian belakang yang disertai ngilu-ngilu pada tulang bisa disebabkan oleh peradangan sendi, cidera pada tulang, hingga kram pada otot punggung, misalnya oleh karena kesalahan postur dalam jangka waktu lama. Pada kasus yang tidak terlalu sering, saraf kejepit juga bisa menyebabkan sakit punggung. Sementara rasa gatal pada kaki tangan, bisa disebabkan oleh peradangan kulit akibat paparan produk yang iritan atau reaksi alergi akibat makanan/minuman/obat-obatan tertentu. Selain itu infeksi pada kulit yang bisa disebabkan oleh bakteri, virus, maupun jamur juga perlu dipikirkan, disamping kemungkinan gigitan serangga. Untuk pernapasan yang sesak bisa disebabkan oleh masalah pada sistem pernapasan seperti asma, proses alergi, maupun infeksi saluran napas, atau masalah di luar sistem pernapasan seperti asam lambung hingga gejala psikis seperti cemas, begitu pula dengan pusing yang bisa menyertai beberapa penyakit.\r\n\r\nOleh karena gejala yang cenderung kompleks dan bisa tidak memiliki kaitan satu sama lain, maka tentunya diperlukan pemeriksaan fisik secara langsung oleh dokter diikuti dengan penunjang bila memang diperlukan. Hal ini tentunya juga dibarengi perubahan gaya hidup seperti menghindari makanan pemicu asam lambung seperti makanan pedas, bersantan, dan minuman berkafein. Penuhi kecukupan istirahat dan konsumsi cairan 2-3 liter per hari. Berikut kami lampirkan artikel mengenai sesak. Semoga bermanfaat.'),
(97, 'Saya mau bertanya. Saya kan punya asma, tapi tiap kali minum salbutamol jadi berdebar, pusing, dan mual. Apa saya alergi dengan obat ini?', 'Salbutamol merupakan golongan agonis beta yang digunakan untuk melebarkan bronkus (saluran pernapasan). Umum digunakan pada orang dengan asma atau penyakit paru obstruktif kronik. Gejala yang anda rasakan merupakan efek samping dari salbutamol. Efek samping dapat berupa berdebar, denyut jantung tidak teratur, nyeri dada, sakit kepala, mual muntah, diare, atau gemetar.\r\nKonsultasikan hal ini dengan dokter yang selama ini menangani anda. Ceritakan mengenai efek tersebut. Dokter mungkin perlu menyesuaikan dosis obat atau mengganti jenis obat. Sementara ini, bila anda mengalami sesak napas kembali, anda dapat mencoba mengunjungi IGD atau poliklinik, beritahukan kepada dokter mengenai gejala anda agar dokter tidak memberikan salbutamol.\r\nDemikian informasi dari saya, semoga bermanfaat.'),
(98, 'Apakah melia propolis berbahaya untuk penderita asma? amankah bila saya meminum propolis setiap hari?', 'Membeli produk herbal adalah hak Saudari, namun pastikanlah produk tersebut terdaftar dalam BPOM (meskipun sudah terdaftar, tidak menutup kemungkinan produk tersebut bisa ditarik suatu saat dan dikeluarkan dari daftar BPOM), cek tanggal kadaluarsanya, pastikan isi/kandungannya, ikuti cara pakai yang tertera di label, bacalah apabila ada tertulis kontraindikasi pemakaian. Sebaiknya sebelum mengkonsumsi herbal tersebut, berkonsultasilah pada dokter, terutama dokter yang telah mengetahui riwayat penyakit Sudari, karena dikhawatirkan dapat terjadi interaksi yang merugikan.\r\nDisarankan juga, sebaiknya obat herbal tidak dijadikan pengobatan tunggal, melainkan dijadikan pelengkap terapi setelah berkonsultasi dengan dokter. Sampai sekarang belum ada penelitian ilmiah berskala besar yang menguji efektifitas dan efek samping dari herbal yang Saudari sebutkan.\r\nAkhir kata, bijaklah dalam mengkonsumsi obat herbal. Adapun kondisi yang membuat Saudari harus berkonsultasi sebelum mengkonsumsi obat herbal adalah: kondisi hamil dan menyusui, pasien yang berencana operasi, dalam pengobatan penyakit tertentu dan mengalami gangguan organ (jantung, ginjal, liver).\r\nSekian jawaban kami, mudah-mudahan bermanfaat.'),
(99, 'Saya sekarang sedang menyusui anak saya yang berumur baru 1 minggu. Sekarang asma saya kambuh, apakah bisa saya minum obat salbutamol atau itu akan mengganggu bayi saya?', 'Asma bronkhiale (asma) terjadi akibat peradangan kronis di saluran napas bagian bawah, tepatnya bronkhus. Kondisi ini disebabkan oleh reaksi hipersensitifitas, yang kerap dipicu oleh faktor genetik (bawaan), perubahan cuaca, kelelahan, pajanan alergen tertentu, infeksi saluran napas, stres, atau juga efek samping obat tertentu.\r\n\r\nSerangan asma bisa terasa sangat mengganggu penderitanya. Biasanya, gejala yang muncul adalah berupa sesak napas, batuk-batuk, disertai bunyi napas yang mengganggu, yakni mengi (ngik-ngik). Pada kondisi yang cukup berat, penderita bisa mengalami kesulitan untuk tidur akibat sesak napas tersebut. Hal ini tentu bisa menganggu proses menyusui dan bisa mempengaruhi produksi ASI.\r\n\r\nMengatasi asma saat menyusui tidak boleh dilakukan sembarangan. Hal ini dikarenakan, sedikit atau banyak obat asma yang Anda konsumsi akan disekresikan juga dalam ASI yang dikonsumsi bayi Anda. Termasuk juga salbutamol. Dalam kaitannya dengan keamanannya saat digunakan oleh ibu hamil dan menyusui, obat ini termasuk dalam kategori C, yakni tampak adanya efek samping pada janin di percobaan yang dilakukan pada binatang, namun belum ada studi terkontrol yang dilakukan pada manusia. Banyak ahli lebih merekomendasikan penggunaan salbutamol inhaler karena konsentrasinya yang lebih sedikit dijumpai pada ASI dibandingkan dengan sambutamol oral. Akan tetapi, kembali lagi, penggunaan salbutamol bagi ibu menyusui sebaiknya HANYA dilakukan di bawah resep dan pengawasan dokter. Bila memang dokter merasa manfaat yang dihasilkan lebih banyak dari efek samping yang mungkin ditimbulkan, maka pemberian obat mungkin bisa dilakukan. Namun bila tidak, maka alternatif terapi lain bisa dipertimbangkan. Oleh karenanya, periksakan langsung diri Anda ke dokter agar mendapatkan penanganan terbaik ya..\r\n\r\nSaat ini, Anda bisa redakan serangan asma Anda dengan cara berikut:\r\n\r\n•	Tenangkan diri Anda, jangan cemas atau panik\r\n•	Duduk tegak sedikit bersandar, sambil atur napas secara perlahan, yakni dengan menarik napas 2 detik melalui hidung, lalu hembuskan 3 detik melalui mulut, lakukan berulang\r\n•	Pindah ke ruangan yang nyaman, tidak terlalu banyak orang, tidak bising, dan bersirkulasi udara baik\r\n•	Kenali pencetus asma Anda, dan hindari pencetus tersebut\r\n•	Jauhi rokok dan asapnya\r\n\r\nSemoga membantu ya..  '),
(100, 'Sering sesak napas kalau saya banyak pikiran tapi saya tidak punya penyakit darah tinggi. setiap ada masalah dan selalu terpikirkan pasti sesak. Tetapi saya di ronsen paru saya normal. hanya hilus. jadi lendir paru berlebihan kenapa?', 'Kondisi sesak napas yang Anda alami paling sering disebabkan oleh karena asma, dimana asma merupakan penyakit kronis yang disebabkan oleh karena peradangan di dalam saluran pernapasan.\r\n\r\nPeradangan ini membuat saluran pernapasan membengkak dan sangat sensitif, sehingga saluran pernapasan menyempit, menyebabkan kurangnya udara yang mengalir ke paru - paru.\r\n\r\nGejala - gejala asma sendiri diantaranya adalah: batuk (berdahak), mengi suara siulan melengking yang muncul ketika bernapas, dada sesak, dada terasa terkesan, sulit tidur, dll.\r\n\r\nPemicu yang dapat menyebabkan timbulnya asma diantaranya adalah: stress psikologis, alergen, paparan polusi, infeksi paru - paru, aktivitas fisik=== olahraga, makanan dan minuman tertentu, dsb.\r\n\r\nSelain dari asma, sesak napas juga dapat disebabkan oleh karena: pilek, alergi, anemia, sinusitis, tuberkulosis / TBC, tekanan darah rendah, pneumonia, kanker paru - paru, penyakit paru obstruktif kronik, gangguan pada jantung, dll.\r\n\r\nCobalah diskusikan masalah ini dengan Dokter Spesialis Penyakit paru agar Anda dapat dilakukan serangkaian pemeriksaan lebih lanjut, sehingga penyebab pasti dari keadaan ini diketahui dan akhirnya penanganan yang tepat dapat diberikan.  ');
